(2049, 'Ссылки: Каталог ссылок', 'Ссылки', 0, 1, '$f_AdminCommon\r\n$t_prefix\r\n<ol start=''".($curPos+1)."''>', '</ol>\r\n".browse_messages($cc_env, 10)."', '<li>\r\n<h3><a href=".opt_case( $f_SiteURLCom, $f_SiteURLCom, $f_SiteURL ).">$f_SiteName</a></h3>\r\n".opt($admin_mode, LM_PopupLink($f_SiteURL, $f_SiteBackURL))."\r\n<br>\r\n".opt($admin_mode && !$f_Checked, "<div style=''color:red''>".NETCAT_MODULE_LINKS_TURNED_OFF." $f_SiteUnchecked</div>")."\r\n".opt_case($f_SiteCodeCom, $f_SiteCodeCom, $f_SiteCode)."<br>\r\n<span style=''color:green''>$f_SiteURL</span> <a href=$fullLink>@</a>\r\n$f_AdminButtons\r\n</li>', 10, 'Priority, Created desc', '<b><a href=".opt_case($f_SiteURLCom, $f_SiteURLCom, $f_SiteURL).">$f_SiteName</a></b><br>\r\n".opt($admin_mode && !$f_Checked, "<font color=red>".NETCAT_MODULE_LINKS_TURNED_OFF." $f_SiteUnchecked</font><br>")."\r\n".opt_case($f_SiteCodeCom, $f_SiteCodeCom, $f_SiteCode)."<br>\r\n".opt($admin_mode, LM_PopupLink($f_SiteURL, $f_SiteBackURL))."\r\n', '', '', 0, '', '', '".LM_Send_Mail_Added()."', '', '', '', '', 0, 'if( isset($srch) ) $srch = $db->escape($srch);\r\n$is_root = 0;\r\nif( !$current_sub[Parent_Sub_ID] )\r\n	$is_root = 1;\r\nelseif( !listQuery(''select count(Sub_Class_ID) as count from Sub_Class where Class_ID=''.$MODULE_VARS[linkmanager][LINKS_CLASS].'' and Subdivision_ID=''.$current_sub[Parent_Sub_ID] , ''$data[count]'') )\r\n	$is_root=1;\r\n\r\nif ($is_root){\r\n	$ignore_sub = 1;\r\n	$ignore_cc = 1;\r\n	$t_pref = "\r\n		<form action=''{$_SERVER[REQUEST_URI]}'' method=''get''>\r\n			<input type=''text'' size=''25'' name=''srch'' value=''".htmlspecialchars($srch, ENT_QUOTES)."''> <input type=''submit'' value=''".NETCAT_MODULE_LINKS_DO_SEARCH."''>\r\n		</form>\r\n		<a href=''rules/''>".NETCAT_MODULE_LINKS_RULES."</a> // <a href=''codes/''>".NETCAT_MODULE_LINKS_CODES2."</a>";\r\n	if($srch) $query_where = "SiteName like ''%$srch%'' or SiteURL like ''%$srch%'' or SiteCode like ''%$srch%''";\r\n}else{\r\n	$t_pref = listQuery("select Hidden_URL from Subdivision where Subdivision_ID=".$current_sub[Parent_Sub_ID], "<a href=".$SUB_FOLDER."\\$data[Hidden_URL]>".NETCAT_MODULE_LINKS_GO_UP."</a> // <a href=$addLink>".NETCAT_MODULE_LINKS_ADD_SITE."</a>");\r\n}\r\n\r\n\r\nif( listQuery("select count(Subdivision_ID) as count from Subdivision where Parent_Sub_ID=$sub and Checked=1", ''$data[count]'') ){\r\n	$res1 = mysql_query("select Subdivision_ID, Subdivision_Name, Hidden_URL from Subdivision where Parent_Sub_ID=$sub and Checked=1 order by Priority");\r\n	while( $row = mysql_fetch_assoc($res1) ){\r\n		$i++;\r\n		$t_prefix .= "<tr><td valign=''top''><a href=".$SUB_FOLDER.$row[Hidden_URL].">".$row[Subdivision_Name]."</a> ".listQuery("select count(Message_ID) as count from Message".$MODULE_VARS[linkmanager][LINKS_CLASS]." where Subdivision_ID=".$row[Subdivision_ID]." and Checked=1", "(\\$data[count])")."</td></tr>";\r\n	}\r\n}\r\n\r\n\r\n$t_prefix = "<table width=''100%'' border=''0''>$t_prefix</table>$t_pref";', '$warn = LM_Verify_Link($f_SiteURL, $f_SiteCode, $f_SiteBackURL, 0, $f_SiteEmail, "add");\r\nif ($warn)\r\n{\r\n $warnText=$warn;\r\n $posting=0;\r\n}\r\n', '$warn = LM_Verify_Link($f_SiteURL, $f_SiteCode, $f_SiteBackURL, $message, $f_SiteEmail, "edit");\r\nif ($warn)\r\n{\r\n $warnText=$warn;\r\n $posting=0;\r\n}', '', '', 0, 0, '', '', '', 'Компонент используется в модуле "Управление ссылками".\r\nБолее подробная информация о компоненте содержится в документации к этому модулю.', '', 0, 'useful', 0, '/2049/', '', 0),
(2050, 'Ссылки: Коды ссылок', 'Ссылки', 0, 1, '$f_AdminCommon\n<h3>".opt_case($totRows>1, NETCAT_MODULE_LINKS_CODE_VARIANTS, NETCAT_MODULE_LINKS_CODE_NO_VARIANTS)."</h3>', '', '<hr size=''1''>\n<b>Сайт:</b>&nbsp;&nbsp;<a href=''$f_SireURL''>$f_SiteName</a>\n<div style=''height:15px;''></div>\n$f_AdminButtons\n<b>".NETCAT_MODULE_LINKS_LINK_PREVIEW."</b><br/>\n".opt_case($f_SiteText, $f_SiteText, "<a href=$f_SiteURL>$f_SiteName</a>")."\n<div style=''height:15px;''></div>\n<b>".NETCAT_MODULE_LINKS_LINK_HTML."</b><br/><br/>\n<textarea cols=''60'' rows=''4'' >$f_SiteText</textarea>', 20, 'rand()', '', '', '', 0, '', '', '', '', '', '', '', 0, '', '', '', '', '', 0, 0, '', '', '', 'Компонент используется в модуле "Управление ссылками".\nБолее подробная информация о компоненте содержится в документации к этому модулю.', '', 0, 'useful', 0, '/2050/', '', 0),
(2051, 'Ссылки: Продажа ссылок', 'Ссылки', 0, 1, '$f_AdminCommon\r\n".opt($admin_mode, "<ul>")."', '".opt($admin_mode, "</ul>")."', '".opt_case($admin_mode,\r\n"<li> $f_SiteName, email $f_SiteEmail, ".NETCAT_MODULE_LINKS_DISABLE_DATE.": $f_SiteTurnoff<br>\r\n$f_SiteText\r\n$f_AdminButtons\r\n<p>",\r\n"$f_SiteText")."\r\n', 100, '', '', '', '', 0, '', '', '', '', '', '', '', 0, '', '', '', '', '', 0, 0, '', '', '', 'Компонент используется в модуле "Управление ссылками".\nБолее подробная информация о компоненте содержится в документации к этому модулю.', '', 0, 'useful', 0, '/2051/', '', 0),
