(1, 'Основной шаблон', 1, '<div id=''%ID'' class=''nc_comments''>', '<div id=''%ID'' style=''margin:10px 0 0 0; padding: 5px; border: 1px dashed #cccccc; ''>\r\n<div style=''line-height:25px;".("%IS_NEW" ? "background-color: #ffbf7a;" : "")."''>\r\n<span>".("%USER_AVATAR" ? "<img src=''%USER_AVATAR'' width=''20'' height=''20'' />" : "")."\r\n<b>".(%USER_ID ? "<a style=''vertical-align: top;'' href=''".nc_auth_profile_url(%USER_ID)."''>%USER_NAME</a>" : (''%GUEST_NAME'' ? ''%GUEST_NAME'' : ''Гость''))." </b></span><span style=''float: right;''>".date("d.m.Y H:i:s", %DATE)."</span></div>\r\n<div>%COMMENT</div>\r\n<div>%REPLY_LINK &nbsp; %EDIT_LINK &nbsp; %DELETE_LINK</div>\r\n%REPLY_BLOCK\r\n</div>', '<div id=''%ID'' style=''margin:5px 0px 5px 20px; ''>\r\n<div style=''line-height:25px;".("%IS_NEW" ? "background-color: #ffbf7a;" : "")."''>\r\n<span>".("%USER_AVATAR" ? "<img src=''%USER_AVATAR'' width=''20'' height=''20'' />" : "")."\r\n<b>".(%USER_ID ? "<a href=''".nc_auth_profile_url(%USER_ID)."''>%USER_NAME</a>" : (''%GUEST_NAME'' ? ''%GUEST_NAME'' : ''Гость''))." </b></span><span style=''float: right;''>".date("d.m.Y H:i:s", %DATE)."</span></div>\r\n<div>%COMMENT</div>\r\n<div>%REPLY_LINK &nbsp; %EDIT_LINK &nbsp; %DELETE_LINK</div>\r\n%REPLY_BLOCK\r\n</div>', '<a href=''#'' id=''%ID'' onclick=''%ACTION''>%TEXT</a>', '<a href=''#'' id=''%ID'' onclick=''%ACTION''>%TEXT</a>', '<a href=''#'' id=''%ID'' onclick=''%ACTION''>%TEXT</a>', '<a href=''#'' id=''%ID'' onclick=''%ACTION''>%TEXT</a>', '<div>\r\n<span id=''%GUEST_NAME_ID''>Ваше имя<input type=''text'' name=''%GUEST_NAME_ID''></span> \r\n<span id=''%GUEST_EMAIL_ID''>Ваш email<input type=''text''  name=''%GUEST_EMAIL_ID''></span>\r\n".(%ISBBCODES ? nc_bbcode_bar(''this'', ''%FORM_ID'', ''%TEXTAREA_ID'', 1, array("SIZE", "COLOR", "SMILE", "B", "I", "U", "S", "LIST", "QUOTE", "CODE", "IMG", "URL"), "<div style=''margin:5px 0''>", "</div>", true) : "")."\r\n<textarea id=''%TEXTAREA_ID'' name=''%TEXTAREA_ID'' style=''width:50%''>%TEXTAREA_VALUE</textarea>\r\n<br/>\r\n ".( $AUTH_USER_ID ? "" : "".nc_captcha_formfield()."\r\n <br/>\r\nВведите код на картинке: <input type=''text'' name=''nc_captcha_code'' value=''''>\r\n" )."\r\n<br/> <button id=''%SUBMIT_BUTTON_ID'' name=''%SUBMIT_BUTTON_ID''>".NETCAT_MODULE_COMMENTS_ADD_FORM_APPEND_BUTTON."</button> <button onclick=''%CANCEL_BUTTON_ACTION'' id=''%CANCEL_BUTTON_ID'' name=''%CANCEL_BUTTON_ID''>".NETCAT_MODULE_COMMENTS_ADD_FORM_CANCEL_BUTTON."</button>\r\n</div>', '<div>\r\n".(%ISBBCODES ? nc_bbcode_bar(''this'', ''%FORM_ID'', ''%TEXTAREA_ID'', 1, array("SIZE", "COLOR", "SMILE", "B", "I", "U", "S", "LIST", "QUOTE", "CODE", "IMG", "URL"), "<div style=''margin:5px 0''>", "</div>", true) : "")."\r\n<textarea id=''%TEXTAREA_ID'' name=''%TEXTAREA_ID'' style=''width:50%''>%TEXTAREA_VALUE</textarea>\r\n<br/>\r\n<button id=''%SUBMIT_BUTTON_ID'' name=''%SUBMIT_BUTTON_ID''>".NETCAT_MODULE_COMMENTS_ADD_FORM_UPDATE_BUTTON."</button> <button onclick=''%CANCEL_BUTTON_ACTION'' id=''%CANCEL_BUTTON_ID'' name=''%CANCEL_BUTTON_ID''>".NETCAT_MODULE_COMMENTS_ADD_FORM_CANCEL_BUTTON."</button>\r\n</div>', '<div style=''margin:5px 0;''>\r\n<button id=''%SUBMIT_BUTTON_ID'' name=''%SUBMIT_BUTTON_ID''>".NETCAT_MODULE_COMMENTS_ADD_FORM_DELETE_BUTTON."</button> <button onclick=''%CANCEL_BUTTON_ACTION'' id=''%CANCEL_BUTTON_ID'' name=''%CANCEL_BUTTON_ID''>".NETCAT_MODULE_COMMENTS_ADD_FORM_CANCEL_BUTTON."</button>\r\n</div>', '</div>', 'Login', NULL, '<div style=''color:#455445''>Ваш комментарий успешно добавлен и будет опубликован после просмотра модератором.</div>', '<b><div style=''color:#455445''>%WARNTEXT</div></b>', '<div id=''nc_new_comment_button'' style=''background: none repeat scroll 0 0 #999999; float: right; position: fixed; right: 0; top: 43%; width: 30px; height: 30px;'' onclick=''%NEW_COMMENT_BUTTON_ACTION''></div>', '".($curPos ? "<a href=''#'' onclick=''%FIRST_ONCLICK''>&raquo;&raquo;</a>&nbsp;&nbsp;" : "")."\r\n".browse_messages($env, 10, $browse_comments)."\r\n".($last_page ? "&nbsp;&nbsp;<a href=''#'' onclick=''%LAST_ONCLICK''>&raquo;&raquo;</a>" : "")."', '<a href=''#'' onclick=''%SHOW_ALL''>Показать все</a>');
