INSERT INTO `Documentation` (`Documentation_ID`, `Type`, `Name`, `Signature`, `ShortHelp`, `FullHelp`, `Module_ID`, `Parent`, `Areas`) VALUES
(93, 'function', 'browse_messages', 'browse_messages ( $cc_env, $range )', '<p>\r\n	Отображает блок навигации по страницам списка объектов компонента в формате «1 2 3 &gt;&gt;».</p>', '<p>Массив $cc_env является неизменным параметром данной функции и содержит переменные окружения текущего компонента раздела. Параметр $range определяет количество выводимых страниц. Вместо этой переменной обычно пишется число. Подразумевается, что из множества страниц одновременно будет показываться только список из $range страниц. Например, ваш листинг состоит из 20 страниц. Если $range=10, то, находясь на первой странице, вы будете видеть страницы с 1 по 10, находясь на 15-й странице, вы будете видеть страницы 10-20. Для настройки формата отображения используется массив $browse_msg[], значения которого указываются в настройках макета дизайна. Макропеременная %PAGE обозначает номер страницы, макропеременная %URL – ссылку на соответствующие страницы. Возможно также использование макропеременных %FROM и %TO, соответственно обозначающих номера начального и конечного объекта на странице.</p>\r\n<pre><code class=''language-php''>$browse_msg[prefix] = ""; // Префикс перед блоком навигации\r\n$browse_msg[suffix] = ""; // Суффикс после блока навигации\r\n$browse_msg[active] = "%PAGE"; // Формат вывода текущей страницы\r\n$browse_msg[unactive] = "<a href=%URL>%PAGE</a>"; // Формат вывода ссылок\r\n$browse_msg[divider] = " "; // Разделитель между ссылками</code></pre>', NULL, '', 'ClassForm_FormPrefix ClassForm_RecordTemplate ClassForm_FormSuffix ClassForm_RecordTemplateFull ClassForm_Settings'),
(94, 'function', 'nc_browse_cc', 'nc_browse_cc ( $template )', 'Выводит список ссылок по компонентам раздела в соответствии с шаблоном $template.', '', NULL, '', 'TemplateForm'),
(95, 'function', 'nc_browse_sub', 'nc_browse_sub( $browse_parent_sub, $browse_template, $ignore_check = 0, $where_cond = "", $level = 0 )', 'Выводит список подразделов раздела $parent_sub в соответствии с шаблоном $template.', 'C помощью флага $ignore_check можно игнорировать вывод только включённых разделов ( если $ignore_check равен 1, то выведутся все разделы ). С помощью $where_cond можно дополнить запрос в секции WHERE.', NULL, '', 'TemplateForm'),
(96, 'function', 'nc_browse_level', 'nc_browse_level( $level, $browse_template )', 'Выводит список разделов уровня $level в соответствии с шаблоном $template.', 'Обратите внимание, что нумерация уровней начинается с нуля, т.е. Для вывода списка разделов верхнего уровня первый параметр функции должна быть равен нулю.', NULL, '', 'TemplateForm'),
(97, 'function', 'nc_browse_path', 'nc_browse_path( $browse_template )', 'Выводит навигацию типа "хлебные крошки" (путь до текущей страницы) в соответствии с шаблоном $template.', '', NULL, '', 'TemplateForm'),
(98, 'function', 'nc_browse_catalogue', 'nc_browse_catalogue( $browse_template )', 'Функция выводит список сайтов (блок навигации) в соответствии с\r\nшаблоном, описанным в хэш-массиве $template', '<div>\r\n	Массив должен иметь&nbsp;элементы со следующими индексами:</div>\r\n<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Индексы</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					prefix</td>\r\n				<td>\r\n					выводится перед списком</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					suffix</td>\r\n				<td>\r\n					выводится после списка</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					active</td>\r\n				<td>\r\n					шаблон вывода активного элемента списка (а данном случае это&nbsp;касается текущего сайта)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					active_link</td>\r\n				<td>\r\n					шаблон вывода активного элемента списка в том случае, если ссылка&nbsp;на этот элемент идентична адресу текущей страницы</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					unactive</td>\r\n				<td>\r\n					<div>\r\n						шаблон вывода неактивного элемента списка (в данном случае это&nbsp;касается всех сайтов, кроме текущего)</div>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					divider</td>\r\n				<td>\r\n					шаблон разделителя между элементами списка</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					sortby</td>\r\n				<td>\r\n					признак сортировки элементов</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', NULL, '', 'TemplateForm'),
(99, 'function', 'nc_browse_path_range', 'nc_browse_path_range( $from, $to, $browse_template, $reverse = 0, $show = 0 )', 'Функция аналогична s_browse_path(), но выводит только путь указанного\r\nдиапазона (минимальное значение $from – (-1), максимальное значение\r\n$to - $sub_level_count), в соответствии с шаблоном, описанным в\r\nмассиве $template.', '', NULL, '', 'TemplateForm'),
(100, 'function', 'nc_put_field', 'nc_put_field (string $field_name, [string $style, [int $classID, [bool $caption]]] )', 'Функция генерирует поле любого типа.', '<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры&nbsp;</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					параметры отображения поля, например: «size=''50'' class=''my_field''»</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					<div>\r\n						идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</div>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					<div>\r\n						выводить или не выводить описание над генерируемым полем</div>\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(101, 'function', 'nc_list_field', 'nc_list_field ( string $field_name, [string $style, [int $classID, [bool $caption, [mixed $selected, [mixed $disabled, [bool $ignore_check]]]]]] )', 'Функция генерирует поле типа «Список».', '<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					<div>\r\n						параметры отображения поля, например:&nbsp;«class=''my_field''»</div>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					<div>\r\n						идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</div>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить или не выводить описание над генерируемым полем</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$selected&nbsp;(опционально)&nbsp;</td>\r\n				<td>\r\n					выбранный элемент списка</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$disabled&nbsp;(опционально)</td>\r\n				<td>\r\n					выключенный элемент списка</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$ignore_check&nbsp;(опционально)</td>\r\n				<td>\r\n					игнорировать выборку только включенных</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(102, 'function', 'nc_file_field', 'nc_file_field ( string $field_name, [string $style, [int $classID, [bool $caption]]] )', 'Функция генерирует поле типа «Файл».', '<div>\r\n	В большинстве случаев она</div>\r\n<div>\r\n	применяется в альтернативных формах компонента, чтобы вывести информацию о поле типа Файл.</div>\r\n<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить или не выводить описание над генерируемым полем</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$selected&nbsp;(опционально)</td>\r\n				<td>\r\n					выбранный элемент списка</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$disabled&nbsp;(опционально)</td>\r\n				<td>\r\n					выключенный элемент списка</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$ignore_check&nbsp;(опционально)</td>\r\n				<td>\r\n					игнорировать выборку только включенных</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(103, 'function', 'nc_bool_field', 'nc_bool_field ( string $field_name, [string $style, [int $classID, [bool $caption]]] )', 'Функция генерирует поле типа «Логическая переменная».', '<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить или не выводить описание над генерируемым полем</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(104, 'function', 'nc_date_field', 'nc_date_field ( string $field_name, [string $style, [int $classID, [bool $caption, [string $dateDiv, [string $timeDiv]]]]] )', 'Функция генерирует поле типа «Дата и время».', '<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить или не выводить описание над генерируемым полем</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$dateDiv&nbsp;(опционально)</td>\r\n				<td>\r\n					разделитель полей для даты, по умолчанию "-"</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$timeDiv&nbsp;(опционально)</td>\r\n				<td>\r\n					разделитель полей для времени, по умолчанию ":"</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(105, 'function', 'nc_text_field', 'nc_text_field ( string $field_name, [string $style, [int $classID, [bool $caption, [bool $bbcode]]]] )', 'Функция генерирует поле типа «Текстовый блок».', '<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить или не выводить описание над генерируемым полем</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$bbcode&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить панельку с BB-кодами (для панельки нужны стили CSS в&nbsp;макете дизайна!), по умолчанию отключено</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(106, 'function', 'nc_string_field', 'nc_string_field ( string $field_name, [string $style, [int $classID, [bool $caption]]] )', 'Функция генерирует поле типа «Строка».', '<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить или не выводить описание над генерируемым полем</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(107, 'function', 'nc_int_field', 'nc_int_field ( string $field_name, [string $style, [int $classID, [bool $caption]]] )', 'Функция генерирует поле типа «Целое число».', '<div>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th scope="col">\r\n					Параметры</th>\r\n				<th scope="col">\r\n					Описание</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					$field_name</td>\r\n				<td>\r\n					имя поля в текущем компоненте или компоненте $classID</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$style&nbsp;(опционально)</td>\r\n				<td>\r\n					параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$classID&nbsp;(опционально)</td>\r\n				<td>\r\n					идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					$caption&nbsp;(опционально)</td>\r\n				<td>\r\n					выводить или не выводить описание над генерируемым полем</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(108, 'function', 'nc_float_field', 'nc_float_field ( string $field_name, [string $style, [int $classID, [bool $caption]]] )', 'Функция генерирует поле типа «Число с плавающей запятой».', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$field_name</td>\r\n			<td>\r\n				имя поля в текущем компоненте или компоненте $classID</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$style&nbsp;(опционально)</td>\r\n			<td>\r\n				параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$classID</td>\r\n			<td>\r\n				идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$caption</td>\r\n			<td>\r\n				выводить или не выводить описание над генерируемым полем</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(109, 'function', 'nc_multilist_field', 'nc_multilist_field ( string $field_name, [string $style, [string $type, [int $classID, [bool $caption, [string $selected, [bool $disabled, [bool $getData]]]]]] )', 'Функция генерирует поле типа «Множественный выбор»', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$field_name</td>\r\n			<td>\r\n				имя поля в текущем компоненте или компоненте $classID</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$style&nbsp;(опционально)</td>\r\n			<td>\r\n				параметры отображения поля, например:&nbsp;«size=''50''»</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$type (опционально)</td>\r\n			<td>\r\n				тип: "select", "select:N", "checkbox", по умолчанию - "select:3"</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$classID (опционально)</td>\r\n			<td>\r\n				идентификатор компонента, используется например, при выводе&nbsp;формы через функцию s_list_class() его следует указывать, по&nbsp;умолчанию этот параметр можно не задавать</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$caption (опционально)</td>\r\n			<td>\r\n				&nbsp;выводить или не выводить описание над генерируемым полем</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$selected (опционально)</td>\r\n			<td>\r\n				выбранные элементы. Передаются через строку, где id выбранных&nbsp;элементов разделены между собой символами ''[пробел]'', ''.'', '','' , '';''</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$disabled &nbsp;(опционально)</td>\r\n			<td>\r\n				недоступные&nbsp;элементы.&nbsp;Формат&nbsp;аргумента&nbsp;аналогичен</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<div>\r\n					$getData&nbsp;(опционально)</div>\r\n			</td>\r\n			<td>\r\n				принудительно вытаскивать из базы</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(110, 'function', 'nc_list_select', 'nc_list_select (string $classificator_name, [string $field_name, [int $current_value, [int $sort_type, [int $sort_direction, [string $template_prefix, [string $template_object, [string $template_suffix, [string $template_any, [bool $ignore_check]]]]]]]]])', 'Данная функция позволяет генерировать HTML списки из Списков\r\nNetCat.', '<p>\r\n	В большинстве случаев она применяется в альтернативных формах компонента, чтобы вывести информацию о поле типа Список.</p>\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$classificator_name</td>\r\n			<td>\r\n				имя списка, например, Gallery, обязательный параметр</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$field_name имя&nbsp;(опционально)</td>\r\n			<td>\r\n				поля в компоненте (без префикса f_, например, Field)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$current_value (опционально)</td>\r\n			<td>\r\n				выбранный элемент списка&nbsp;(например, $f_Field_id, если мы используем функцию в&nbsp;альтернативной форме добавления/изменения)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$sort_type (опционально)</td>\r\n			<td>\r\n				поле сортировки: 0 – ID (по умолчанию), 1 – имя, 2 - приоритет</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$sort_direction (опционально)</td>\r\n			<td>\r\n				порядок сортировки: 0 – восходящий (по умолчанию), 1 –&nbsp;нисходящий)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$template_prefix (опционально)</td>\r\n			<td>\r\n				темплейт префикса списка, по умолчанию: "&lt;select name=''f_\\$field_name''&gt;\\r\\n"</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$template_suffix (опционально)</td>\r\n			<td>\r\n				темплейт суффикса списка, по умолчанию: "&lt;/select&gt;\\r\\n"</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$template_any (опционально)</td>\r\n			<td>\r\n				темплейт для первого нулевого элемента списка, если поле&nbsp;может быть пустым, по умолчанию:&nbsp;&lt;option value=''''&gt;--выбрать--&lt;/option&gt;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$ignore_check</td>\r\n			<td>\r\n				игнорировать выборку только включенных</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	<strong>Внимание!</strong> Не забывайте экранировать кавычки!</p>\r\n<div>\r\n	<div>\r\n		Поле $template_prefix имеет «константу». Переменная, а точнее запись</div>\r\n	<div>\r\n		вида «\\$field_name», автоматически заменится на указанный в вызове</div>\r\n	<div>\r\n		функции параметр $field_name.</div>\r\n	<div>\r\n		Поле $template_object имеет 3 «константы»: «\\$value_id», «\\</div>\r\n	<div>\r\n		$value_selected» и «\\$value_name», которые отвечают за подстановку ID,</div>\r\n	<div>\r\n		выбранной записи и название элемента.</div>\r\n</div>', NULL, '', 'ClassForm_AddTemplate ClassForm_AddCond ClassForm_AddActionTemplate ClassForm_EditTemplate ClassForm_EditCond ClassForm_EditActionTemplate ClassForm_CheckActionTemplate'),
(111, 'function', 'nc_message_link', 'nc_message_link ( int $message_id, int $class_id, [$action=''''] )', 'Функция позволяет получить относительный путь к объекту (без домена)\r\nпо номеру (ID) этого объекта и номеру (ID) компонента, которому он\r\nпринадлежит.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$message_id</td>\r\n			<td>\r\n				номер объекта</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$class_id</td>\r\n			<td>\r\n				номер компонента</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$action&nbsp;(опционально)</td>\r\n			<td>\r\n				действие с объектом:<br />\r\n				edit — редактирование<br />\r\n				delete — удаление<br />\r\n				drop — удаление без подтверждения<br />\r\n				checked — смена статуса,<br />\r\n				по умолчанию — просмотр&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; .</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	Будьте внимательны, не путайте номера компонента и номер компонента раздела. Номер компонента Вы можете узнать, например, в разделе «Список компонентов» системы администрирования.</p>', NULL, '', 'ClassForm TemplateForm'),
(112, 'function', 'parentofmessage', 'parentofmessage ( int $message_id, int $class_id )', 'Возвращает номер объекта – родителя «ветки» объектов (может\r\nиспользоваться в иерархическом форуме), в которой, в частности,\r\nсодержится объект с номером $message_id.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$message_id</td>\r\n			<td>\r\n				номер объекта</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$class_id</td>\r\n			<td>\r\n				номер компонента</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm TemplateForm'),
(113, 'function', 's_list_class', 's_list_class ( int $sub, int $cc, [char $params, [bool $show_in_admin_mode]] )', '<div>\r\n	Функция выводит "верхние" объекты из раздела $sub компонента раздела $cc с параметрами $params.</div>', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$sub</td>\r\n			<td>\r\n				номер раздела</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$cc</td>\r\n			<td>\r\n				номер компонента в разделе</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$params&nbsp;(опционально)</td>\r\n			<td>\r\n				может содержать произвольный состав параметров. Все они&nbsp;могут быть обработаны в тексте шаблона вывода объекта.&nbsp;Параметры подаются в URL-формате: &amp;param1=12&amp;param2=46.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$show_in_admin_mode (опционально)&nbsp;</td>\r\n			<td>\r\n				если он имеет значение TRUE (истина), этот блок будет выведен&nbsp;и в режиме администрирования, иначе только в обычном режиме&nbsp;работы сайта</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm TemplateForm'),
(114, 'function', 'nc_usergroup_create', 'nc_usergroup_create ( string $name )', 'Функция создает группу пользователей именем $name.', '', NULL, '', 'ClassForm TemplateForm'),
(115, 'function', 'nc_usergroup_rename', 'nc_usergroup_rename ( int $PermissionGroupID, string $name )', 'Функция переименовывает группу пользователей.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$PermissionGroupID</td>\r\n			<td>\r\n				идентификатор группы</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$name</td>\r\n			<td>\r\n				имя группы</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm TemplateForm'),
(116, 'function', 'nc_usergroup_delete', 'nc_usergroup_delete ( mixed $PermissionGroupID )', 'Функция удаляет группу(-ы) пользователей по идентификатору группы\r\nили массиву с идентификаторами групп $PermissionGroupID.', 'Группу нельзя удалить, если есть хотя бы один пользователь, который\r\nсостоит только в этой группе. Функция возвращает массив с номерами\r\nудаленных групп.', NULL, '', 'ClassForm TemplateForm'),
(117, 'function', 'nc_usergroup_add_to_group', 'nc_usergroup_add_to_group ( int $UserID, int $PermissionGroupID )', 'Функция добавляет пользователя в группу.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$UserID</td>\r\n			<td>\r\n				идентификатор пользователя</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$PermissionGroupID</td>\r\n			<td>\r\n				идентификатор группы&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm TemplateForm'),
(118, 'function', 'nc_usergroup_remove_from_group', 'nc_usergroup_remove_from_group ( int $UserID, int $PermissionGroupID )', 'Функция исключает пользователя из группы. (Пользователь должен\r\nсостоять хотя бы в одной группе.)', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$UserID</td>\r\n			<td>\r\n				идентификатор пользователя</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$PermissionGroupID</td>\r\n			<td>\r\n				идентификатор группы</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm TemplateForm'),
(119, 'function', 'nc_usergroup_get_users_from_group', 'nc_usergroup_get_users_from_group ( int $PermissionGroupID , [int $output_type])', 'Функция возвращает всех пользователей, находящихся в группе\r\nPermissionGroupID.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$PermissionGroupID</td>\r\n			<td>\r\n				идентификатор группы</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$output_type&nbsp;(опционально)</td>\r\n			<td>\r\n				тип выходного массива:<br />\r\n				&nbsp;0: просто номера пользователей [0] =&gt; user1 id, [1] =&gt; user2&nbsp;id<br />\r\n				1: [group_id][user_id] =&gt; Login</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm TemplateForm'),
(120, 'function', 'nc_usergroup_get_group_by_user', 'nc_usergroup_get_group_by_user ( int $UserID , int $output_type = 0 )', 'Функция возвращает все группы, в которых состоит пользователь.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$UserID</td>\r\n			<td>\r\n				идентификатор пользователя</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$output_type&nbsp;(опционально)</td>\r\n			<td>\r\n				тип выходного массива:<br />\r\n				0:&nbsp;на выходе одномерный числовой массив, значения&nbsp;элементов которых соответствует идентификатором групп<br />\r\n				1: на выходе одномерный массив, значения элементов&nbsp;которых соответствует названиям групп, а&nbsp;индекс -&nbsp;номерам групп</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, '', 'ClassForm TemplateForm'),
(121, 'function', 'is_even', 'is_even ( int $param )', '<p>Проверяет параметр на четность.</p>', '', NULL, '', 'ClassForm TemplateForm'),
(122, 'function', 'listQuery', 'listQuery (char $sql_query, [char $output_template, [char $divider]] )', '<p>Функция производит запрос $sql_query к базе данных, форматирует в\r\nсоответствии с шаблоном $output_template и выводит\r\nрезультаты\r\nзапроса.</p>', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$sql_query</td>\r\n			<td>\r\n				запрос к БД</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$output_template&nbsp;(опционально)&nbsp;</td>\r\n			<td>\r\n				шаблон вывода результатов запроса</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$divider (опционально)&nbsp;</td>\r\n			<td>\r\n				разделитель между результатами</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	В шаблоне $output_template могут использоваться обращения к массиву $data[] с маскировочным слешем перед знаком $: \\$data[Name].</p>\r\n<p>\r\n	В качестве индексов массива используются названия столбцов таблиц, из которых происходит выборка.</p>', NULL, '', 'ClassForm TemplateForm'),
(123, 'function', 'nc_bbcode', 'nc_bbcode ( string $text, [string $cut_link, [bool $cut_full, [array $codes]]] )', 'Обрабатывает текст с BB-кодами.', '', NULL, '', 'ClassForm TemplateForm'),
(124, 'function', 'nc_bbcode_bar', 'nc_bbcode_bar ( string $winID, string $formID, string $textareaID, [bool $help, [array $codes="", [string $prefix="", [string $suffix=""]]]] )', 'Отображает панельку вставки BB-кодов.', '', NULL, '', 'ClassForm TemplateForm'),
(125, 'function', 'nc_bbcode_clear', 'nc_bbcode_clear ( string $text )', 'Функция очистки текста от BB-кодов (кроме URL).', '', NULL, '', 'ClassForm TemplateForm'),
(126, 'function', 'nc_array_to_string', 'nc_array_to_string ( array $arr, array $template )', 'Переводит массив в строку по шаблону.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$arr</td>\r\n			<td>\r\n				непосредственно сам массив</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$template</td>\r\n			<td>\r\n				массив с шаблонами, должен иметь следующие ключи:<br />\r\n				prefix<br />\r\n				element<br />\r\n				divider<br />\r\n				suffix</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<div>\r\n	В элементе с ключом element можно использовать макропеременные:</div>\r\n<div>\r\n	1. %ELEMENT - текущий элемент массива $arr</div>\r\n<div>\r\n	2. %KEY - его ключ</div>\r\n<div>\r\n	3. %I - номер по порядку (отсчет начинается с 1 )</div>', NULL, '', 'ClassForm TemplateForm'),
(127, 'function', 'nc_mail2queue', 'nc_mail2queue ( string $recipient, string $from, string $subject, string $message )', 'Функция является частью функционала по рассылке писем. Указанное\r\nписьмо кладется в таблицу БД mail_queue, откуда в дальнейшем будет\r\nразослано скриптом /netcat/admin/mailer.php.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$recipient</td>\r\n			<td>\r\n				содержит адрес получателя</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$from</td>\r\n			<td>\r\n				содержит координаты отправителя</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$subject</td>\r\n			<td>\r\n				тема письма</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$message</td>\r\n			<td>\r\n				сообщение&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	При желании Вы можете отсылать даже письма с файлами – для этого при помощи каких-либо средств необходимо сгенерировать правильный $message. Однако учтите, что письмо кладется в БД ровно столько раз, сколько подписчиков его должны получить, и при большом вложенном файле размер БД может значительно вырасти.</p>\r\n<p>\r\n	Файл /netcat/admin/mailer.php, отвечает за порционную рассылку писем. Количество писем задается параметром number, если не указано – высылается 20 писем из очереди. Этот скрипт должен быть добавлен в CRON Вашего сервера (каждую минуту, /netcat/admin/mailer.php?number=20). При наличии писем в очереди они будут отсылаться порциями. При отсутствии писем скрипт ничего делать не будет.</p>', NULL, '', 'ClassForm TemplateForm'),
(128, 'function', 'nc_file_path', 'nc_file_path ( int $class_id, int $message_id, mixed $field_name, [string $file_name_prefix] )', 'Функция позволяет получить путь к файлу, указанному в определенном\r\nполе, по номеру (ID) этого объекта и номеру (ID) компонента, которому\r\nон принадлежит.', '<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope="col">\r\n				Параметры</th>\r\n			<th scope="col">\r\n				Описание</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				$class_id</td>\r\n			<td>\r\n				номер компонента (для системных таблиц – название&nbsp;таблицы, допустимые значения – “Catalogue”, “Subdivision”,&nbsp;“User”, “Template”)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$message_id</td>\r\n			<td>\r\n				номер объекта</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$field_name</td>\r\n			<td>\r\n				название поля или его идентификатор в компоненте</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				$file_name_prefix (опционально)&nbsp;</td>\r\n			<td>\r\n				укажите “h_”, если хотите получить ссылку для скачивания&nbsp;файла под оригинальным именем (подробнее см. в&nbsp;разделе «Файловая система» настоящего руководства)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	Будьте внимательны, не путайте номера компонента и номер компонента в разделе. Номер компонента вы можете узнать, например, в разделе «Список компонентов» системы администрирования.</p>\r\n<p>\r\n	Если в указанном поле файл не был закачан, функция возвращает NULL. При неправильно указанном имени или идентификаторе поля функция сообщит об ошибке и вернет NULL.</p>', NULL, '', 'ClassForm TemplateForm'),
(129, 'function', 'nc_get_visual_settings', 'nc_get_visual_settings ( int $cc )', 'Функция возвращает текущие визуальные настройки компонента в\r\nразделе по его идентификатору $cc.', 'Возвращаемый результат — массив данных.', NULL, '', 'ClassForm TemplateForm'),
(130, 'function', 'opt', 'opt ( $flag, $string )', 'Функция выводит строку $string в случае если $flag не ложь, не имеет\r\nпустое значение или не ноль.', '', NULL, '', 'ClassForm TemplateForm'),
(131, 'function', 'opt_case', 'opt_case ( $flag, $string1, $string2 )', 'Выводит строку $string1 в случае если $flag не ложь, не имеет пустое\r\nзначение или не ноль; в противном случае выводит строку $string2.', '', NULL, '', 'ClassForm TemplateForm'),
(132, 'function', 'encode_host', 'encode_host ( string $host )', '<p>Функция возвращает закодированное в punycode значение параметра\r\n$host, содержащее доменное имя.</p>', '', NULL, '', 'ClassForm TemplateForm'),
(133, 'function', 'decode_host', 'decode_host ( string $host )', '<p>Функция возвращает декодированное значение параметра\r\n$host содержащее доменное имя в формате punycode.</p>', '', NULL, '', 'ClassForm TemplateForm'),
(134, 'variable', 'cc', 'cc', 'Номер (ID) текущего инфоблока.', 'Переменной присваивается значение поля Sub_Class_ID таблицы Sub_Class, соответствующее текущему инфоблоку.', NULL, '', 'ClassForm TemplateForm'),
(135, 'variable', 'cc_array[]', 'cc_array', 'Массив номеров инфоблоков в текущем разделе.', 'Массив индексов (номеров) компонентов текущего раздела, отсортированных по приоритету. Нулевой элемент ($cc_array[0]) – компонент с наименьшим приоритетом.', NULL, '', 'ClassForm TemplateForm');
INSERT INTO `Documentation` (`Documentation_ID`, `Type`, `Name`, `Signature`, `ShortHelp`, `FullHelp`, `Module_ID`, `Parent`, `Areas`) VALUES
(136, 'variable', 'admin_mode', 'admin_mode', 'Определение текущего режима страницы.', 'Логическая переменная. Если страница находится в режиме просмотра, то равна FALSE, если в режиме администирования - TRUE.', NULL, '', 'ClassForm TemplateForm'),
(137, 'variable', 'catalogue', 'catalogue', 'Номер (ID) текущего сайта.', 'Переменной присваивается значение поля Catalogue_ID таблицы Catalogue, соответствующее текущему сайту.', NULL, '', 'ClassForm TemplateForm'),
(138, 'variable', 'AUTH_USER_ID', 'AUTH_USER_ID', 'Номер авторизованного пользователя.', 'Номер (ID) в таблице User пользователя, авторизованного на странице. Если посетитель не авторизован, содержит 0.', NULL, '', 'ClassForm TemplateForm'),
(139, 'variable', 'current_catalogue[]', 'current_catalogue', 'Массив свойств текущего сайта.', 'Хэш-массив всех свойств текущего сайта (атрибутов таблицы Catalogue). Пример: $current_catalogue[''Catalogue_ID''].', NULL, '', 'ClassForm TemplateForm'),
(140, 'variable', 'current_cc[]', 'current_cc', 'Массив свойств текущего раздела.', 'Хэш-массив всех свойств текущего сайта (атрибутов таблицы Sub_Class). Пример: $current_cc[''Sub_Class_Name''].', NULL, '', 'ClassForm TemplateForm'),
(141, 'variable', 'current_sub[]', 'current_sub', 'Массив свойств текущего раздела.', 'Хэш-массив всех свойств текущего сайта (атрибутов таблицы Subdivision). Пример: $current_sub[''Subdivision_Name''].', NULL, '', 'ClassForm TemplateForm'),
(142, 'variable', 'current_user[]', 'current_user', 'Массив свойств текущего раздела.', 'Хэш-массив всех свойств текущего сайта (атрибутов таблицы User). Пример: $current_user[''Login'']. Массив определен только в случае, когда посетитель авторизован на сайте (то есть при наличии модуля "Личный кабинет"). Если модуля нет, номер авторизованного пользователя хранится в переменной $AUTH_USER_ID.', NULL, '', 'ClassForm TemplateForm'),
(143, 'variable', 'nc_parent_template_folder_path', 'nc_parent_template_folder_path', 'URI папки макета дизайна.', 'Переменная содержит относительную ссылку (URI) на папку текущего макета дизайна (или корневого макета, если текущий макет является дочерним, а не корневым). В этой папке и/или ее подпапках рекомендуется хранить картинки, CSS-файлы и пр., необходимые для работы макета.', NULL, '', 'TemplateForm'),
(144, 'variable', 'template_settings[]', 'template_settings', 'Массив, содержащий пользовательские настройки макета.', 'Если у макета заданы пользовательские настройки, этот хэш-массив содержит их значение (эти значения проставляются в настройках сайта или раздела, к которому подключен макет).', NULL, '', 'TemplateForm'),
(145, 'macros', 'NAME', 'NAME', 'Название раздела.', '', NULL, '', 'TemplateForm_Settings'),
(146, 'macros', 'Footer', 'Footer', 'Вывод футера родительского макета.', 'Если макет имеет родителя, эта макропеременная будет содержать текст футера (нижней части) родительского макета.', NULL, '', 'TemplateForm_Header TemplateForm_Footer'),
(147, 'macros', 'Header', 'Header', 'Вывод хедера родительского макета.', 'Если макет имеет родителя, эта макропеременная будет содержать текст хедера (верхней части) родительского макета.', NULL, '', 'TemplateForm_Header TemplateForm_Footer'),
(148, 'variable', 'begRow', 'begRow', 'Порядковый номер объекта, с которого начинается вывод списка объектов на текущей странице.', 'Нумерация начинается с первого объекта на первой странице. Таким образом, если объекты какого-либо компонента выводятся по 15 штук на странице, на второй странице листинга значение $begRow будет равно 16.', NULL, '', 'ClassForm_FormPrefix ClassForm_RecordTemplate ClassForm_FormSuffix ClassForm_RecordTemplateFull'),
(149, 'macros', 'URL', 'URL', 'Ссылка на сайт/раздел/компонент.', '', NULL, '', 'TemplateForm_Settings'),
(150, 'macros', 'PARENT_SUB', 'PARENT_SUB', 'Номер родительского раздела (только для разделов).', '', NULL, '', 'TemplateForm_Settings'),
(151, 'macros', 'KEYWORD', 'KEYWORD', 'Ключевое слово раздела (только для разделов).', '', NULL, '', 'TemplateForm_Settings'),
(152, 'macros', 'SUB', 'SUB', 'Номер раздела (только для разделов).', '', NULL, '', 'TemplateForm_Settings'),
(153, 'macros', 'COUNTER', 'COUNTER', 'Номер выводимого элемента в списке (начиная с нуля).', '', NULL, '', 'TemplateForm_Settings'),
(154, 'variable', 'ccLink', 'ccLink', 'Содержит путь (URI) к текущему инфоблоку.', '', NULL, '', 'ClassForm_RecordTemplate'),
(155, 'variable', 'f_AdminCommon', 'f_AdminCommon', 'Панелька управления инфоблоком.', 'В режиме администрирования выводит панельку операций с инфоблоком: добавление объекта, настройка инфоблока, редактирование текста шаблона компонента, удаления объектов. Если в шаблоне вывода объекта в списке эта переменная указана не будет, вы не сможете изменить или удалить объекты этого компонента стандартными средствами системы.', NULL, '', 'ClassForm_FormPrefix ClassForm_RecordTemplate ClassForm_FormSuffix ClassForm_RecordTemplateFull'),
(156, 'variable', 'endRow', 'endRow', 'Порядковый номер объекта, которым кончается вывод списка объектов на текущей странице.', 'Нумерация начинается с первого объекта на первой странице. Таким образом, если объекты какого-либо компонента выводятся по 15 штук на странице, на второй странице листинга значение $endRow будет равно 30.', NULL, '', 'ClassForm_FormPrefix ClassForm_RecordTemplate ClassForm_FormSuffix ClassForm_RecordTemplateFull'),
(157, 'variable', 'f_AdminButtons', 'f_AdminButtons', 'Панелька управления объектом.', 'В режиме администрирования выводит панельку операций с объектами: изменения, удаления, включения-выключения, копирования. Если в шаблоне вывода объекта в списке или объекта на одной странице эта переменная указана не будет, вы не сможете изменить или удалить объекты этого компонента стандартными средствами системы.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(158, 'variable', 'f_Checked', 'f_Checked', 'Истина, если объект включен, и наоборот.', 'Используется в шаблоне вывода объекта в списке и на отдельной странице.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(159, 'variable', 'f_Created', 'f_Created', 'Дата и время создания объекта.', 'Дата и время создания (добавления) объекта в формате "гггг-мм-дд чч:мм:сс". Помимо полного формата вывода даты и времени доступны переменные $f_Created_year, $f_Created_month, $f_Created_day, $f_Created_hours, $f_Created_minutes, $f_Created_seconds, содержащие соответственно год, месяц, день, час, минуту и секунду добавления объекта. Используется в шаблоне вывода объекта в списке и на отдельной странице.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(160, 'variable', 'f_IP', 'f_IP', 'IP-адрес посетителя, добавившего объект.', 'Используется в шаблоне вывода объекта в списке и на отдельной странице.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(161, 'variable', 'f_LastIP', 'f_LastIP', 'IP-адрес посетителя, последним изменившего объект.', '', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(162, 'variable', 'f_LastUpdated', 'f_LastUpdated', 'Дата и время последнего изменения этого объекта.', 'Используется в шаблоне вывода объекта в списке и на отдельной странице.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(163, 'variable', 'f_LastUserAgent', 'f_LastUserAgent', 'UserAgent пользователя, последним изменившего объект.', 'Используется в шаблоне вывода объекта в списке и на отдельной странице.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(164, 'variable', 'f_LastUserID', 'f_LastUserID', 'Номер пользователя, последним изменившего объект.', '', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(165, 'variable', 'f_RowID', 'f_RowID', 'Номер (ID) объекта в таблице БД (MessageXX).', 'Используется в шаблоне вывода объекта в списке и на отдельной странице.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(166, 'variable', 'f_RowNum', 'f_RowNum', 'Порядковый номер объекта на странице.', 'Нумерация начинается с первого объекта, отображенного на странице. Используется в шаблоне вывода объекта в списке и на отдельной странице.', NULL, '', 'ClassForm_RecordTemplate'),
(167, 'variable', 'f_title', 'f_title', 'Заголовок текущей страницы.', 'Выводит название текущего раздела за исключением случая, когда текущая страница представляет собой вывод одного объекта на странице и поле «Заголовок страницы» данного компонента определено.', NULL, '', 'TemplateForm'),
(168, 'variable', 'nc_next_object', 'nc_next_object', 'Ссылка на следующий объект в списке.', 'Данная переменная содержит ссылку на "следующий" объект относительно текущего. Для определения порядка объектов используется переменная $query_order из системных настройках, а если она не задана — то значение поля "Сортировать объекты по" в настройках инфоблока.', NULL, '', 'ClassForm_RecordTemplate'),
(169, 'variable', 'nc_prev_object', 'nc_prev_object', 'Ссылка на предыдущий объект в списке.', 'Данная переменная содержит ссылку на "предыдущий" объект относительно текущего. Для определения порядка объектов используется переменная $query_order из системных настройках, а если она не задана — то значение поля "Сортировать объекты по" в настройках инфоблока.', NULL, '', 'ClassForm_RecordTemplate'),
(170, 'variable', 'fullDateLink ', 'fullDateLink', 'Ссылка на страницу с полным выводом объекта в виде\r\n«.../2002/02/02/message_2.html».', 'Устанавливается в случае если в компоненте имеется поле типа «Дата и время» с форматом «event»,иначе значение переменной идентично значению $fullLink.', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(171, 'variable', 'fullLink', 'fullLink', 'Ссылка на страницу с полным выводом объекта.', 'Ссылка формируется в «человеко-понятном» формате: /URLРаздела/КлючСловоКомпонентаРаздела_КлючСловоОбъекта.html или /URLРаздела/КлючСловоОбъекта.html, например, /about/team/ivanov.html', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
(172, 'variable', 'editLink', 'editLink', 'Ссылка на страницу редактирования объекта.', '', NULL, '', 'ClassForm_RecordTemplate ClassForm_RecordTemplateFull'),
