INSERT INTO `Links_Settings` (`Back_Link_Needed`, `Kill_Bad_Link`, `Kill_Bad_Link_In`, `Direct_For_Good_Link`, `HTML_In_Good_Link`, `Put_Up_Good_Link`, `Check_Whole_Text`, `Back_Link_At_Site`, `Fail_If_Back_Link_Present`, `Fail_If_Third_Level`, `Spam_From`, `Admin_Mail`, `Send_Admin_Added`, `Send_Admin_Added_Template`, `Send_Partner_Added_Bad_Link`, `Send_Partner_Added_Bad_Link_Template`, `Send_Partner_Added_Good_Link`, `Send_Partner_Added_Good_Link_Template`, `Send_Partner_Turnoff`, `Send_Partner_Turnoff_Template`, `Send_Partner_Turnon`, `Send_Partner_Turnon_Template`, `Send_Partner_Kill`, `Send_Partner_Kill_Template`, `Send_Partner_Added_Redirect_Link`, `Send_Partner_Added_Redirect_Link_Template`, `Send_Partner_Added_Direct_Link`, `Send_Partner_Added_Direct_Link_Template`, `Send_Partner_Redirect_On`, `Send_Partner_Redirect_On_Template`, `Send_Partner_Redirect_Off`, `Send_Partner_Redirect_Off_Template`, `Send_Admin_Report`, `Send_Partner_Sold_Turnoff`, `Send_Partner_Sold_Turnoff_Template`, `Invite_Partner_In`, `Last_Checked`, `Last_Deleted`, `Last_Unchecked`, `Last_Added`, `Last_Added_Unchecked`, `Fail_If_Many_Hosts`, `Send_Admin_No_Purchased`, `Send_Admin_No_Purchased_Template`, `Send_Admin_Added_Subject`, `Send_Partner_Added_Bad_Link_Subject`, `Send_Partner_Added_Good_Link_Subject`, `Send_Partner_Turnoff_Subject`, `Send_Partner_Turnon_Subject`, `Send_Partner_Kill_Subject`, `Send_Partner_Added_Redirect_Link_Subject`, `Send_Partner_Added_Direct_Link_Subject`, `Send_Partner_Redirect_On_Subject`, `Send_Partner_Redirect_Off_Subject`, `Send_Partner_Sold_Turnoff_Subject`, `Send_Admin_No_Purchased_Subject`, `Last_Process`) VALUES
(0, 0, 6, 1, 1, 1, 1, 3, 1, 0, 'robot@example.com', 'admin@example.com', 1, 'Здравствуй, хозяин!\r\n\r\nВ каталог сайта %OurSite добавлена новая ссылка:\r\n%LinkName - %LinkURL\r\nОбратная ссылка: %BackLink\r\nСсылка в режиме редактирования: %LinkEditMode\r\n\r\nС уважением,\r\nМодуль управления ссылками', 1, 'Здравствуйте!\r\n\r\nВаша ссылка добавлена в каталог сайта %OurSite. Постоянный адрес страницы, на которой расположена ссылка - %StaticLink . Вам необходимо разместить нашу ссылку на странице %BackLink (если это невозможно, разместите ее на другой странице и пришлите адрес этой страницы по email %AdminEmail). Постарайтесь сделать это как можно быстрее, т.к. модуль управления ссылками регулярно проверяет наличие обратных ссылок и автоматически выключает/удаляет сайты без обратных ссылок на наш сайт. Условия размещения ссылок и коды наших ссылок доступны по адресу %OurCatalog.\r\n\r\nНадеемся на долгое плодотворние сотрудничество!\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nВаша ссылка добавлена в каталог сайта %OurSite. Постоянный адрес страницы, на которой расположена ссылка - %StaticLink . Не удаляйте нашу ссылку со страницы %BackLink, т.к. модуль управления ссылками регулярно проверяет наличие обратных ссылок.\r\n\r\nНадеемся на долгое плодотворное сотрудничество!\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nСообщаем Вам, что ссылка на Ваш сайт %LinkURL, расположенная в каталоге ссылок сайта\r\n%OurSite, выключена, т.к. на странице %BackLink не найдена обратная ссылка\r\nна наш сайт. Вам необходимо разместить нашу ссылку по этому адресу, в противном случае, Ваша ссылка будет удалена из каталога нашего сайта %DeleteTime. Код нашей ссылки и условия размещения ссылки Вы можете найти по адресу %OurCatalog.\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nМы рады сообщить Вам, что ссылка на Ваш сайт %LinkURL снова включена в каталог \r\nссылок сайта %OurSite и доступна по адресу %StaticLink. \r\nНадеемся на дальнейшее плодотворное сотрудничество!\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nМы вынуждены сообщить, что Ваша ссылка %LinkURL удалена из каталога ссылок сайта\r\n%OurSite из-за нарушения правил участия в нашем каталоге ссылок, т.к. обратная ссылка на наш сайт не была размещена. Если Вы захотите снова участвовать в нашем каталоге, мы будем рады возобновить наше сотрудничество. Ознакомиться с правилами добавления ссылок и добавить Ваш сайт в каталог Вы можете по адресу %OurCatalog.\r\n\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nВаша ссылка добавлена в каталог сайта %OurSite. Постоянный адрес страницы, на которой расположена ссылка - %StaticLink . Т.к. Вы не разместили обратную ссылку на наш сайт, Ваша ссылка будет переведена в режим редиректа. Режим редиректа означает, что ссылка с нашей страницы на Ваш сайт не прямая и не учитывается поисковыми машинами. Чтобы включить режим прямой ссылки, Вам необходимо разместить ссылку на странице %BackLink (если это невозможно, разместите ее на другой странице и пришлите адрес этой страницы по email %AdminEmail). \r\n\r\nНадеемся на долгое плодотворние сотрудничество!\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nВаша ссылка добавлена в каталог сайта %OurSite. Постоянный адрес страницы, на которой расположена ссылка - %StaticLink . Не удаляйте нашу ссылку со страницы %BackLink, т.к. модуль управления ссылками регулярно проверяет наличие обратных ссылок, и в случае отсутствия обратной ссылки Ваша ссылка будет переведена в режим редиректа. Режим редиректа означает, что ссылка с нашей страницы на Ваш сайт не прямая и не учитывается поисковыми машинами. \r\n\r\nНадеемся на долгое плодотворное сотрудничество!\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nСообщаем Вам, что для Вашей ссылки на сайт %LinkURL, расположенная в каталоге ссылок\r\nсайта %OurSite, включен режим редиректа, т.к. на странице %BackLink не найдена\r\nобратная ссылка на наш сайт. Режим редиректа означает, что ссылка с нашей страницы на\r\nВаш сайт не прямая и не учитывается поисковыми машинами. Для выключения режима прямой ссылки Вам необходимо разместить нашу ссылку по этому адресу. Код нашей ссылки и условия размещения ссылки Вы можете найти по адресу %OurCatalog.\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 1, 'Здравствуйте!\r\n\r\nСообщаем Вам, что для Вашей ссылки на сайт %LinkURL, расположенной в каталоге ссылок\r\nсайта %OurSite, выключен режим редиректа. Теперь ссылка на Ваш сайт прямая и учитывается поисковыми машинами.\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', '1', 1, 'Здравствуйте!\r\n\r\nСообщаем Вам, что срок размещения купленной Вами ссылки на сайте %OurSite подошел к \r\nконцу, в связи с чем Ваша ссылка выключена. Мы благодарны Вам за сотрудничество, и если \r\nВы хотите его возобновить, напишите пожалуйста на email %AdminEmail.\r\n\r\nС уважением,\r\nАдминистрация сайта %OurSite', 6, 0, 0, 0, 1, 1, 1, 1, 'День добрый!\r\n\r\nНа сайте %LinkURL не найдена купленная ссылка!\r\n\r\nURL страницы, на которой должна быть наша ссылка:\r\n%BackLink\r\n\r\nEmail владельца сайта: %LinkEmail\r\nДата окончания срока выкупа: %LinkTurnoff\r\n\r\nС уважением,\r\nМодуль ссылок', 'Новая ссылка в каталоге', 'Ваша ссылка добавлена!', 'Ваша ссылка добавлена!', 'Выключение Вашей ссылки', 'Ваша ссылка включена', 'Удаление Вашей ссылки', 'Ваша ссылка добавлена!', 'Ваша ссылка добавлена!', 'Для вашей ссылки включен режим редиректа', 'Для Вашей ссылки выключен режим редиректа', 'Окончание срока продажи ссылки', 'Не найдена купленная ссылка!', '2006-04-24 03:28:40');
