(1, 1, 2, 4, 1, '', '', '', '', 1, '176.56.22.230', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_9_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-05-27 10:00:45', '2014-05-27 06:00:45', 0, NULL, NULL, '<p>Страница не найдена</p>'),
(2, 1, 1, 11, 1, '', '', '', '', 1, '89.106.251.219', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:29.0) Gecko/20100101 Firefox/29.0', 0, '2014-06-02 13:25:56', '2014-07-07 06:54:28', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '<p><strong>Данная страница находится в разработке. Приносим извинения за доставленные неудобства!</strong></p>\r\n<p>&nbsp;</p>'),
(13, 1, 16, 50, 1, '', '', '', '', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 14:29:22', '2014-07-10 04:56:47', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '<div itemscope="" itemtype="http://schema.org/Organization"><span style="font-size:16px;"><span itemprop="name">ООО &quot;Механика Урала&quot;</span> Контакты:</span>\r\n<div itemprop="address" itemscope="" itemtype="http://schema.org/PostalAddress"><span style="font-size:16px;">Адрес:&nbsp;<span itemprop="streetAddress">ул. Розы Люксембург, 32-оф.8</span>, &nbsp;<span itemprop="addressLocality">Екатеринбург</span>, <span itemprop="postalCode"> 620072</span><br />\r\nТелефон: <span itemprop="telephone">+7 343 344&ndash;84&ndash;84</span>,<br />\r\nСотовый: <span itemprop="telephone">+7 963 040&ndash;30&ndash;40</span>;<br />\r\nЭлектронная почта:&nbsp;<span itemprop="email">ural@m-mech.ru</span></span>\r\n<p>&nbsp;</p></div>\r\n<p style="text-align: center;">&nbsp;</p><script type="text/javascript" charset="utf-8" src="//api-maps.yandex.ru/services/constructor/1.0/js/?sid=3S4rY824aXPUzEsusFH7LgGlIgQOSi3m&width=600&height=426"></script></div>'),
(5, 1, 3, 25, 1, '', '', '', '', 0, '128.75.115.197', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-03 14:26:34', '2014-07-07 06:56:03', 1, '94.51.156.80', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '<p>ООО &laquo;Механика Урала&raquo; работает с производителями разных стран Азии и Европы, которые зарекомендовали себя , как прекрасное соотношение цены и качества. У нас товар практически всегда в наличии в Екатеринбурге и Москве.</p>\r\n<p>&nbsp;Направление деятельности нашей Компании:<br />\r\n&nbsp; &mdash; снабжение инструментом строительных компаний, автосервисов, производственных предприятий;<br />\r\n&nbsp; &mdash; продажа оптом строительных инструментов;<br />\r\n&nbsp; &mdash; продажа в розницу строительных инструментов.<br />\r\n&nbsp; Мы представляем Вашему вниманию следующие виды товаров:<br />\r\n- пневмоинструменты</p>\r\n<p>- заклепочники</p>\r\n<p>&nbsp; (механические и пневмогидравлические, для вытяжных и резьбовых заклепок);</p>\r\n<p>&nbsp;- компрессоры высокого давления;</p>\r\n<p>- пистолеты пневматические: паркетные, реечные, высокого давления, скобозабивные, барабанные, газовые монтажные;</p>\r\n<p>&nbsp;- для вязки арматуры;<br />\r\n&nbsp;- пилы дисковые;&nbsp;<br />\r\n&nbsp;- проволока для вязки арматуры;<br />\r\n&nbsp;- пневматические шлифмашинки;<br />\r\n&nbsp;- пневматические гайковерты, в том числе и с длинным валом;<br />\r\n&nbsp;- пневматические дрели и шуруповерты;<br />\r\n&nbsp;- заклепки и другой сопутствующий товар.<br />\r\n&nbsp;Товар, который мы предлагаем нашим клиентам, значительно облегчает труд и в разы сокращает время монтажных работ, что не может не радовать &nbsp;как простого рабочего, который с легкостью производит монтажные работы с помощью нашего инструмента, так и заказчика, получившего &nbsp;качественный и в срок выполненный заказ. На стройплощадках пригодятся пистолет для вязки арматуры, что так же сокращает время монтажа и &nbsp;затраты на рабочую силу в 2, а то и в 4 раза. Качество вязки пистолетом тоже будет в разы выше, чем классическим вязальным крючком.<br />\r\n&nbsp;Строительным компаниям, занимающимися монтажом вентилируемых фасадов, &nbsp;предлагаем обратить внимание на заклепочник серии SRC, а также на &nbsp;заклепочник моделей ЗВ. Резьбовой заклепочник серий ЗР применяется также в машиностроении, в строительстве, при производстве строительных агрегатов, при монтаже различных фартуков и кожухов на аппаратах. Приобрести заклепочник Вы можете в Екатеринбурге. В наличии и по заказ.</p>\r\n<p>&nbsp;Принимаем заказы на товар по всему Уральскому региону: Свердловская обл., Курганская обл., Челябинская обл., Тюменская обл., Ханты-Мансийский &nbsp;АО (ХМАО-Югра), Ямало-Ненецкий АО (ЯНАО), Пермский край. Также с другими регионами .&nbsp;</p>\r\n<p>&nbsp; В другие регионы доставка осуществляется с помощью транспортных компаний по желанию клиента. До транспортной компании доставка бесплатна!<br />\r\n&nbsp;Доставка по Екатеринбургу составляет 500 руб. При заказе от 25000 руб. доставка по городу &mdash; бесплатно!&nbsp;<br />\r\n&nbsp;Средний срок доставки товара из г. Москва занимает 4&ndash;7 дней.</p>\r\n<p>&nbsp;Для заказа &nbsp;товара Вы можете обратиться к нашим менеджерам по телефонам: +7(343)344&ndash;84&ndash;84, +7(963)040&ndash;30&ndash;40. &nbsp;Также можете посмотреть &nbsp;информацию в закладке контакты.</p>'),
(18, 1, 4, 16, 0, '', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 10:58:59', '2014-07-07 06:59:18', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '<p><strong><span style="font-size:14px;">У нас новый сайт! Мы учли пожелания наших клиентов и рады представить наш новый и более удобный сайт!</span></strong></p>'),
(16, 1, 4, 16, 2, '', '', '', '', 1, '195.151.237.24', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-27 14:12:26', '2014-07-07 06:57:07', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '<p><span style="font-size:14px;">Акция: скидка на любой&nbsp;заклепочник&nbsp;SRC 5% !!!</span></p>'),
(17, 1, 48, 77, 1, '', '', '', '', 1, '94.51.110.200', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-04 17:08:29', '2014-07-04 13:09:19', 1, '94.51.110.200', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '<ul>\r\n<li><span style="font-size:14px;"><strong>Доставка по г. Екатеринбург составляет 500 руб. </strong></span></li>\r\n<li><span style="font-size:14px;"><strong><span style="color:#FFA500;">При заказе от 25000 руб. доставка осуществляется бесплатно !</span></strong></span></li>\r\n<li><span style="font-size:14px;"><strong>В другие регионы доставка осуществляется силами транспортных компаний.&nbsp;</strong></span></li>\r\n<li><span style="color:#FFA500;"><strong style="font-size: 14px; line-height: 1.6em;">До транспортной Компании доставка бесплатно&nbsp;!</strong></span></li></ul>'),
(19, 1, 16, 50, 0, '', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 11:08:58', '2014-07-07 07:09:32', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '<p><span style="font-size:14px;">График работы:</span></p>\r\n<p><span style="font-size:14px;">Пн.- пт. с 9:00 до 17:30</span></p>\r\n<p><span style="font-size:14px;">Прием заказов с сайта круглосуточно!</span></p>\r\n<p><span style="font-size:14px;">Обработка заказов с сайта с 9:00 до 22:00.</span></p>');
