(209, 1, 47, 70, 17, 'AccuBird', 'Аккумуляторный заклепочник AccuBird за 27500 руб.', 'AccuBird, аккумуляторный заклепочник, заклепочник  для вытяжных заклепок', 'Купить заклепочник на аккумуляторе можно в Екатеринбурге. Оформите заявку на сайте и мы с Вами свяжемся в течение 5 минут.', 1, '5.141.91.208', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-14 13:17:52', '2014-07-14 09:39:20', 1, '5.141.91.208', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'AccuBird', 27500, NULL, '', 'Аккумуляторный. Для станд. заклепок всех материалов от 2,4 до 5 мм. Усилие заклепывания 13000 Н...', '<ul>\r\n<li><span style="font-size:14px;">ударопрочный пластиковый корпус,</span></li>\r\n<li><span style="font-size:14px;">электронная система управления,</span></li>\r\n<li><span style="font-size:14px;">электронный контроль защищает от перегрева и перегрузок,</span></li>\r\n<li><span style="font-size:14px;">на корпусе заклепочника установлен подвес,</span></li>\r\n<li><span style="font-size:14px;">рамка для защиты рук,</span></li>\r\n<li><span style="font-size:14px;">насадки размещены в специальном магазине на корпусе.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FFD700;">Профессиональный аккумуляторный заклепочник AccuBird</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Аккумуляторный инструмент для установки вытяжных заклепок, эффективный и удобный в работе. Оборудован системой защиты от термоперегрузки, оснащен емкостью для сбора стержней заклепок. Ресурс зарядки аккумулятора от 400 до 1900 заклепок в зависимости от типоразмера.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nМасса 2,2 кг<br />\r\nГабариты 300*95*265 мм<br />\r\nРабочий ход (макс.) 20 мм<br />\r\nУсилие заклепывания 13000 H<br />\r\nПроизводитель Германия</span></p>\r\n<table align="center" border="1" cellpadding="1" cellspacing="1" style="width: 600px;">\r\n<tbody>\r\n	<tr>\r\n		<td colspan="10" style="text-align: center;"><span style="font-size:16px;"><strong>Диапазон применения инструмента</strong></span></td>\r\n	</tr>\r\n	<tr>\r\n		<td style="text-align: center;"><span style="font-size:14px;"><strong>Стандартные заклепки</strong></span></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">2,4</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">3 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">3,2</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">&nbsp;4 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">4,8</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">&nbsp;5 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">&nbsp;6&nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">6,4</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">&nbsp; 8</span></strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td style="text-align: center;"><span style="font-size:14px;">Аллюминий</span></td>\r\n		<td style="text-align: center;"><span style="color:#FF8C00;"><strong><span style="font-size:14px;">+</span></strong></span></td>\r\n		<td style="text-align: center;"><span style="color:#FF8C00;"><strong><span style="font-size:14px;">+</span></strong></span></td>\r\n		<td style="text-align: center;"><span style="color:#FF8C00;"><strong><span style="font-size:14px;">+</span></strong></span></td>\r\n		<td style="text-align: center;"><span style="color:#FF8C00;"><strong><span style="font-size:14px;">+</span></strong></span></td>\r\n		<td style="text