(64, 1, 38, 61, 4, 'XMKC9040', 'Монтажный пистолет для скоб', 'скобозабивной, скобозабивной пистолет, скобозабивной цена, скобозабивной отзывы, скобозабивной пневматический', 'Основное применение - сборка упаковочных ящиков, каркасные работы с фанерой и гипсокартоном, сборка мебели, укладка паркета. ', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:02:15', '2014-06-23 06:25:43', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'XMKC9040', 5990, 0, '', 'Длина скобы: 12 - 40 мм в пластине. Ширина скобы: 5,8 мм. Толщина скобы: 1,25 х 1,00 мм. Емкость магазина: 100 скоб...', '<ul>\r\n<li><span style="font-size:14px;">Механизм от повторного выстрела;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Простая регулировка заглубления;</span></li>\r\n<li><span style="font-size:14px;">Узкий ствол;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Мягкие насадки на ствол для защиты поверхности от царапин;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Защита от холостого выстрела.&nbsp;</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пневматический скобозабивной пистолет XMKC9040</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Пневматический скобозабивной пистолет для забивания узких скоб длиной до 40 мм. Регулировка глубины забивания. Основное применение - сборка упаковочных ящиков, каркасные работы с фанерой и гипсокартоном, сборка мебели, укладка паркета. Промышленный пневмостеплер для поточной интенсивной работы.</span></p>\r\n<p><strong><span style="font-size:14px;">Техническая характеристика:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина скобы: 12 - 40 мм.<br />\r\nВ пластине.<br />\r\nШирина скобы: 5,8 мм.<br />\r\nТолщина скобы: 1,25 х 1,00 мм<br />\r\nЕмкость магазина: 100 скоб<br />\r\nЗагрузка магазина: боковая<br />\r\nРабочее давление: 4,8 - 7,6 бар<br />\r\nРасход воздуха: 0,95 литр/выстрел при давлении 6 бар&nbsp;<br />\r\nВес: 1,3 кг.</span></p>'),
(9, 1, 18, 37, 1, 'DRU160', 'алмазное сверление', 'алмазное сверление, алмазное сверление бетона, алмазное сверление отверстий, алмазное сверление +в бетоне, алмазное сверление отверстий +в бетоне, сверление алмазными коронками, дрель алмазного сверления', 'Алмазное сверление до 162 мм. Высококачественное сверление алмазными коронками.', 1, '5.141.90.224', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-04 10:59:08', '2014-07-10 05:19:47', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'DRU160(COMBI)', 119500, NULL, '', 'Сверление до 162 мм. Встроенный индикатор мощности и сервиса, пузырьковый уровень. Компактный и эргономичный дизайн. Эффективное сверление со станины - с использованием встроенного указателя центра отверстия.', '<ul>\r\n<li><span style="font-size:14px;">Легковестная, рассчитанная на сверление отверстий до 162 мм;</span></li>\r\n<li><span style="font-size:14px;">Точное и стабильное сверление;</span></li>\r\n<li><span style="font-size:14px;">Черезвычайно прочный моторный блок благодоря металлическому корпусу;</span></li>\r\n<li><span style="font-size:14px;">Проста в работе за счет индикатора контроля мощности;</span></li>\r\n<li><span style="font-size:14px;">Экономия времени при разметке и сверлении (пузырьковый уровень);&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Удобная установка станины&nbsp;(вакумная, распорная, анкерная).</span></li></ul>', '<table align="left" border="1" cellpadding="1" cellspacing="1" dir="ltr">\r\n<caption>\r\n<p style="text-align: center;"><span style="color:#FF8C00;"><font size="3"><b>КОМПЛЕКТНОСТЬ:</b></font></span></p>\r\n<ul>\r\n<li style="text-align: left;"><font size="3">Станина DRU160P;</font></li>\r\n<li style="text-align: left;"><font size="3">Моторный блок DME20PW***/230В;</font></li>\r\n<li style="text-align: left;"><font size="3">Анкерное крепление М12;</font></li>\r\n<li style="text-align: left;"><font size="3">Анкер ED 12 D ( в упаковке&nbsp;50 шт);</font></li>\r\n<li style="text-align: left;"><font size="3">Инструмент для забивания анкеров;</font></li>\r\n<li style="text-align: left;"><span style="font-size:16px;">Бур SDS+ 16/210;</span></li>\r\n<li style="text-align: left;"><font size="3">Емкость для автономной подачи воды, 10 л.</font></li></ul>\r\n<p>&nbsp;</p>\r\n<p><span style="color:#FF8C00;"><strong style="line-height: 1.6em;"><span style="font-size:16px;">Технические характеристики системы</span></strong></span></p></caption>\r\n<thead>\r\n	<tr>\r\n		<th scope="col" style="text-align: left;"><strong>Диапазон диаметров сверления</strong></th>\r\n		<th scope="col"><strong>20-162 мм</strong></th>\r\n	</tr>\r\n</thead>\r\n<tbody>\r\n	<tr>\r\n		<td><strong>Номинальная мощность (230В/50Гц)</strong></td>\r\n		<td style="text-align: center;"><strong>2 кВт</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Номинальная сила тока&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>9,5А</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Скорость под нагрузкой</strong></td>\r\n		<td style="text-align: center;"><strong>520/1400/2900</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Скорость без нагрузки</strong></td>\r\n		<td style="text-align: center;"><strong>830/2200/4600</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td>\r\n		<p><strong>Универсальный патрон для коронок:&nbsp;<strong style="line-height: 1.6em;">резьба внешняя / внутренняя</strong></strong></p></td>\r\n		<td style="text-align: center;"><strong>1</strong>&nbsp;1/4&quot; - 1/2&quot;</td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Применение / способ работы</strong></td>\r\n		<td style="text-align: center;"><strong>Станинное и ручное/ &quot;мокрый&quot;</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td>\r\n		<p><strong>Отвод воды (максимальный диаметр</strong><strong style="line-height: 1.6em;">коронки с использованием системы&nbsp;</strong><strong style="line-height: 1.6em;">водоотвода)</strong></p></td>\r\n		<td style="text-align: center;"><strong>132 мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Максимальная рабочая длинна коронки</strong></td>\r\n		<td style="text-align: center;"><strong>560 мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Размер станины ДхШхВ</strong></td>\r\n		<td style="text-align: center;"><strong>400 мм х 200 мм х 866 мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Размеры моторного блока&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>435мм х115 мм х 300мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Вес моторного отсека&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>9кг</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Электронная и механическая защита от перегрузки</strong></td>\r\n		<td style="text-align: center;"><b>+</b></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Опорная плита станины</strong></td>\r\n		<td style="text-align: center;"><strong>Анкерно-вакуумная</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Указатель центра отверстия</strong></td>\r\n		<td style="text-align: center;"><b>+</b></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Диагональная регулировка с угловой индикация для сверления под углом&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>90 - 45</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td>&nbsp;</td>\r\n		<td>&nbsp;</td>\r\n	</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>'),
