(13, 1, 9, 19, 1, 'mm-40b', 'Газовый монтажный пистолет по бетону, металлу', 'газовый монтажный пистолет, газовый монтажный пистолет цена, газовый монтажный пистолет toua, пистолет газовый монтажный гвоздезабивной, газовый монтажный пистолет toua gsn40a, газовый монтажный пистолет +по бетону', 'Купить газовый монтажный пистолет по бетону можно в Екатеринбурге.  В наличии вся расходка: гвозди по бетону разных размеров. Самая низкая цена выстрела! ', 1, '5.141.90.224', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-04 15:11:53', '2014-07-11 07:42:59', 1, '188.17.192.155', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'MM 40Б (Toua GSN 40A)', 21500, NULL, '', 'Для пристрелки к бетону и к металлу. Энергия выстрела - 90 Дж. Длина используемых дюбелей - 15-40 мм. Диаметр дюбелей - 2,7-3,05 мм . Емкость магазина 40 шт дюбелей...', '<ul>\r\n<li><span style="font-size:14px;">Самая низкая цена выстрела;</span></li>\r\n<li><span style="font-size:14px;">Индикатор аккумулятора на рукоятке пистолета;</span></li>\r\n<li><span style="font-size:14px;">Прост в эксплуатации, безопасен &nbsp;и &nbsp;не требует специальных навыков;</span></li>\r\n<li><span style="font-size:14px;">Для пристрелки к бетону, металлу, штукатурке, цельному кирпичу, дереву.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Газовый монтажный пистолет ММ-40Б (Toua GSN40A)</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Газовые монтажные нейлеры имеют широкую область применения, прост в эксплуатации, безопасен, не требует специальных навыков. Применяется для монтажа на различных типах поверхностях, таких как: бетон, металл, штукатурка, цельный кирпич, дерево. Энергия для срабатывания в нем создается воспламенением горючего газа искрой от встроенного аккумулятора (подобно автомобильному двигателю). Ускоряет процесс монтажа пластиковых клипс, электромонтажных коробов, металлических скоб для сантехнических труб и т.д; направляющих для гипсокартона; штукатурной сетки; деревянной обрешетки, металлических кронштейнов толщиной до 2,5 мм. Эффективен при потолочной фиксации крепежа для подвески воздуховодов, труб, кабельных каналов, подвесных потолков, монтаже профнастила к стальной балке до 6мм и т.д. Подходит крепеж от инструмента Aiken MGN 850C, &nbsp;Toua: GSN40A, GSN65,GSN40ST&nbsp;и многие другие подобные . Самая низкая цена выстрела.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Техническая характеристика:</span></strong></p>\r\n<p><span style="font-size:14px;">Энергия выстрела - 90 Дж<br />\r\nДлина используемых дюбелей - 15-40 мм<br />\r\nДиаметр дюбелей - 2,7-3,05 мм<br />\r\nЕмкость магазина 40 шт дюбелей<br />\r\nКол-во выстрелов на одном газовом баллоне - 1000 шт<br />\r\nКол-во выстрелов на одной зарядке аккумулятора - 4000 шт<br />\r\nКол-во выстрелов в час- 550 штук<br />\r\nСкорострельность - 2-3 шт в сек<br />\r\nТип аккумулятора - NI-MH 1,5 Ач, DC 6 В<br />\r\nТемпература окружающей среды - (-11)-(+50) С&deg;<br />\r\nДля пристрелки к бетону и к металлу.<br />\r\nМасса -3.5 кг.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Комплект поставки:&nbsp;</span></strong></p>\r\n<p><span style="font-size:14px;">Инструмент<br />\r\nЗарядное устройство<br />\r\n2 батареи<br />\r\nЗащитные очки<br />\r\nЗИП<br />\r\nИнструкция<br />\r\nМасленка<br />\r\nКлючи<br />\r\nКейс</span></p>\r\n<p><span style="color:#B22222;"><span style="font-size:14px;">Посмотреть &nbsp;расходники к данному пистолету:<span style="font-family:georgia,serif;"><strong> <a href="http://mechanika-urala.ru/catalog/rashodnyi-material/gvozdi.html" target="_blank">гвозди</a>, <a href="http://mechanika-urala.ru/catalog/rashodnyi-material/ballon165.html" target="_blank">баллон</a>.</strong></span></span></span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe allowfullscreen="" frameborder="0" height="315" src="//www.youtube-nocookie.com/embed/4SPL567aGoE" width="420"></iframe></p>'),
(14, 1, 9, 19, 2, 'GSN65', 'Газовый монтажный пистолет Toua GSN65 по бетону, металлу', 'газовый монтажный пистолет, газовый монтажный пистолет цена, газовый монтажный пистолет купить, газовый монтажный пистолет toua, пистолет газовый монтажный гвоздезабивной, газовый монтажный пистолет toua gsn40a, газовый монтажный пистолет +по бетону', 'Купить пистолет по бетону и металлу можно в Екатеринбурге по выгодной цене. Цена выстрела от 1,3 руб. Многозарядные  строительно-монтажные пистолеты  работают от аккумулятора и газового баллончика', 1, '5.141.88.178', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-05 09:23:58', '2014-07-11 09:27:10', 1, '188.17.192.155', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Toua GSN65', 27000, NULL, '', 'Материал:   бетон, металл.  Диаметр гвоздей:   2.6-3.7 мм. Длина гвоздей:  15-65 мм. Энергия выстрела:   120 Дж...', '<ul>\r\n<li><span style="font-size:14px;">Самая низкая цена выстрела;</span></li>\r\n<li><span style="font-size:14px;">Индикатор аккумулятора на рукоятке пистолета;</span></li>\r\n<li><span style="font-size:14px;">Прост в эксплуатации, безопасен &nbsp;и &nbsp;не требует специальных навыков;</span></li>\r\n<li><span style="font-size:14px;">Для пристрелки к бетону, металлу, штукатурке, цельному кирпичу, дереву;</span></li>\r\n<li><span style="font-size:14px;">Мощность забивания гвоздя.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Газовый монтажный пистолет&nbsp;Toua GSN65</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Газовые многозарядные &nbsp;строительно-монтажные пистолеты &nbsp;работают от аккумулятора и газового баллончика: порция газа из баллончика поступает в камеру сгорания, поджег &nbsp;осуществляется искрой от аккумулятора . Забивание гвоздя производится &nbsp;поршнем. Производитель Toua, поставляет в Россию под разными брендами.&nbsp;</span></p>\r\n<p><span style="font-size:14px;"><span style="line-height: 1.6em;">Увеличение производительности при проведении монтажных работ в 3-4 РАЗА! 1350 рублей за 1000 выстрелов! Дешевле только деревянный чепик в отверстие! &nbsp;Ускоряет процесс монтажа досок пола к несущим балкам, обшивки кровли, плашек к балкам, досок к балкам, деревянной обшивки, деревянной обрешетки, ручная регулировка заглубления, исключен сквозной прострел. &nbsp; Вагонки, паркета, плинтусов не повреждая поверхности! Монтаж деревянных конструкций, монтаж кровли, монтаж полов, монтаж деревянных окон, монтаж деревянного дома, монтаж деревянной лестницы, монтаж деревянных дверей, монтаж деревянных плинтусов, монтаж деревянной вагонки, монтаж деревянного забора, отделка вагонкой и т.д.Ускоряет процесс монтажа пластиковых клипс, электромонтажных коробов, металлических скоб для сантехнических труб и т.д; направляющих для гипсокартона; штукатурной сетки; деревянной обрешетки, металлических кронштейнов толщиной до 2,5 мм. Эффективен при потолочной фиксации крепежа для подвески воздуховодов, труб, кабельных каналов, подвесных потолков, монтаже профнастила к стальной балке до 6мм и т.д. Подходит крепеж от инструмента Aiken MGN 850C, &nbsp;Toua: GSN40A, GSN65,GSN40ST&nbsp;и многие другие подобные . Мы предлагаем самую низкую цену за 1000 выстрелов- 1350 рублей.</span></span></p>\r\n<p><strong><span style="font-size:14px;"><span style="line-height: 1.6em;">Технические характеристики:</span></span></strong></p>\r\n<p><span style="font-size:14px;">Емкость магазина:&nbsp; 40 шт.<br />\r\nТип аккумулятора:&nbsp; &nbsp;Ni-Cd 1.2 А/ч, DC 6 В<br />\r\nМатериал: &nbsp; бетон<br />\r\nДиаметр гвоздей:&nbsp; &nbsp;2.6-3.7 мм<br />\r\nДлина гвоздей:&nbsp; 15-65 мм<br />\r\nЭнергия выстрела:&nbsp; &nbsp;120 Дж<br />\r\nРазмеры:&nbsp; &nbsp;38х37.5х12.2 см<br />\r\nМасса нетто:&nbsp; &nbsp;4.5 кг</span></p>\r\n<p><span style="color: rgb(178, 34, 34); font-size: 14px;">Посмотреть &nbsp;расходники к данному пистолету: гвозди, баллон.</span></p>\r\n<iframe width="560" height="315" src="//www.youtube-nocookie.com/embed/LZX__smTajA" frameborder="0" allowfullscreen></iframe>'),
(15, 1, 9, 19, 3, 'WSQ3490', 'Газовый монтажный пистолет по дереву за 19900 руб.', 'газовый монтажный пистолет цена, газовый монтажный пистолет купить, пистолет газовый монтажный гвоздезабивной, где купить газовый монтажный пистолет ', 'Газовые монтажные пистолеты по дереву в Екатеринбурге! Для Монтажа деревянных конструкций, кровли, полов, деревянных окон, деревянного дома, деревянной лестницы, деревянных дверей, деревянных плинтусов,  деревянной вагонки, деревянного забора, отделка вагонкой и т.д. ', 1, '5.141.88.178', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-05 09:48:30', '2014-07-07 06:24:45', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'WSQ3490', 19900, NULL, '', 'Для быстрого выполнения работ по монтажу деревянных конструкций. Энергия выстрела - 95 Дж. Длина используемых гвоздей - 30-90 мм. Диаметр гвоздей - 2,6-3,0 мм. Емкость магазина 50 шт...', '<ul>\r\n<li><span style="font-size:14px;">Скорострельность - 2-3 шт/сек.;</span></li>\r\n<li><span style="font-size:14px;">Отлично применяется при строительстве деревянных домов, бань;</span></li>\r\n<li><span style="font-size:14px;">Увеличивает производительность труда в 4-5 раз</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color: rgb(255, 140, 0);">Газовый монтажный пистолет WSQ3490</span></strong></span></h1>\r\n<p><span style="font-size: 14px;">Лучший газовый пистолет в нашем ассортименте для дерева!<br />\r\nКомпактный современный инструмент, предназначенный для быстрого выполнения работ по монтажу деревянных конструкций, а так же для крепления материалов, включая тонкий металл, к деревянным поверхностям. Одним словом вбить гвоздь стало секундным делом. Причем вбит он будет с одного удара, ровно и не согнется ни при каких условиях. Газовые многозарядные строительно-монтажные нейлеры &nbsp;работают от аккумулятора и газового баллончика: порция газа из баллончика поступает в камеру сгорания, поджег осуществляется искрой от аккумулятора . Забивание гвоздя производится &nbsp;поршнем.<br />\r\nУвеличение производительности при проведении монтажных работ в 3-4 РАЗА! Ускоряет процесс монтажа досок пола к несущим балкам, обшивки кровли, плашек к балкам, досок к балкам, деревянной обшивки, деревянной обрешетки, ручная регулировка заглубления, исключен сквозной прострел. &nbsp; Вагонки, паркета, плинтусов не повреждая поверхности! Монтаж деревянных конструкций, монтаж кровли, монтаж полов, монтаж деревянных окон, монтаж деревянного дома, монтаж деревянной лестницы, монтаж деревянных дверей, монтаж деревянных плинтусов, монтаж деревянной вагонки, монтаж деревянного забора, отделка вагонкой и т.д.&nbsp;</span></p>\r\n<p><strong><span style="font-size: 14px;">Техническая характеристика:</span></strong></p>\r\n<p><span style="font-size: 14px;">Энергия выстрела - 95 Дж<br />\r\nДлина используемых гвоздей - 30-90 мм<br />\r\nДиаметр гвоздей - 2,6-3,0 мм<br />\r\nЕмкость магазина 50 шт<br />\r\nКол-во выстрелов на одном газовом баллоне - 1200 шт<br />\r\nКол-во выстрелов на одной зарядке аккумулятора - 4000 шт<br />\r\nСкорострельность - 2-3 шт в сек<br />\r\nТип аккумулятора - NI-MH 1,5 Ач, DC 6 В<br />\r\nТемпература окружающей среды - (-15 )-(+50) С&deg;</span></p>'),
(16, 1, 35, 21, 1, 'HS3490', 'Монтажный пистолет для дерева высокого давления', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический	', 'Огромный выбор реечных пистолетов. ООО Механика Урала.  Гвоздезабивные инструменты  широко используются в домостроении и др.. ', 1, '5.141.88.178', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-05 11:23:16', '2014-06-23 05:54:37', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'HS3490', 19000, NULL, '', 'Предназначен для одиночного и серийного забивания гвоздей. Разработан для промышленного применения и строительной сферы. Длина гвоздя  50-90 мм 34 градуса наклон. Диаметр шляпки гвоздей  6,5-7,2 мм D- образная...', '<ul>\r\n<li><span style="font-size:14px;">Обладает отличной сбалансированностью и небольшой массой;</span></li>\r\n<li><span style="font-size:14px;">Профилированный наконечник для визуализации работы;</span></li>\r\n<li><span style="font-size:14px;">Оснащен механизмом предотвращения двойного срабатывания;</span></li>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Спусковой механизм имеет регулятор для серийного гвоздезабивания и возможность одиночного забивания.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Гвоздезабивной реечный пневматический пистолет высокого давления HS3490</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Предназначен для одиночного и серийного забивания гвоздей. Специально разработан для промышленного применения и строительной сферы. Магазин для гвоздей выполнен из алюминия и оснащен стальной направляющей. Инструмент обеспечивает отличную визуализацию рабочего процесса. Предназначен для самых распространенных гвоздей 34 градуса на бумажной ленте D- образная шляпка.<br />\r\nПрименение:&nbsp;деревообработка, плотницкие работы, строительство деревянных домов, каркасов, заборов, ограждений, устройство пола, обшивка стен и кровли, производство тары, упаковки, поддонов и паллет.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздя &nbsp;50-90 мм 34 градуса наклон<br />\r\nДиаметр шляпки гвоздей &nbsp;6,5-7,2 мм D- образная<br />\r\nДиаметр стержня &nbsp;2,8-3,3 мм<br />\r\nВместимость магазина &nbsp;78 шт<br />\r\nВес 3,1 кг</span></p>');
INSERT INTO `Message2004` (`Message_ID`, `User_ID`, `Subdivision_ID`, `Sub_Class_ID`, `Priority`, `Keyword`, `ncTitle`, `ncKeywords`, `ncDescription`, `Checked`, `IP`, `UserAgent`, `Parent_Message_ID`, `Created`, `LastUpdated`, `LastUser_ID`, `LastIP`, `LastUserAgent`, `Name`, `Price`, `OldPrice`, `Pictures`, `ShortDescription`, `Advantages`, `Description`) VALUES
(17, 1, 35, 21, 2, 'XI2190', 'Пневматический пистолет с углом наклона 21⁰', 'гвоздезабивной пистолет цена, строительный пистолет +для гвоздей, гвоздезабивной, гвоздезабивной пистолет', 'Гвоздезабивной пистолет с использованием гвоздей под углом 21⁰ съэкономит средства на расходники.  Продажа строительных пистолетов в Екатеринбурге.', 1, '5.141.88.178', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-05 11:49:35', '2014-06-23 05:54:16', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'XI2190', 8500, NULL, '', 'Для дерева. Длина гвоздей: 50 - 90 мм. С усеченной шляпкой в бумажной обойме. Диаметр гвоздей: 2,87 - 3,80 мм. Угол наклона магазина: 21⁰. Емкость магазина: 50 гвоздей...', '<ul>\r\n<li><span style="font-size:14px;">Высокая скорость работы;</span></li>\r\n<li><span style="font-size:14px;">Чистое забивание гвоздя в поверхность на выставленную глубину;</span></li>\r\n<li><span style="font-size:14px;">Выгодное соотношение: цена / качество+ скорость выполняемых работ;</span></li>\r\n<li><span style="font-size:14px;">Существует возможность снятия или установки на нос ровного наконечника, чтобы не оставлять след на древесине;</span></li>\r\n<li><span style="font-size:14px;">Удобно работать на высоте одной рукой.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Гвоздезабивной реечный пневматический пистолет XI2190</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Широко используются в строительстве деревянных домов, а также в возведении таких конструкций из дерева, как: подиумы и сцены, каркасы полов, обрешетка каркаса крыши и т.д. Большие пистолеты до 160мм берут для устройства пола в вагонах из бруса, фиксации бобин от силовых кабелей. Главным преимуществом использования нейлеров становятся: высокая скорость работы, чистое забивание гвоздя в поверхность на выставленную глубину, выгодное соотношение: цена / качество+ скорость выполняемых работ. Стоит отметить удобство работы гвоздезабивным пневмоинструментом на высоте, когда приходится одновременно забивать гвозди и страховать себя. Существует возможность снятия или установки на нос ровного наконечника. Когда вы бьете в пол, чтобы не оставлять след на древесине вы одеваете наконечник. Если же работать надо в сложных условиях, - в углах, одной рукой - наконечник можно снять и инструмент шипами будет цепляться за древесину. Реечные нейлеры для забивания гвоздей компании Малая Механизация - это профессиональное оборудование с гарантией качества и скромной ценовой политикой.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 50 - 90 мм.<br />\r\nС усеченной шляпкой в бумажной обойме.<br />\r\nДиаметр гвоздей: 2,87 - 3,80 мм.<br />\r\nУгол наклона магазина: 21⁰<br />\r\nЕмкость магазина: 50 гвоздей<br />\r\nЗагрузка магазина: Вертикальная<br />\r\nРабочее давление: 5,5 - 8,3 бар<br />\r\nРасход воздуха: 2,5 литр/выстрел при давлении 6 бар<br />\r\nРазмер: 510x140x365mm<br />\r\nВес: 4.2 кг.&nbsp;</span></p>'),
(18, 1, 35, 21, 3, 'XI3490', 'Иснтрумент для забивания гвоздей', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический,	гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Монтажный пневматический пистолет с использованием гвоздей под углом 34⁰. Отличное решение для строительства домов, бань и других контрукций из дерева в ООО Механика Урала.', 1, '5.141.88.178', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-05 12:05:16', '2014-06-23 05:57:54', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'XI3490', 7500, NULL, '', 'Для дерева. Длина гвоздей: 50 - 90 мм. С усеченной шляпкой в бумажной обойме. Диаметр гвоздей: 2,87 - 3,80 мм. Угол наклона магазина: 34⁰. Емкость магазина: 90 гвоздей...', '<ul>\r\n<li><span style="font-size:14px;">Высокая скорость работы;</span></li>\r\n<li><span style="font-size:14px;">Чистое забивание гвоздя в поверхность на выставленную глубину;</span></li>\r\n<li><span style="font-size:14px;">Выгодное соотношение: цена / качество+ скорость выполняемых работ;</span></li>\r\n<li><span style="font-size:14px;">Существует возможность снятия или установки на нос ровного наконечника, чтобы не оставлять след на древесине</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Гвоздезабивной реечный пневматический пистолет XI3490</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Основное применение реечных гвоздезабивных пистолетов - это монтажные пистолеты по дереву. Широко используются в строительстве деревянных домов, а также в возведении таких конструкций из дерева, как: подиумы и сцены, каркасы полов, обрешетка каркаса крыши и т.д. Большие пистолеты до 160мм берут для устройства пола в вагонах из бруса, фиксации бобин от силовых кабелей. Главным преимуществом использования нейлеров становятся: высокая скорость работы, чистое забивание гвоздя в поверхность на выставленную глубину, выгодное соотношение: цена / качество+ скорость выполняемых работ. Стоит отметить удобство работы гвоздезабивным пневмоинструментом на высоте, когда приходится одновременно забивать гвозди и страховать себя. Существует возможность снятия или установки на нос ровного наконечника. Когда вы бьете в пол, чтобы не оставлять след на древесине вы одеваете наконечник. Если же работать надо в сложных условиях, - в углах, одной рукой - наконечник можно снять и пистолет шипами будет цепляться за древесину. Реечные нейлеры для забивания гвоздей компании Малая Механизация - это профессиональные пневмопистолеты с гарантией качества и скромной ценовой политикой.&nbsp;</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong></span></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 50 - 90 мм.<br />\r\nС усеченной шляпкой в бумажной обойме.<br />\r\nДиаметр гвоздей: 2,87 - 3,80 мм.<br />\r\nУгол наклона магазина: 34⁰<br />\r\nЕмкость магазина: 90 гвоздей<br />\r\nЗагрузка магазина: Вертикальная<br />\r\nРабочее давление: 5,5 - 8,3 бар<br />\r\nРасход воздуха: 2,5 литр/выстрел при давлении 6 бар<br />\r\nРазмер: 458x140x365mm<br />\r\nВес: 3,9 кг.&nbsp;</span></p>'),
(19, 1, 35, 21, 4, 'DPN350S', 'Пневматический молоток', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический, гвоздезабивной пистолет цена\r\n', 'Сложно забить молотком гвоздь? Неудобно забивать гвозди в труднодоступных местах? Решение есть: пневматический гвоздезабиватель DPN350S.', 1, '5.141.88.178', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-05 12:18:53', '2014-06-23 06:01:15', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'DPN350S', 3990, NULL, '', 'Для забивания гвоздей до 100 мм по одному.  Россыпью. Принцип работы молотка. Диаметр гвоздей: 3,00 - 4,20 мм...', '<ul>\r\n<li><span style="font-size:14px;">Увеличивает скорость каркасных работ;</span></li>\r\n<li><span style="font-size:14px;">Обрезиненный корпус для снижения вибрации и комфортной работы;</span></li>\r\n<li><span style="font-size:14px;">Возможность работать в труднодоступных местах;</span></li>\r\n<li><span style="font-size:14px;">Резиновая ручка предназначена для изоляции и снижения вибрации;</span></li>\r\n<li><span style="font-size:14px;">Магнит для удержания гвоздя;</span></li>\r\n<li><span style="font-size:14px;">Очень легкий по весу, что очень важно для работы!</span></li></ul>', '<p><strong><span style="font-size:14px;"><span style="background-color:#FF8C00;">Гвоздезабивной инструмент для забивания гвоздей DPN350S</span></span></strong></p>\r\n<p><span style="font-size:14px;">Гвоздезабивной инструмент &nbsp;для забивания гвоздей до 100 мм по одному. Ладонный пневматический нейлер одно из названий данного инструмента. Принцип работы как у молотка.&nbsp;<br />\r\nПередний выпуск направляет воздух от пользователей.<br />\r\nВозможность работать в труднодоступных местах. &nbsp;Резиновая ручка предназначена для изоляции и снижения вибрации, магнит для удержания гвоздя.<br />\r\nКомплектация: Масленка для ежедневного использования, инструкция &quot;комикс&quot; ,схема устройства, упаковка.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: до 100 мм. Россыпью.&nbsp;<br />\r\nДиаметр гвоздей: 3,00 - 4,20 мм.&nbsp;<br />\r\nДиаметр шляпки: 10,00 мм&nbsp;<br />\r\nРабочее давление: 3,5 - 8,3 бар&nbsp;<br />\r\nРасход воздуха: 84 литр/минута при давлении 6 бар&nbsp;<br />\r\nВес: 0,650 кг.&nbsp;</span></p>'),
(81, 1, 39, 65, 6, 'JN70C', 'Барабанные пистолеты для забивания гвоздей', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический,	гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Гвоздезабивные пистолеты  для крепления профиля к дереву, производства паллет и т.д. можно приобрести в Екатеринбурге.  Размеры гвоздей от 45 до 100 мм.', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-19 12:19:55', '2014-06-19 08:20:33', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'JN70C', 16990, NULL, '', 'Гвозди с проволочным соединением в бабинах 15 гр., длина 50 - 70 мм, диаметр 2,5 - 2,9 мм.  Рабочее давление 5 - 8 бар. Расход воздуха 1,74 л/уд. Ёмкость магазина 1 обойма (250-300 гвоздей)...', '<ul>\r\n<li><span style="font-size:14px;">удобная резиновая рукоятка;</span></li>\r\n<li><span style="font-size:14px;">последовательно движущийся патрон (гвоздь);</span></li>\r\n<li><span style="font-size:14px;">фиксатор при последнем гвозде в магазине.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Монтажный пистолет барабанный пневматический JN70C</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Применяется при изготовлении и ремонте деревянных паллет, тары и изгородей, различные виды упаковочных и ручных работ, крепление настила и обшивки.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Рабочее давление 5 - 8 бар<br />\r\nРасход воздуха 1,74 л/уд<br />\r\nЁмкость магазина 1 обойма (250-300 гвоздей)<br />\r\nРезьба штуцера 1/4&quot;<br />\r\nВысота 330,5 мм<br />\r\nДлина 326 мм<br />\r\nШирина 135 мм<br />\r\nВес 3,69 кг<br />\r\nКРЕПЁЖ: Гвозди с проволочным соединением в баб