(89, 1, 37, 64, 3, 'XOKC1564', 'Пневматический монтажный пистолет для отделки', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический,	гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Широкий выбор пневматических монтажных пистолетов в Екатеринбурге по выгодным ценам.', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-20 09:44:21', '2014-06-20 06:32:20', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'XOKC1564', 7990, NULL, '', 'Длина гвоздей: 32 - 64 мм с D-образной шляпкой в пластине. Диаметр гвоздей: 1,83 мм. Угол наклона магазина: 34⁰. Рабочее давление: 4,9 - 7,6 бар. Расход воздуха: 0,95 литр/выстрел при давлении 6 бар...', '<ul>\r\n<li><span style="font-size:14px;">удобная резиновая рукоятка;</span></li>\r\n<li><span style="font-size:14px;">простая регулировка заглубления;</span></li>\r\n<li><span style="font-size:14px;">узкая носовая часть;</span></li>\r\n<li><span style="font-size:14px;">не уступает аналогичному инструменту раскрученных брендов.&nbsp;</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Отделочный пистолет пневматический XOKC1564</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Гвоздезабивной пистолет поможет быстро и легко &laquo;пристрелить&raquo; отделочные материалы к деревянной поверхности. &laquo;Пристрелка&raquo; осуществляется гвоздями диаметром 1.8 мм, длинна которых может составлять 32-64 мм. Благодаря корпусу из алюминиевого сплава инструмент имеет небольшой вес и характеризуется повышенной надежностью, что немаловажно при профессиональном использовании. Прерывистый и последовательный режим работы предопределяются переключателем на спусковом механизме. При застревании в наконечнике гвоздей извлекаются довольно просто и без использования вспомогательных инструментов. Сам наконечник характеризуется высокой прочностью, а его форма не ограничивает обзора рабочей зоны, способствуя тем самым надлежащему качеству выполняемых работ. Модель оснащена удобной обрезиненной рукояткой, что не дает выскользнуть инструменту из рук. В комплектацию входит переходник на 1/4˝ для подключения к компрессору. Направление выходящего потока воздуха подлежит регулировке.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 32 - 64 мм.<br />\r\nС D-образной шляпкой в пластине.<br />\r\nДиаметр гвоздей: 1,83 мм.<br />\r\nУгол наклона магазина: 34⁰<br />\r\nЕмкость магазина: 100 гвоздей<br />\r\nЗагрузка магазина: снизу<br />\r\nРабочее давление: 4,9 - 7,6 бар<br />\r\nРасход воздуха: 0,95 литр/выстрел при давлении 6 бар&nbsp;<br />\r\nВес: 1,5 кг.<br />\r\nСовместимые гвозди:<br />\r\nSENCO - FinishPro41XP, FinishPro35, SFN40, SFN30, SFN1, SFN2B, SN1<br />\r\nDeWALT - D51275K<br />\r\nHITACHI - NT65MA2, NT65AA<br />\r\nBostitch N62FNK-2<br />\r\nFreeman PFN1564<br />\r\nTrusty DA-1550<br />\r\nPORTER CABLE - DA250B, DA250A</span></p>'),
(88, 1, 37, 64, 2, 'XKKC64', 'Пневматический пистолет', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический,	гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Монтажные пистолеты для отделки помещений, сборки мебели можно купить в Екатеринбурге. Огромный выбор пневматических пистолетов для отделки и других работ...', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-20 09:15:07', '2014-06-20 05:15:07', 0, NULL, NULL, 'XKKC64', 7990, NULL, '', 'Длина гвоздей: 25 - 64 мм с прямоугольной шляпкой в пластине. Диаметр гвоздей: 1,60 - 1,40 мм. Емкость магазина: 100 гвоздей. Загрузка магазина: вертикальная\r\nРабочее давление: 5,5 - 7,6 бар...', '<ul>\r\n<li><span style="font-size:14px;">удобная резиновая рукоятка;</span></li>\r\n<li><span style="font-size:14px;">индикатор пустого магазина;</span></li>\r\n<li><span style="font-size:14px;">узкая носовая часть;</span></li>\r\n<li><span style="font-size:14px;">удобный съемный резиновый наконечник для защиты от царапин.</span></li></ul>', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Отделочный пистолет пневматический XKKC64</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Пневматический пистолет для забивания гвоздей длиной до 64 мм. Основное применение - отделочные работы. Благодаря узкой носовой части пристрелку можно вести в узких местах. Профессиональный пневмоинструмент для большого объема работ.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 25 - 64 мм с прямоугольной шляпкой в пластине.<br />\r\nДиаметр гвоздей: 1,60 - 1,40 мм.<br />\r\nЕмкость магазина: 100 гвоздей<br />\r\nЗагрузка магазина: вертикальная<br />\r\nРабочее давление: 5,5 - 7,6 бар<br />\r\nВес: 1,9 кг.</span></p>'),
