1 - 2,3 мм:<br />\r\nBeA - барабанные гвозди тип: BDC<br />\r\nPREBENA - барабанные гвозди тип: CNW<br />\r\nBOSTITCH - N57C<br />\r\nMAX - CN55<br />\r\nSENCO - PalletPro 50&nbsp;<br />\r\nHITACHI - NV45</span></p>'),
(79, 1, 39, 65, 4, 'jn45r', 'Гвоздезабивной инструмент', 'барабанный пистолет купить, пистолет +для гвоздей, пистолет +для забивания гвоздей, гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Гвоздезабивные пистолеты в Екатеринбурге. Барабанный нейлер по выгодной цене. Качество. Доставка в любой регион России. ', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 14:11:55', '2014-06-19 07:14:59', 1, '217.118.91.64', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'JN45R', 12990, NULL, '', 'Рабочее давление 5 - 8 бар. Расход воздуха 1,04 л/уд. Ёмкость магазина 1 обойма (120 гвоздей). Крепеж: Кровельные гвозди с проволочным соединением в бабинах, длина 19 - 45 мм, диаметр 3,05 мм...', '', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Монтажный пистолет барабанный пневматический JN45R</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Применяется в строительно-монтажных работах, сборка каркасов деревянных домов, крепление листовых материалов, монтаж кровли.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Рабочее давление 5 - 8 бар<br />\r\nРасход воздуха 1,04 л/уд<br />\r\nЁмкость магазина 1 обойма (120 гвоздей)<br />\r\nРезьба штуцера 1/4&quot;<br />\r\nПараметры 267 мм х&nbsp;267 мм х&nbsp;113 мм<br />\r\nВес 2,26 кг<br />\r\nКРЕПЁЖ: Кровельные гвозди с проволочным соединением в бабинах, длина 19 - 45 мм, диаметр 3,05 мм:<br />\r\nBeA - гвозди тип: DPN<br />\r\nJIT - гвозди тип: JRN<br />\r\nMAX - CN450R, CN445R<br />\r\nSENCO - RoofPro<br />\r\nHITACHI - NV45</span></p>'),
(78, 1, 39, 65, 3, 'XRKC50', 'Гвоздезабивной барабанный пистолет', 'гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический, барабанный пистолет, барабанный пистолет для поддонов, барабанный пистолет цена', 'Пневматический гвоздезабивной пистолет XRKC50 предназначен для работы с двумя видами гвоздей, в пластиковой ленте и на проволоке. ', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 13:17:37', '2014-06-18 09:17:37', 0, NULL, NULL, 'XRKC50', 12990, NULL, '', 'Длина гвоздей: 32 - 50 мм с круглой шляпкой в ленте на проволоке, 32- 50 мм в ленте на пластике. Диаметр гвоздей: 2,10 - 2,87 мм. Емкость магазина: 250 - 450 гвоздей. Рабочее давление: 4,8 - 7,6 бар. Расход воздуха: 1,25 литр/выстрел при давлении 6 бар...', '<ul>\r\n<li><span style="font-size:14px;">механизм от повторного выстрела;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">простая регулировка заглубления;</span></li>\r\n<li><span style="font-size:14px;">для работы с двумя видами гвоздей, в пластиковой ленте и на проволоке.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Монтажный пистолет барабанный пневматический XRKC50</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Пневматический гвоздезабивной пистолет предназначен для работы с двумя видами гвоздей, в пластиковой ленте и на проволоке. Данное приемущество выгодно отличает от инструмента других поставщиков.<br />\r\nСтроительный пистолет для забивания гвоздей с широкой шляпкой длиной до 50 мм. Основное применение - каркасные работы, обрешетка, монтаж сайдинга. Профессиональный пневмоинструмент для интенсивной работы.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 32 - 50 мм с круглой шляпкой в ленте на проволоке<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;32- 50 мм в ленте на пластике.<br />\r\nДиаметр гвоздей: 2,10 - 2,87 мм.<br />\r\nДиаметр шляпки: 4,80 - 6,00 мм.<br />\r\nЕмкость магазина: 250 - 450 гвоздей<br />\r\nЗагрузка магазина: Боковая<br />\r\nРабочее давление: 4,8 - 7,6 бар<br />\r\nРасход воздуха: 1,25 литр/выстрел при давлении 6 бар &nbsp;<br />\r\nВес: 2,5 кг.</span></p>\r\n<p>&nbsp;</p>');
