(77, 1, 39, 65, 2, 'XRKC45', 'Гвоздезабивной пистолет', 'барабанный пистолет, барабанный пистолет для поддонов, барабанный пистолет цена, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический, гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Гвоздезабивные пистолеты в Екатеринбурге: барабанные, газовые, реечные, паркетные, отделочные и др. в наличии и  под заказ. Отличное решение при монтаже деревянных домов, пристрелки к бетону, металлу...', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:54:33', '2014-06-18 08:54:33', 0, NULL, NULL, 'XRKC45', 11990, NULL, '', 'Длина гвоздей: 19 - 45 мм С широкой шляпкой в ленте на проволоке. Диаметр гвоздей: 3,05 мм. Диаметр шляпки: 10, 05 мм. Емкость магазина: 120 гвоздей. Рабочее давление: 4,8 - 7,6 бар. Расход воздуха: 1,2 литр/выстрел при давлении 6 бар...', '<ul>\r\n<li><span style="font-size:14px;">механизм от повторного выстрела;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">простая регулировка заглубления.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Монтажный пистолет барабанный пневматический XRKC45</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Строительный пистолет для забивания гвоздей с широкой шляпкой длиной до 45 мм. Основное применение - каркасные работы, обрешетка, монтаж сайдинга. Профессиональный пневмоинструмент для интенсивной работы.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 19 - 45 мм с широкой шляпкой в ленте на проволоке.<br />\r\nДиаметр гвоздей: 3,05 мм.<br />\r\nДиаметр шляпки: 10, 05 мм.<br />\r\nЕмкость магазина: 120 гвоздей<br />\r\nЗагрузка магазина: Боковая<br />\r\nРабочее давление: 4,8 - 7,6 бар<br />\r\nРасход воздуха: 1,2 литр/выстрел при давлении 6 бар&nbsp;<br />\r\nВес: 2,5 кг. &nbsp;</span></p>'),
(76, 1, 39, 65, 1, 'XRKC65', 'Монтажный пистолет для забивания гвоздей', 'барабанный пистолет, барабанный пистолет для поддонов, барабанный пистолет цена, барабанный пистолет купить, пистолет +для гвоздей, пистолет +для забивания гвоздей', 'Купить барабанный пистолет можно в Екатеринбурге. Преимущества: использование гвоздей  нескольких видов до 65 мм. Доступная цена...', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:27:21', '2014-07-07 06:26:15', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'XRKC65', 13990, NULL, '', 'Длина гвоздей: 32 - 65 мм с круглой шляпкой в ленте на проволоке, 45 - 65 мм в ленте на пластике. Емкость магазина: 250 - 450 гвоздей. Рабочее давление: 4,8 - 7,6 бар. Расход воздуха: 1,25 литр/выстрел при давлении 6 бар...', '<ul>\r\n<li><span style="font-size:14px;">механизм от повторного выстрела;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">простая регулировка заглубления;</span></li>\r\n<li><span style="font-size:14px;">для работы с двумя видами гвоздей: в пластиковой ленте и на проволоке.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Монтажный пистолет барабанный пневматический XRKC65</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Пневматический гвоздезабивной пистолет предназначен для работы с двумя видами гвоздей, в пластиковой ленте и на проволоке. Данное приемущество выгодно отличает от инструмента других поставщиков.<br />\r\nСтроительный пистолет для забивания гвоздей с широкой шляпкой длиной до 65 мм. Основное применение - каркасные работы, обрешетка. Профессиональный пневмоинструмент для интенсивной работы.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 32 - 65 мм с круглой шляпкой в ленте на проволоке<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 45 - 65 мм в ленте на пластике.<br />\r\nДиаметр гвоздей: 2,10 - 2,87 мм.<br />\r\nДиаметр шляпки: 4,80 - 6,00 мм.<br />\r\nЕмкость магазина: 250 - 450 гвоздей<br />\r\nЗагрузка магазина: Боковая<br />\r\nРабочее давление: 4,8 - 7,6 бар<br />\r\nРасход воздуха: 1,25 литр/выстрел при давлении 6 бар &nbsp;<br />\r\nВес: 2,5 кг. &nbsp;</span></p>'),
(33, 1, 28, 48, 1, 'Компрессор', 'Компрессор высокого давления HPAC-1030H1', 'компрессор, куплю компрессор, купить компрессор, компрессор цена, поршневой компрессор, компрессоры высокого давления, безмасляный компрессор', 'Купить компрессоры безмасляные можно в Екатеринбурге. В наличии. Питание: AC220V/50Hz. Номинальный ток: 9.5A. Мощность двигателя: 2 л.с. (1,5 кВт)', 1, '188.17.193.76', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-11 09:01:36', '2014-07-07 06:48:14', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'HPAC-1030H1', 54000, NULL, '', 'Питание: AC220V/50Hz. Номинальный ток: 9.5A. Мощность двигателя: 2 л.с. (1,5 кВт). Насос: Масло-менее прямой dribe. Производительность воздуха: 70L/min (низкое давление ) 100L/min (при высоком давлении). Бак: 10L...', '<ul>\r\n<li><span style="font-size:14px;">Безмасляный;</span></li>\r\n<li><span style="font-size:14px;">Низкий уровень шума;</span></li>\r\n<li><span style="font-size:14px;">Двойная система предохранительных клапанов;</span></li>\r\n<li><span style="font-size:14px;">Двойная защита от перегрузки;</span></li>\r\n<li><span style="font-size:14px;">Удобная переносная (выдвижная) ручка и колеса;</span></li>\r\n<li><span style="font-size:14px;">Для одновременного подключения двух инструментов до 8 атм и двух высокого давления до 24 атм;</span></li>\r\n<li><span style="font-size:14px;">Позволяет увеличить скорость монтажа конструкций;</span></li>\r\n<li><span style="font-size:14px;">Пристрелка к бетону, металлу, дереву;</span></li>\r\n<li><span style="font-size:14px;">Незаменим в деревянном домостроении и монтаже гипсакартоновых перегородок, устройство вентиляции, электромонтаже.&nbsp;</span></li></ul>\r\n<p>&nbsp;</p>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Компрессор высокого давления HPAC-1030H1</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Применение: Предназначен для обеспечения работы пневмоинструментом разной направленности. Обеспечивает подачу сжатого воздуха к инструменту по средствам шлангов. Компрессор имеет рукоятку и колеса для легкого перемещения по рабочему месту. Очень мобильный и надежный, а его цена несомненно несомненно удивит каждого! Благодаря своим габаритам его с легкостью можно поместить в багажник любого легкового авто. Подходит, как в промышленном производстве, так и в домашних условиях.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристки:</span></strong></p>\r\n<p><span style="font-size:14px;">Размеры: 620 &times; 425 &times; 320 мм<br />\r\nВес: 25KGS (алюминиевый бак) 35kgs (стальной резервуар)<br />\r\nПитание: AC220V/50Hz<br />\r\nНоминальный ток: 9.5A<br />\r\nМощность двигателя: 2 л.с. (1,5 кВт)&nbsp;<br />\r\nНасос: Масло-менее прямой dribe<br />\r\nПроизводительность воздуха: 70L/min (низкое давление ) 100L/min (при высоком давлении)&nbsp;<br />\r\nБак: 10L<br />\r\nУровень шума: &le; 80 дБ</span></p>'),
(34, 1, 29, 51, 1, 'RT-3616', 'Шуруповерт пневматический', 'шуруповерт, куплю шуруповерт, купить шуруповерт, дрель шуруповерт, шуруповерт цена, где купить шуруповерт', 'Купить пневматическую дрель и шуруповерт  можно в Екатеринбурге по адресу ул. Розы Люксембург, 32, оф. 8', 1, '90.151.142.16', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-11 13:56:02', '2014-06-18 06:13:34', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ROTAKE RT-3616', 1850, NULL, '', 'Частота оборотов 1800 оборотов в минуту. Рабочее давление 6,3 Бар, Потребление воздуха 114 л/мин, Диаметр быстрозажимного патрона 13 мм, Реверс...', '<ul>\r\n<li><span style="font-size:14px;">не большой вес, что позволяет работать даже физически&nbsp;неподготовленному &nbsp;человеку;</span></li>\r\n<li><span style="font-size:14px;">удобная&nbsp;прорезиненную рукоятку, которая идеально ложится в ладонь и не выскальзывает,&nbsp;</span></li>\r\n<li><span style="font-size:14px;">цена.</span></li></ul>', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Шуруповерт пневматический ROTAKE RT-3616</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Предназначен для закручивания гаек, шурупов и винтов без применения силы.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Частота оборотов 1800 оборотов в минуту,<br />\r\nРабочее давление 6,3 Бар,&nbsp;<br />\r\nПотребление воздуха 114 л/мин,&nbsp;<br />\r\nДиаметр быстрозажимного патрона 13 мм,&nbsp;<br />\r\nсоединение штуцера 1/4 дюйма,&nbsp;<br />\r\nРеверс.&nbsp;<br />\r\nВес 1,10 кг.&nbsp;</span></p>'),
(35, 1, 18, 37, 2, 'DRU250', 'Система алмазного бурения', 'алмазное сверление цена, установка алмазного сверления, алмазные коронки +для сверления, алмазные коронки +для алмазного сверления', 'Алмазное сверление до 250 мм.', 1, '90.151.142.16', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-11 15:28:55', '2014-07-10 05:24:03', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'DRA/DRU 250 (COMBI)', 160000, NULL, '', 'Сверление до 250 мм. Встроенный индикатор мощности и сервиса, пузырьковый уровень. Компактный и эргономичный дизайн. Эффективное сверление со станины - с использованием встроенного указателя.', '<ul>\r\n<li><span style="font-size: 14px;">Легковестная, рассчитанная на сверление отверстий до 250 мм;</span></li>\r\n<li><span style="font-size: 14px;">Точное и стабильное сверление;</span></li>\r\n<li><span style="font-size: 14px;">Черезвычайно прочный моторный блок благодоря металлическому корпусу;</span></li>\r\n<li><span style="font-size: 14px;">Проста в работе за счет индикатора контроля мощности;</span></li>\r\n<li><span style="font-size: 14px;">Экономия времени при разметке и сверлении (пузырьковый уровень);&nbsp;</span></li>\r\n<li><span style="font-size: 14px;">Удобная установка станины&nbsp;(вакумная, распорная, анкерная).</span></li></ul>', '<table align="left" border="1" cellpadding="1" cellspacing="1" dir="ltr">\r\n<caption>\r\n<p><font size="3"><b>КОМПЛЕКТНОСТЬ:</b></font></p>\r\n<ul>\r\n<li style="text-align: left;"><font size="3">Станина DRA250P;</font></li>\r\n<li style="text-align: left;"><font size="3">Станина DRU250P;</font></li>\r\n<li style="text-align: left;"><font size="3">Моторный блок DME24MW***/230В;</font></li>\r\n<li style="text-align: left;"><font size="3">Анкерное крепление М12;</font></li>\r\n<li style="text-align: left;"><font size="3">Анкер ED V12 D ( в упаковке&nbsp;50 шт);</font></li>\r\n<li style="text-align: left;"><font size="3">Инструмент для забивания анкеров;</font></li>\r\n<li style="text-align: left;"><span style="font-size: 16px;">Бур SDS+ 16/210;</span></li>\r\n<li style="text-align: left;"><font size="3">Емкость для автономной подачи воды, 10 л.</font></li></ul>\r\n<p>&nbsp;</p>\r\n<p><strong style="line-height: 1.6em;"><span style="font-size: 16px;">Технические характеристики системы</span></strong></p></caption>\r\n<thead>\r\n	<tr>\r\n		<th scope="col" style="text-align: left;"><strong>Диапазон диаметров сверления</strong></th>\r\n		<th scope="col"><strong>40-250 мм</strong></th>\r\n	</tr>\r\n</thead>\r\n<tbody>\r\n	<tr>\r\n		<td><strong>Двухскоростной редуктор перемещения каретки</strong></td>\r\n		<td style="text-align: center;"><strong>1:1 и 1:3,5</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Номинальная сила тока&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>9,5А</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Скорость под нагрузкой</strong></td>\r\n		<td style="text-align: center;"><strong>520/1400/2900</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Скорость без нагрузки</strong></td>\r\n		<td style="text-align: center;"><strong>830/2200/4600</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td>\r\n		<p><strong>Универсальный патрон для коронок:&nbsp;<strong style="line-height: 1.6em;">резьба внешняя / внутренняя</strong></strong></p></td>\r\n		<td style="text-align: center;"><strong>1</strong>&nbsp;1/4&quot; - 1/2&quot;</td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Применение / способ работы</strong></td>\r\n		<td style="text-align: center;"><strong>Станинное и ручное/ &quot;мокрый&quot;</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td>\r\n		<p><strong>Отвод воды (максимальный диаметр</strong><strong style="line-height: 1.6em;">коронки с использованием системы&nbsp;</strong><strong style="line-height: 1.6em;">водоотвода)</strong></p></td>\r\n		<td style="text-align: center;"><strong>132 мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Максимальная рабочая длинна коронки</strong></td>\r\n		<td style="text-align: center;"><strong>560 мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Размер станины ДхШхВ</strong></td>\r\n		<td style="text-align: center;"><strong>400 мм х 200 мм х 866 мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Размеры моторного блока&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>435мм х115 мм х 300мм</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Вес моторного отсека&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>9кг</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Электронная и механическая защита от перегрузки</strong></td>\r\n		<td style="text-align: center;"><b>+</b></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Опорная плита станины</strong></td>\r\n		<td style="text-align: center;"><strong>Анкерно-вакуумная</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Указатель центра отверстия</strong></td>\r\n		<td style="text-align: center;"><b>+</b></td>\r\n	</tr>\r\n	<tr>\r\n		<td><strong>Диагональная регулировка с угловой индикация для сверления под углом&nbsp;</strong></td>\r\n		<td style="text-align: center;"><strong>90 - 45</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td>&nbsp;</td>\r\n		<td>&nbsp;</td>\r\n	</tr>\r\n</tbody>\r\n</table>'),
