(37, 1, 31, 58, 1, 'CS-65', 'Пила ручная CS 65 по выгодной цене', 'пила, пилы, циркулярная пила, пилы циркулярные, пила дисковая, дисковые пилы, торцовочная пила, электрические пилы, пила ручная, ручные пилы, цена пилы, пила ручная циркулярная, ручные циркулярные пилы', 'Купить пилы дисковые электрические можно в Екатеринбурге по выгодным ценам. Питание:220V 50Hz. Глубина пропила (90⁰) 84х176мм. Глубина пропила (45⁰) 45х176мм...', 1, '188.17.193.36', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-16 09:16:46', '2014-07-07 06:50:26', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'CS 65', 3600, NULL, '', 'Диск: Φ185мм. Посадочное отверстие: 20мм. Скорость: 5700об/мин. Мощность: 1250W. Питание:220V 50Hz. Глубина пропила (90⁰) 84х176мм. Глубина пропила (45⁰) 45х176мм...', '<ul>\r\n<li><span style="font-size:14px;">компактный и легкий инструмент, что в первую очередь удобно для распильщика;</span></li>\r\n<li><span style="font-size:14px;">с помощью дисковой пилы можно сделать ровный распил тонкой фанеры, бруса, досок, ДСП, ОСП;</span></li>\r\n<li><span style="font-size:14px;">благодаря блокировке режущего диска с помощью шпинделя можно с легкостью произвести его замену;</span></li>\r\n<li><span style="font-size:14px;">корпус редуктора и привода изготовлены из прочного алюминиевого металла, что характеризует качество инструмента.</span></li></ul>\r\n<p>&nbsp;</p>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пила дисковая (циркулярная) ручная CS 65</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Предназначена для распила тонкой фанеры, бруса, досок, ДСП, ОСП.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong></span></p>\r\n<p><span style="font-size:14px;">Глубина пропила ( 90 градусов) 59мм<br />\r\nГлубина пропила (