(39, 1, 31, 58, 2, 'BDMS-85', 'Купить торцовочные пилы в Екатеринбурге', 'торцовочные пилы, пила цена, электрическая пила, электрические пилы, пила ручная, пила ручная циркулярная, ручные циркулярные пилы', 'Продажа торцовочной пилы по выгодной цене. Ознакомьтесь с информацией, характеристиками.', 1, '188.17.193.36', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-16 09:59:01', '2014-07-03 06:23:15', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'BDMS-85', 7100, NULL, '', 'Посадочное отверстие: 25,4мм. Скорость: 6000об/мин. Мощность: 1800W. Питание:220V 50Hz. Глубина пропила (90⁰) 80х90мм. Глубина пропила (45⁰) 80х80мм...', '<ul>\r\n<li><span style="font-size:14px;">оборудован мешком-пылесборником для сохранения чистоты на рабочем месте;</span></li>\r\n<li><span style="font-size:14px;">благодаря блокировке вала с помощью шпинделя можно легко произвести замену диска;</span></li>\r\n<li><span style="font-size:14px;">инновационная система с &nbsp;прямым приводом и коробкой передач, защитная система разработана для повышения вертикальной режущей способности;</span></li>\r\n<li><span style="font-size:14px;">две задние ручки легко настраиваются 0 &deg; - 45 &deg; (слева и справа);</span></li>\r\n<li><span style="font-size:14px;">легко читаемая с двойной шкалой линейка для более точной корректировки;</span></li>\r\n<li><span style="font-size:14px;">прозрачная кожух для удобства контроля лезвия и линии реза;</span></li>\r\n<li><span style="font-size:14px;">большой пусковой механизм для лучшей подгонки, дополнительный комфорт и удобства эксплуатации.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пила торцевая BDMS-85</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Предназначена для распила тонкой фанеры, бруса, досок, ДСП, ОСП.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Диск: &Phi;255мм<br />\r\nПосадочное отверстие: 25,4мм<br />\r\nСкорость: 6000об/мин.<br />\r\nМощность: 1800W<br />\r\nПитание:220V 50Hz<br />\r\nГлубина пропила (90⁰) 80х90мм<br />\r\nГлубина пропила (45⁰) 80х80мм<br />\r\nКласс защиты 1 (вилка с заземлением) &nbsp;</span></p>'),
(41, 1, 31, 58, 3, 'BS-895', 'Торцовочные пилы по низким ценам', 'пила дисковая, дисковые пилы, торцовочная пила, торцовочные пилы, пила цена, электрическая пила, электрические пилы, пила ручная, ручные пилы, цена пилы, пила ручная циркулярная', 'Ручная пила со скоростью  5000об/мин. Электрическая (220V). Приобрести пилу можно в Екатеринбурге в центре города. ', 1, '5.140.162.161', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-06-16 12:27:44', '2014-07-03 06:23:59', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'BS-895', 11750, NULL, '', 'Посадочное отверстие: 30мм. Скорость: 5000об/мин. Мощность: 1800W. Питание:220V 50Hz. Глубина пропила (90⁰) 65х195мм. Глубина пропила (45⁰) 45х195мм...', '<ul>\r\n<li><span style="font-size:14px;">прозрачный защитный щиток для лучшей видимости лезвия и линии распила;</span></li>\r\n<li><span style="font-size:14px;">негабаритная ручка для лучшей подгонки, дополнительного комфорта и удобства эксплуатации;</span></li>\r\n<li><span style="font-size:14px;">с помощью дисковой пилы можно сделать ровный распил тонкой фанеры, бруса, досок, ДСП, ОСП</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пила торцевая BS-895</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Предназначена для распила тонкой фанеры, бруса, досок, ДСП, ОСП.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong></span></p>\r\n<p><span style="font-size:14px;">Диск: &Phi;305мм<br />\r\nПосадочное отверстие: 30мм<br />\r\nСкорость: 5000об/мин.<br />\r\nМощность: 1800W<br />\r\nПитание:220V 50Hz<br />\r\nГлубина пропила (90⁰) 65х195мм<br />\r\nГлубина пропила (45⁰) 45х195мм<br />\r\nКласс защиты 1 (вилка с заземлением)<br />\r\nВес: 24 кг&nbsp;</span></p>'),
(144, 1, 31, 58, 6, 'BDMS-81', '', '', '', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-03 10:30:21', '2014-07-03 07:16:05', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'BDMS-81', 7200, NULL, '', 'Диск: Φ255мм. Посадочное отверстие: 25,4 мм. Скорость: 6000об/мин. Мощность: 1300W...', '<ul>\r\n<li><span style="font-size:14px;">блокировка вала для легкой замены лезвий;</span></li>\r\n<li><span style="font-size:14px;">оборудована мешком для пыли, что позволяет держать в чистоте рабочее место;</span></li>\r\n<li><span style="font-size:14px;">корпус редуктора и привода изготовлены из прочного алюминиевого металла, что характеризует качество инструмента.</span></li></ul>\r\n<p>&nbsp;</p>', '<h1><span style="font-size:16px;"><strong>Пила торцевая MSWL-82 с лазерным указателем</strong></span></h1>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nДиск: &Phi;255мм<br />\r\nПосадочное отверстие: 25,4мм<br />\r\nСкорость: 6000об/мин.<br />\r\nМощность: 1300W<br />\r\nПитание:220V 50Hz<br />\r\nГлубина пропила (90⁰) 80х90мм<br />\r\nГлубина пропила (45⁰) 80х80мм<br />\r\nКласс защиты 1 (вилка с заземлением)</span></p>'),
(206, 1, 33, 73, 8, 'dubel-grib', 'Дюбель-гвоздь для теплоизоляции монтажным пистолетом', 'дюбель гвоздь +для теплоизоляции, крепеж теплоизоляции, крепеж +для теплоизоляции, дюбель гриб +для теплоизоляции', 'Теперь нет необходимости пользоваться перфоратором для крепления теплоизоляции! Потому что есть новое решение, которое позволяет ускорить монтаж теплоизоляции в 5 раз!', 1, '188.17.192.155', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-11 09:49:43', '2014-07-11 06:21:47', 1, '188.17.192.155', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Дюбель-гвозди для теплоизоляции', 940, NULL, '', 'Длина 50-150 мм. Диаметр 3,55 мм. Шляпка 51 мм...', '<ul>\r\n<li><span style="font-size:14px;">позволяет существенно ускорить монтаж, так как устанавливается монтажным пистолетом Toua GSN40D напрямую в бетон или кирпич и не требует предварительного бурения отверстия &nbsp;перфоратором.</span></li></ul>', '<table align="center" border="1" cellpadding="1" cellspacing="1" style="width: 600px;">\r\n<tbody>\r\n	<tr>\r\n		<td style="text-align: center;"><strong>Длина, мм</strong></td>\r\n		<td style="text-align: center;"><strong>Кол-во в упаковке, шт.</strong></td>\r\n		<td style="text-align: center;"><strong>Цена</strong></td>\r\n	</tr>\r\n	<tr>\r\n		<td style="text-align: center;">50</td>\r\n		<td style="text-align: center;">100</td>\r\n		<td style="text-align: center;">940 руб.</td>\r\n	</tr>\r\n	<tr>\r\n		<td style="text-align: center;">100</td>\r\n		<td style="text-align: center;">100</td>\r\n		<td style="text-align: center;">1111 руб.</td>\r\n	</tr>\r\n	<tr>\r\n		<td style="text-align: center;">120</td>\r\n		<td style="text-align: center;">100</td>\r\n		<td style="text-align: center;">1282 руб.</td>\r\n	</tr>\r\n	<tr>\r\n		<td style="text-align: center;">150</td>\r\n		<td style="text-align: center;">100</td>\r\n		<td style="text-align