(48, 1, 29, 51, 5, 'RT-3805', 'Дрель ручная за 1550 руб.', 'куплю дрель, купить дрель, дрель ударная, дрель цена, дрель ручная', 'Технические характеристики дрели: Частота оборотов 700 оборотов в минуту, Рабочее давление 6,3 Бар, Потребление воздуха 114 л/мин, Диаметр быстрозажимного патрона 13 мм...', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 11:44:30', '2014-07-07 06:47:12', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ROTAKE RT-3805', 1550, NULL, '', 'Частота оборотов 700 оборотов в минуту. Рабочее давление 6,3 Бар. Потребление воздуха 114 л/мин. Диаметр быстрозажимного патрона 13 мм. Реверс...', '<ul>\r\n<li><span style="font-size:14px;">небольшой вес и малые размеры, благодаря чему использовать инструмент становится гораздо легче.;</span></li>\r\n<li><span style="font-size:14px;">приемлемая стоимость</span>.</li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Дрель пневматическая ROTAKE RT-3805</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Предназначена для сверления отверстий в различных основаниях.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Частота оборотов 700 оборотов в минуту,<br />\r\nРабочее давление 6,3 Бар,<br />\r\nПотребление воздуха 114 л/мин,<br />\r\nДиаметр быстрозажимного патрона 13 мм,<br />\r\nсоединение штуцера 1/4 дюйма,<br />\r\nРеверс.<br />\r\nВес 1,65 кг. &nbsp;</span></p>');
