(49, 1, 36, 66, 1, 'DFQ50AI', 'Монтажный пистолет для укладки паркета', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический,	гвоздезабивной пистолет цена, строительный пистолет +для гвоздей, ', 'Паркетные пистолеты пользуются популярностью при монтаже паркета. Выбрать паркетный пистолет можно в Екатеринбурге по выгодным ценам.', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 11:57:41', '2014-06-20 06:58:07', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'DFQ50AI', 10990, 0, '', 'Для забивания скоб. Длина скобы: 32 - 50 мм в пластине. Рабочее давление: 4,8 - 6,2 бар. Расход воздуха: 1,67 литр/выстрел при давлении 6 бар...', '<ul>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Спусковой механизм имеет регулятор для серийного гвоздезабивания и возможность одиночного забивания;</span></li>\r\n<li><span style="font-size:14px;">Расчитан на самые распространенные гвозди и скобы различных размеров.</span></li></ul>', '<p><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пистолет пневматический для паркета DFQ50AI</span></strong></span></p>\r\n<p><span style="font-size:14px;">Пневматический скобозабивной пистолет для забивания скоб длиной до 50 мм. Основное применение - укладка паркетной доски, ламината. Специальная конструкция для пристрелки паркета в стык к фанере. Курок в задней части инструмента срабатывает при ударе молоточком для более точной пристрелки. Профессиональный пневмоинструмент для удобной и быстрой работы.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина скобы: 32 - 50 мм в пластине.<br />\r\nШирина скобы: 12,7 мм.<br />\r\nТолщина скобы: 1,87 х 1,64 мм<br />\r\nЕмкость магазина: 90 скоб<br />\r\nЗагрузка магазина: снизу<br />\r\nРабочее давление: 4,8 - 6,2 бар<br />\r\nРасход воздуха: 1,67 литр/выстрел при давлении 6 бар<br />\r\nРазмер 451x100x550mm<br />\r\nВес: 4,6 кг.&nbsp;</span></p>'),
(84, 1, 37, 64, 1, 'xagd50-9040-t50', 'Монтажный пистолет для скоб и гвоздей', 'скобозабивной, скобозабивной пистолет, скобозабивной цена, гвоздезабивной,	гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический', 'Монтажные пистолеты для отделки можно купить в Екатеринбурге. Отличное качество по доступной цене. Используется для скоб и гвоздей 16GA, 18GA...', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-20 08:48:50', '2014-06-20 04:48:50', 0, NULL, NULL, 'XAGD50/9040/T50', 5990, NULL, '', 'Для пристрелки гвоздей и скоб 18GA, 16GA. Вместимость магазина  100 шт. Рабочее давление от 4 до 7,8  бар...', '<ul>\r\n<li><span style="font-size:14px;">удобная резиновая рукоятка;</span></li>\r\n<li><span style="font-size:14px;">применение как для гвоздей, так и для скоб (3 в 1);</span></li>\r\n<li><span style="font-size:14px;">удобный съемный резиновый наконечник для защиты от царапин.&nbsp;</span></li></ul>', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Монтажный пистолет XAGD50/9040/T50</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Применяется для деревообработки, плотнические работы, строительство деревянных домов, каркасов, заборов, ограждений, устройство пола, обшивка стен и кровли, производство тары, упаковки, мебельного производства, сапожных и багетных работ. Лучшая цена данного инструмента.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Размеры гвоздей и скоб на фотографии.<br />\r\nВместимость магазина &nbsp;100 шт<br />\r\nРабочее давление от 4 до 7,8 &nbsp;бар<br />\r\nРазмер 247x57x236mm<br />\r\nВес 1.33 кг.</span></p>'),
(51, 1, 36, 66, 3, 'DFQ50AII', 'Пневматический монтажный пистолет для укладки паркета, ламината', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический,	гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Монтажные пистолеты для укладки паркета, ламината. Выгодные цены. Широкий ассортимент в Екатеринбурге.', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 11:57:58', '2014-06-20 07:02:16', 1, '188.17.193.97', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'DFQ50AII', 11990, 0, '', 'Основное применение - укладка паркетной доски, ламината. Гвозди двух типов L и T-образной шляпкой в пластине. Для забивания гвоздей длиной до 50 мм. Рабочее давление: 4,8 - 6,2 бар...', '<ul>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Расчитан на самые распространенные гвозди.</span></li></ul>', '<p><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пистолет пневматический для паркета DFQ50AII</span></strong></span></p>\r\n<p><span style="font-size:14px;">Конструкция позволяет использовать гвозди двух типов L и T-образной шляпкой в пластине. Пневматический гвоздезабивной пистолет для забивания гвоздей длиной до 50 мм. Основное применение - укладка паркетной доски, ламината. Специальная конструкция для пристрелки паркета в стык к фанере. Курок в задней части инструмента срабатывает при ударе специальной киянкой входящей в комплект поставки, для более точной пристрелки. Профессиональный пневмоинструмент для удобной и быстрой работы.&nbsp;</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong></span></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 38 - 50 мм.<br />\r\nС L-образной шляпкой в пластине.<br />\r\nТолщина гвоздей: 1,60 мм.<br />\r\nДлина гвоздей: 38 - 50 мм.<br />\r\nС T-образной шляпкой в пластине.<br />\r\nТолщина гвоздей: 1,60 мм.<br />\r\nЕмкость магазина: 110 гвоздей<br />\r\nЗагрузка магазина: снизу<br />\r\nРабочее давление: 4,8 - 6,2 бар<br />\r\nВес: 4,3 кг.</span></p>\r\n<p>&nbsp;</p>'),
(55, 1, 36, 66, 4, 'XMKC40-9040II', 'Гвоздезабивной инструмент для паркета', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, гвоздезабивной пистолет пневматический,	гвоздезабивной пистолет цена, строительный пистолет +для гвоздей', 'Для облегчения такой трудоемкой работы, как укладка штучного паркета и паркетной доски. Купить пистолет можно в Екатеринбурге. ', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:00:04', '2014-06-23 04:00:43', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'XMKC40/9040II', 7990, 0, '', '4 инструмента в 1 инструменте! Длина скобы: 12-40 мм. Ширина скобы: 5,8 мм. Магазин на 100 скоб. Гвозди: 15 - 32 мм в пластине. Гвоздь: 1,25 x 1,00 мм. Магазин на 100 гвоздей...', '<ul>\r\n<li><span style="font-size:14px;">4 инструмента в 1 инструменте;</span></li>\r\n<li><span style="font-size:14px;">Съемная насадка позволяет использовать, как пневматический скобозабивной- гвоздезабивной пистолет для паркета, так и обычный строительный скобозабивной-гвоздезабивной степлер;</span></li>\r\n<li><span style="font-size:14px;">Обладает отличной сбалансированностью и небольшой массой;</span></li>\r\n<li><span style="font-size:14px;">Специально разработан для промышленного применения в строительстве;</span></li>\r\n<li><span style="font-size:14px;">Профилированный наконечник для визуализации работы;</span></li>\r\n<li><span style="font-size:14px;">Оснащен механизмом предотвращения двойного срабатывания;</span></li>\r\n<li><span style="font-size:14px;">Магазин для гвоздей выполнен из алюминия и оснащен стальной направляющей;</span></li>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Спусковой механизм имеет регулятор для серийного гвоздезабивания и возможность одиночного забивания;</span></li>\r\n<li><span style="font-size:14px;">Предназначен для самых распространенных гвоздей и скоб различных размеров.</span></li></ul>', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Пистолет пневматический для паркета XMKC40/9040II</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Данные пневмопистолеты созданы для облегчения такой трудоемкой работы как укладка штучного паркета и паркетной доски. Для различных технологий укладки существует рекомендованный разный крепеж. &nbsp;Для паркетных пневмопистолетов предусмотрено крепление либо скобой для штучного паркета толщиной около 10мм, либо костылем (гвоздем) для более толстой паркетной доски. Пневматический гвоздезабивной пистолет для забивания гвоздей длиной до 50 мм. Основное применение - укладка паркетной доски, ламината. Специальная конструкция для пристрелки паркета в стык к фанере. Профессиональный пневмоинструмент для удобной и быстрой работы.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина скобы: 12-40 мм.<br />\r\nШирина скобы: 5,8 мм.<br />\r\nМагазин на 100 скоб.<br />\r\nГвозди: 15 - 32 мм в&nbsp;пластине<br />\r\nГвоздь: 1,25 x 1,00 мм.<br />\r\nМагазин на 100 гвоздей.<br />\r\nДавление: 4,8 - 6,9 бар<br />\r\nВес: 1,45 кг.&nbsp;</span></p>'),
(62, 1, 38, 61, 2, '06C-001', 'Скобозабивной пистолет', 'скобозабивной, скобозабивной пистолет, скобозабивной цена, скобозабивной отзывы, скобозабивной пневматический', 'Отличное решение для производства мебели. Скобозабивные пистолеты  - широкий выбор нейлеров в Екатеринбурге. Гарантия от производителя!', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:01:57', '2014-06-23 06:21:34', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '06C-001', 7520, 0, '', 'Скобы шириной 10 мм, длина до 32 мм. Вместимость магазина  100 скоб & 100 дисков...', '<ul>\r\n<li><span style="font-size:14px;">Обладает отличной сбалансированностью и небольшой массой;</span></li>\r\n<li><span style="font-size:14px;">Профилированный наконечник для визуализации работы;</span></li>\r\n<li><span style="font-size:14px;">Оснащен механизмом предотвращения двойного срабатывания;</span></li>\r\n<li><span style="font-size:14px;">Магазин для гвоздей выполнен из алюминия и оснащен стальной направляющей;</span></li>\r\n<li><span style="font-size:14px;">Инструмент обеспечивает отличную визуализацию рабочего процесса;</span></li>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Спусковой механизм имеет регулятор для серийного гвоздезабивания и возможность одиночного забивания.</span></li></ul>', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Комбинированный скобозабивной пистолет 06C-001</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Конструкция позволяет использовать скобы шириной 10 мм, длина до 32 мм. Забивание происходит через пластиковый диск. Для защиты от повреждения укрывного материала. предназначен для прибивания пленки, параизоляции и .д.&nbsp;<br />\r\nПредназначен для самых распространенных гвоздей и скоб различных размеров.<br />\r\nПрименение: деревообработка, плотнические работы, строительство деревянных домов, каркасов, заборов, ограждений, устройство пола, обшивка стен и кровли, производство тары, упаковки, мебельного производства, сапожных и багетных работ. Лучшая цена на данный инструмент.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Размеры гвоздей и скоб на фотографии.<br />\r\nВместимость магазина &nbsp;100 скоб &amp; 100 дисков<br />\r\nРазмер 243x155x268mm&nbsp;<br />\r\nВес 2 кг.&nbsp;</span></p>\r\n<p>&nbsp;</p>'),
(58, 1, 34, 26, 6, 'HSPW38', 'Пневматический монтажный пистолет', 'пистолет +для бетона, пистолет по бетону, пистолет по бетону пневматический, пистолет по бетону купить, пистолет по бетону цена, пистолет металл, пневматический пистолет металл, пневматический пистолет  по металлу купить', 'Купить пистолеты высокого давления  можно в Екатеринбурге. К пистолету имеется компрессор высокого давления. Пистолеты высокого давления применяются для пристрелки  к бетону, к дереву, к металлу...', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:00:58', '2014-07-07 06:25:12', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'HSPW38', 19000, 0, '', 'Для крепления металлических или деревянных направляющих к бетону, стали или дереву. Длина дюбеля 16 - 38 мм. Режим стрельбы: полн.последовательный. Норм.рабочее давление: до 24 Атм...', '<ul>\r\n<li><span style="font-size:14px;">Сверхлегкий - всего 2.2 килограмма;</span></li>\r\n<li><span style="font-size:14px;">Компактный размер корпуса;</span></li>\r\n<li><span style="font-size:14px;">Ручка с резиновым покрытием обеспечивает более надежный захват;</span></li>\r\n<li><span style="font-size:14px;">Позволяет крепить металлическое полотно к толстолистовой стали толщиной до 10 мм.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пистолет пневматический по бетону высокого давления HSPW38</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Используется для крепления металлических или деревянных направляющих к бетону, стали или дереву. Это самый мощный пистолет, его сила такова, что позволяет крепить металлическое полотно к толстолистовой стали толщиной до 10 мм. В пистолете используются, как ступенчатые штифты для твердого бетона и стали, так и дюбель-гвозди. Работает с дюбелями специальных сер