(66, 1, 38, 61, 6, 'XAKC9040', 'Скобозабивной пистолет промышленный', 'скобозабивной пневматический, скобозабивной пистолет купить, скобозабивной пистолет промышленный', 'Монтажный пистолет для скобозабивания. Простая регулировка заглубления. Спусковой механизм имеет регулятор для серийного забивания и возможность одиночного выстрела.', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:02:36', '2014-06-23 06:35:53', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'XAKC9040', 4990, 0, '', 'Длина скобы: 12 - 40 мм в пластине. Ширина скобы: 5,8 мм. Толщина скобы: 1,25 х 1,00 мм. Емкость магазина: 100 скоб. Загрузка магазина: боковая...', '<ul>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Спусковой механизм имеет регулятор для серийного забивания и возможность одиночного выстрела;</span></li>\r\n<li><span style="font-size:14px;">Предназначен для самых распространенных гвоздей &nbsp;различных размеров;</span></li>\r\n<li><span style="font-size:14px;">Механизм от повторного выстрела;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Простая регулировка заглубления;</span></li>\r\n<li><span style="font-size:14px;">Узкий ствол;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Мягкие насадки на ствол для защиты поверхности от царапин;&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Защита от холостого выстрела.&nbsp;</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пневматический скобозабивной пистолет XAKC9040</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Пневматический пистолет для монтажа узких скоб длиной до 40 мм. Основное применение - сборка упаковочных ящиков, каркасные работы с фанерой и гипсокартоном, сборка мебели, укладка паркета. Промышленный пневмостеплер для поточной интенсивной работы.</span></p>\r\n<p><strong><span style="font-size:14px;">Техническая характеристика:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина скобы: 12 - 40 мм.<br />\r\nВ пластине.<br />\r\nШирина скобы: 5,8 мм.<br />\r\nТолщина скобы: 1,25 х 1,00 мм<br />\r\nЕмкость магазина: 100 скоб<br />\r\nЗагрузка магазина: боковая<br />\r\nРабочее давление: 4,8 - 7,6 бар<br />\r\nРасход воздуха: 0,95 литр/выстрел при давлении 6 бар&nbsp;<br />\r\nВес: 1,3 кг.</span></p>'),
(67, 1, 38, 61, 7, 'JNS45', 'Пневматический пистолет', 'скобозабивной пневматический, скобозабивной пистолет купить, скобозабивной пистолет промышленный', 'Купить пневматический пистолет  для забивания скоб можно в Екатеринбурге. Огромный выбор. Приятные цены.', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:02:53', '2014-06-23 06:38:34', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'JNS45', 8690, 0, '', 'Скоба 16GA., корона 11,1 мм.  Рабочее давление 5 - 8 бар. Расход воздуха 1,18 л/уд. Ёмкость магазина 160 скоб...', '<ul>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Легкий по весу.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пневматический скобозабивной пистолет JITOOL JNS45</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Применение: строительно-монтажные работы, сборка деревянных каркасов, крепление листовых матриалов к деревянному каркасу, крепление панелей утеплителя, кровельные работы и т.п.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong></span></p>\r\n<p><span style="font-size:14px;">Рабочее давление 5 - 8 бар &nbsp;<br />\r\nРасход воздуха 1,18 л/уд<br />\r\nЁмкость магазина 160 скоб<br />\r\nДиаметр штуцера 1/4&quot;&nbsp;<br />\r\nВысота 298 мм<br />\r\nДлина 349 мм &nbsp;<br />\r\nШирина 94 мм &nbsp;<br />\r\nВес 2,22 кг<br />\r\nКрепеж: Скоба 16GA., корона 11,1 мм:<br />\r\nJIT - скоба тип: N (825, 832, 838, 845, 851)<br />\r\nSENCO - SNS45XP - скоба тип: N<br />\r\nHITACHI - N5008AC - скоба тип: 11200<br />\r\nMAX - TA551 Series</span></p>'),
(68, 1, 38, 61, 8, 'JPS38', 'Пневмопистолет', 'скобозабивной, скобозабивной пистолет, скобозабивной цена, скобозабивной отзывы, скобозабивной пневматический, скобозабивной пистолет купить, скобозабивной пистолет промышленный', 'Пневмопистолеты в Екатеринбурге. Огромный выбор. Выгодные цены.', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:03:18', '2014-06-23 06:40:01', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'JPS38', 8690, 0, '', 'Скоба 16GA., корона 26,2 мм. Рабочее давление 5 - 8 бар. Расход воздуха 0,77 л/уд. Ёмкость магазина 160 скоб...', '<ul>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Легкий по весу.</span></li></ul>', '<h1><span style="font-size: 16px;"><strong><span style="background-color: rgb(255, 140, 0);">Пневматический скобозабивной пистолет JITOOL JPS38</span></strong></span></h1>\r\n<p><span style="font-size: 14px;">Применение: строительно-монтажные работы, сборка деревянных каркасов, крепление листовых матриалов к деревянному каркасу, крепление панелей утеплителя, кровельные работы и т.п.</span></p>\r\n<p><span style="font-size: 14px;"><strong>Технические характеристки:</strong></span></p>\r\n<p><span style="font-size: 14px;">Рабочее давление 5 - 8 бар &nbsp;<br />\r\nРасход воздуха 0,77 л/уд &nbsp;<br />\r\nЁмкость магазина 160 скоб &nbsp;<br />\r\nДиаметр штуцера 1/4&quot;&nbsp;<br />\r\nВысота 262 мм &nbsp;<br />\r\nДлина 364 мм &nbsp;<br />\r\nШирина 76 мм &nbsp;<br />\r\nВес 2,28 кг &nbsp;<br />\r\nКРЕПЁЖ: Скоба 16GA., корона 26,2 мм:<br />\r\nSENCO - WC150XP - скоба тип: P<br />\r\nHITACHI - N5024A - скоба тип: 11300<br />\r\nDUO FAST - RNS-17481 - скоба тип: 1716 CGR</span></p>'),
(92, 1, 35, 21, 6, 'CS26-38', 'Пневмопистолет по бетону', 'пистолет по бетону цена, пистолет металл, пневматический пистолет металл, пневматический пистолет  по металлу купить, пневматический пистолет  по металлу цена, гвоздезабивной пистолет пневматический', 'Продажа пневматических пистолетов по бетону и металлу в Екатеринбурге. Отличное качество. Выгодные цены.', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-23 08:53:17', '2014-06-23 06:56:54', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'CS26/38', 25950, NULL, '', 'Каленый гвоздь по бетону, длина 12 - 38 мм, диаметр 2,6 - 2,9 мм. Рабочее давление 5 - 8 бар. Расход воздуха - л/уд. Ёмкость магазина 1 обойма (42 гвоздя)...', '<ul>\r\n<li><span style="font-size:14px;">мощный, хорошо сбалансированный нейлер;</span></li>\r\n<li><span style="font-size:14px;">легкий по весу;</span></li>\r\n<li><span style="font-size:14px;">простое устранение застревания гвоздей.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Монтажный пневматический пистолет (по бетону) JITOOL CS26/38</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Применяется для крепления различных деталей к бетону.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Рабочее давление 5 - 8 бар<br />\r\nРасход воздуха - л/уд<br />\r\nЁмкость магазина 1 обойма (42 гвоздя)<br />\r\nРезьба штуцера 3/8&quot;<br />\r\nВысота 336.4 мм<br />\r\nДлина 464 мм<br />\r\nШирина 115 мм<br />\r\nВес 3,4 кг<br />\r\nКРЕПЁЖ: Каленый гвоздь по бетону, длина 12 - 38 мм, диаметр 2,6 - 2,9 мм.<br />\r\nСовместим с крепежом для инструментов следующих производителей:<br />\r\nTYREX (TY150ASC)<br />\r\nMAX (GS638E)<br />\r\nHILTI (GX120)&nbsp;</span></p>');
