(70, 1, 38, 61, 10, 'JPS38R', 'Скобозабивные нейлеры', 'скобозабивной пневматический, скобозабивной пистолет купить, скобозабивной пистолет промышленный', 'Применение: строительно-монтажные работы, сборка деревянных каркасов, крепление листовых матриалов к деревянному каркасу, крепление панелей утеплителя, кровельные работы и т.п.', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:03:41', '2014-06-23 06:41:32', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'JPS38R', 8690, 0, '', 'Скоба 16GA., корона 26,2 мм.  Рабочее давление 5 - 8 бар. Расход воздуха 0,77 л/уд. Ёмкость магазина 160 скоб...', '<ul>\r\n<li><span style="font-size:14px;">Высокая мощность для тяжелых условий работы;</span></li>\r\n<li><span style="font-size:14px;">Легкий по весу.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пневматический скобозабивной пистолет JITOOL JPS38R</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Применение: строительно-монтажные работы, сборка деревянных каркасов, крепление листовых матриалов к деревянному каркасу, крепление панелей утеплителя, кровельные работы и т.п.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристки:</strong></span></p>\r\n<p><span style="font-size:14px;">Рабочее давление 5 - 8 бар &nbsp;<br />\r\nРасход воздуха 0,77 л/уд<br />\r\nЁмкость магазина 160 скоб<br />\r\nДиаметр штуцера 1/4&quot;<br />\r\nВысота 262 мм &nbsp;<br />\r\nДлина 364 мм &nbsp;<br />\r\nШирина 89,8 мм<br />\r\nВес 2,4 кг<br />\r\nКРЕПЁЖ: Скоба 16GA., корона 26,2 мм:<br />\r\nSENCO - WC150XP - скоба тип: P<br />\r\nHITACHI - N5024A - скоба тип: 11300<br />\r\nDUO FAST - RNS-17481 - скоба тип: 1716 CGR</span></p>'),
(73, 1, 38, 61, 13, 'JLS38', 'Пневматический степлер', 'скобозабивной пневматический, скобозабивной пистолет купить, скобозабивной пистолет промышленный', 'Пневмостеплеры применяются в мебельном производстве; для обивка, молдинги, интерьерной отделка. Крепление пленочных материалов, кровельного пергамина, винилового и алюминиевого сайдинга. Изготовление дверных и оконных коробок.', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 12:04:11', '2014-06-23 06:56:19', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'JLS38', 6690, 0, '', 'Для Скоб 18GA., корона 6,4 мм. Рабочее давление 5 - 8 бар. Расход воздуха 0,73 л/уд. Ёмкость магазина 110 скоб...', '<ul>\r\n<li><span style="font-size:14px;">легкий по весу;</span></li>\r\n<li><span style="font-size:14px;">удобная резиновая рукоятка.</span></li></ul>', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Монтажный скобозабивной пистолет JITOOL JLS38</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Применяется в мебельном производстве; для обивки, молдинга, интерьерной отделка. Крепление пленочных материалов, кровельного пергамина, винилового и алюминиевого сайдинга. Изготовление дверных и оконных коробок.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Рабочее давление 5 - 8 бар<br />\r\nРасход воздуха 0,73 л/уд<br />\r\nЁмкость магазина 110 скоб<br />\r\nДиаметр штуцера 1/4&quot;<br />\r\nВысота 263,5 мм<br />\r\nДлина 255 мм<br />\r\nШирина 78 мм<br />\r\nВес 1,79 кг &nbsp;<br />\r\nКРЕПЁЖ: Скоба 18GA., корона 6,4 мм:<br />\r\nSENCO - SLS - скоба тип: L<br />\r\nBeA - NS - скоба тип: 90<br />\r\nDUO FAST - SURESHOT 1820 - скоба тип: 1800 Series</span></p>'),
(91, 1, 35, 21, 5, 'PGGD64', 'Монтажный пистолет по бетону', 'пистолет +для бетона, пистолет по бетону, пистолет по бетону пневматический, пистолет по бетону купить, пистолет по бетону цена, пистолет металл, пневматический пистолет металл, пневматический пистолет  по металлу купить', 'Монажный пневмопистолет для пристрелки к бетону и металлу. Характеристики. Дочтупная цена.', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-23 08:33:31', '2014-06-23 04:33:31', 0, NULL, NULL, 'PGGD64', 8000, NULL, '', 'По бетону и металлу. Для Гвоздей типа ST 14GA по бетону с Т- образной шляпкой. Емкость магазина: 70 гвоздей. Рабочее давление:70-110psi (5-7.5bar)...', '<ul>\r\n<li><span style="font-size:14px;">супер крепкий нейлер с сильной движущей силой;</span></li>\r\n<li><span style="font-size:14px;">сверхмощная конструкция, способная проникать в бетон или в стальной лист толщиной до 1 мм.</span></li></ul>', '<p><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Гвоздезабивной пистолет по бетону и металлу PGGD64</span></strong></span></p>\r\n<p><span style="font-size:14px;">Стреляет Т-образными гвоздями к штукатурке, бетону, кирпичу и стали до 3 мм. Длина гвоздя &nbsp;до 64мм, что позволяет монтировать брусок к стене под обшивку деревом или гипсокартоном.&nbsp;<br />\r\nПрименяется для пристрелки направляющих под гипоскартон и натяжные потолки, фанеры под паркет к бетону &nbsp;стяжке, кирпичу; монтаж перфоленты и листового металла до 1.5 к кирпичу и бетону; пристрелка асбо, цементно стружечных плит к металлическим профилям каркаса до 3мм; монтаж бруска к кирпичу и бетону.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Емкость магазина: 70 гвоздей<br />\r\nРабочее давление:70-110psi (5-7.5bar)<br />\r\nГвозди тип ST 14GA по бетону с Т- образной шляпкой.<br />\r\nКрепеж диаметр:&Phi;6.7mm (&Phi;0.264 &quot;)<br />\r\nКрепеж Диаметр головки: &Phi;2.2mm (&Phi;0.087 &quot;)<br />\r\nСила удара: 524 in.lb&nbsp;<br />\r\nРазмеры: 315x95x272mm&nbsp;<br />\r\nВес:3.08kg&nbsp;</span></p>'),
(90, 1, 36, 66, 5, '06A-618BR', 'Пистолет для паркета', 'гвоздезабивной, гвоздезабивной пистолет, пневматический гвоздезабивной, скобозабивной, скобозабивной пистолет, скобозабивной цена', 'Отличный инструмент для отделки помещений. Для использования скоб и гвоздей. Купить гвоздезабивной инструмент можно в Екатеринбурге ООО "Механика Урала".', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-23 08:08:19', '2014-06-23 04:12:08', 1, '94.51.110.121', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', '06A-618BR', 12990, NULL, '', 'Для скоб и гвоздей. Длина гвоздей: 38 - 50 мм с L-образной шляпкой в пластине и с T-образной шляпкой в  пластине.Толщина гвоздей: 1,60 мм. Емкость магазина: 110 гводей. Длина скобы: 32 - 50 мм. Ширина скобы: 12,7 мм. Толщина скобы: 1,87 х 1,64 мм. Емкость магазина: 90 скоб. Рабочее давление: 4,8 - 6,2 бар...', '<ul>\r\n<li><span style="font-size:14px;">удобная резиновая рукоятка;</span></li>\r\n<li><span style="font-size:14px;">специальная конструкция для пристрелки паркета в стык к фанере;</span></li>\r\n<li><span style="font-size:14px;">курок в задней части инструмента срабатывает при ударе молоточком для более точной пристрелки;</span></li>\r\n<li><span style="font-size:14px;">рассчитан на самые распространенные гвозди и скобы различных размеров.</span></li></ul>', '<h1><strong><span style="font-size:16px;"><span style="background-color:#FF8C00;">Пистолет пневматический для паркета 06A-618BR</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Используется в основном для укладки штучного паркета и паркетной доски, ламината. Для различных технологий укладки существует рекомендованный разный крепеж. &nbsp;Для паркетных пневмопистолетов предусмотрено крепление либо скобой для штучного паркета толщиной около 10мм, либо костылем (гвоздем) для более толстой паркетной доски.<br />\r\nКонструкция позволяет использовать гвозди двух типов L и T-образной шляпкой в пластине и скобой до 50 мм. Пневматический гвоздезабивной пистолет для забивания гвоздей длиной до 50 мм. Специальная конструкция для пристрелки паркета в стык к фанере. Курок в задней части инструмента срабатывает при ударе молоточком для более точной пристрелки. Профессиональный пневмоинструмент для удобной и быстрой работы.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Длина гвоздей: 38 - 50 мм с L-образной шляпкой в пластине.<br />\r\nТолщина гвоздей: 1,60 мм.<br />\r\nДлина гвоздей: 38 - 50 мм с T-образной шляпкой в &nbsp;пластине.<br />\r\nТолщина гвоздей: 1,60 мм.<br />\r\nЕмкость магазина: 110 гводей<br />\r\nДлина скобы: 32 - 50 мм.<br />\r\nШирина скобы: 12,7 мм.<br />\r\nТолщина скобы: 1,87 х 1,64 мм<br />\r\nЕмкость магазина: 90 скоб<br />\r\nРабочее давление: 4,8 - 6,2 бар<br />\r\nВес: 4,3 кг.&nbsp;</span></p>'),
