(127, 1, 46, 69, 6, 'SN-10', 'Пневматический резьбовой заклепочник', 'заклепочник пневматический, заклепочник пневма-гидровлический, заклепочник пневматический М, заклепочник резьбовой резьбовой, заклепочник +для резьбовых заклепок, заклепочник резьбовой купить', 'Пневматический заклепочник для резьбовых заклепок высокого качества в Екатеринбурге. Акция - скидка 5%! ', 1, '94.51.156.80', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-26 13:11:44', '2014-06-26 10:06:03', 1, '94.51.156.80', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'SRC SN-10', 42947, 45207, '', 'Пневмогидравлический. Для заклепок М4 до М12...', '<ul>\r\n<li><span style="font-size:14px;">снабжен реверсивным пневмомотором с автоматическим вкручиванием и выкручиванием заклепки в процессе установки;</span></li>\r\n<li><span style="font-size:14px;">оборудован встроенным клапаном аварийного скручивания заклепки;</span></li>\r\n<li><span style="font-size:14px;">имеет возможность регулировки рабочего хода и изменение усилия сжатия заклепки, а также скорости её установки;</span></li>\r\n<li><span style="font-size:14px;">рассчитан на интенсивную эксплуатацию;</span></li>\r\n<li><span style="font-size:14px;">комплектуется удобным кейсом для хранения и транспортировки.</span></li></ul>', '<h1><strong><span style="font-size:16px;">Пневмогидравлический заклепочник для резьбовых заклепок SRC SN-10</span></strong></h1>\r\n<p><span style="font-size:14px;">Это крайне мощный заклепочник, предназначенный для резьбовых заклепок (само усилие сжатия здесь больше 30 кН). При очень грамотном и умелом использовании и обслуживании &ndash; какой-либо альтернативы просто нет. Здесь полный автомат, который управляется одной кнопкой. Вдобавок предусмотрены различного рода регулировки, благодаря которым можно производить любое изменение не только одного усилия сжатия заклепки, но также и скорость ее дальнейшей установки. Он никак не требователен к постоянству своего давления, находящегося в магистрали сжатого воздуха.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Масса, кг &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2,45<br />\r\nДлина, мм &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;313<br />\r\nВысота, мм &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 276<br />\r\nРабочее давление, Bar &nbsp; &nbsp; &nbsp;5-7<br />\r\nРабочий ход (макс.), мм &nbsp; &nbsp;9<br />\r\nУсилие заклепывания, Н &nbsp; &nbsp;29800</span></p>\r\n<p>&nbsp;</p>\r\n<table align="center" border="1" cellpadding="1" cellspacing="1" style="width: 500px;">\r\n<tbody>\r\n	<tr>\r\n		<td colspan="10" style="text-align: center;">\r\n		<p><span style="font-size:16px;"><strong>Диапазон применения инструмента</strong></span></p></td>\r\n	</tr>\r\n	<tr>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">Резьбовые заклепки</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М3 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М4 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М5 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М6 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М8 &nbsp;</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М10</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М12</span></strong></td>\r\n		<td style="text-align: center;"><strong><span style="font-size:14px;">М14</span></strong></td>\r\