(135, 1, 20, 74, 1, 'rb397', 'Вязальный пистолет MAX rb397 за 113500 руб. ', 'вязальный пистолет цена, купить вязальный пистолет, пистолет +для вязки, пистолет +для вязки арматуры, пистолет +для вязки арматуры цена, пистолет +для вязки купить', 'Ознакомиться с характеристиками вязального пистолета. Контакты продавца. Цена пистолета.', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-02 09:51:25', '2014-07-02 07:53:16', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'MAX RB397', 113500, NULL, '', 'Диапазон ширины охвата 20-39 мм. Диаметр проволоки 0,8 мм. Скорость вязки 0,85 сек. Количество витков в вязке 3...', '<ul>\r\n<li><span style="font-size:14px;">скорость вязки (менее 1-й секунды на 1 вязку),</span></li>\r\n<li><span style="font-size:14px;">Li-Ion батарея, благодаря которой производительность пистолета составляет до 2000 узлов без подзарядки,</span></li>\r\n<li><span style="font-size:14px;">высокая скорость и качество узлов.</span></li></ul>', '<h1><strong><span style="font-size:14px;"><span style="font-size:16px;">Пистолет для вязки арматуры MAX RB397</span></span></strong></h1>\r\n<p><span style="font-size:14px;">Применяется: Арматурные цеха заводов ЖБИ; монолитное домостроение; строительство аэродромов, дорог, мостов, плотин и туннелей; общестроительные работы; фундаментные работы.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Скорость связывания: 0.8 сек&nbsp;<br />\r\nКоличество петель: 3&nbsp;<br />\r\nКоличество узлов на одну катушку: 125&nbsp;<br />\r\nЧисло связываний до разряда АКБ: 2000&nbsp;<br />\r\nАккумуляторные батареи: JPL914 (Li-Ion)&nbsp;<br />\r\nНапряжение: 14.4 В&nbsp;<br />\r\nЕмкость: 3.0 Ач&nbsp;<br />\r\nВремя на подзарядку: 30 мин<br />\r\nВес: 2.4 кг&nbsp;<br />\r\nГабариты: 305/105/290&nbsp;</span></p>\r\n<p><span style="font-size:14px;"><strong>Комплект поставки:</strong><br />\r\nПистолет для вязки арматуры,&nbsp;<br />\r\nLi-ion АКБ,&nbsp;<br />\r\nУниверсальное импульсное зарядное устройство,&nbsp;<br />\r\nПрочный пластиковый кейс для переноски и хранения.</span></p>'),
(136, 1, 20, 74, 2, 'rdl20', 'Вязальный пистолет за 28000 руб.', 'вязальный пистолет, вязальный пистолет +для арматуры, вязальный пистолет цена, купить вязальный пистолет', 'Ознакомиться с подробной информацией по вязальному пистолету можете здесь.', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-02 12:04:13', '2014-07-02 08:35:05', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'REVTOOL RDL20', 28000, NULL, '', 'Диапазон ширины охвата: 9-21 мм. Диаметр проволоки: 0,8 мм. Скорость вязки: 0,9 сек. Количество витков в вязке: 2/3. Количество вязок на катушку:160...', '<ul>\r\n<li><span style="font-size:14px;">легкий, компактный инструмент,</span></li>\r\n<li><span style="font-size:14px;">более емкий Li-Ion аккумулятор,</span></li>\r\n<li><span style="font-size:14px;">бесщеточный электродвигатель,</span></li>\r\n<li><span style="font-size:14px;">интеллектуальный инструмент со встроенным чипом.</span></li></ul>', '<h1><strong><span style="font-size:16px;">Вязальный пистолет REVTOOL RDL20</span></strong></h1>\r\n<p><span style="font-size:14px;">Окупаемость 1.5-2 недели. Надежная электроника, проверенная временем механика. Лучший инструмент для вязки арматуры цена-качество.<br />\r\nПрименяется для автоматизации самого неэффективного этапа в монолитном строительстве. Комплект поставки включает кейс, две батареи, зарядное устройство, четыре рулона проволоки, плоскогубцы, ключ, инструкция на &nbsp;русском языке. Применяется на заводах ЖБИ, при строительстве дорог, мостов, монолитном домостроении,монтаже теплых полов и ограждений из колючей проволоки.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Диапазон ширины охвата: 9-21 мм&nbsp;<br />\r\nДиаметр проволоки: 0,8 мм<br />\r\nСкорость вязки: 0,9 сек.<br />\r\nКоличество витков в вязке: 2/3&nbsp;<br />\r\nКоличество вязок на катушку:160&nbsp;<br />\r\nКоличество вязок на одной зарядке батареи:3000&nbsp;<br />\r\nНапряжение аккумуляторной батареи: 14,4 V&nbsp;<br />\r\nГабариты: 268*100*296&nbsp;<br />\r\nВес 2,2 кг.</span></p>'),
(137, 1, 20, 74, 3, 'rdl40', 'Пистолет для вязки арматуры за 28800 руб.', 'вязальный пистолет цена, купить вязальный пистолет, пистолет +для вязки, пистолет +для вязки арматуры, пистолет +для вязки арматуры цена, пистолет +для вязки купить', 'Купить вязальный пистолет по выгодной цене в Екатеринбурге.', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-02 12:40:20', '2014-07-02 08:40:20', 0, NULL, NULL, 'REVTOOL RDL40', 28800, NULL, '', 'Максимальный общий диаметр арматур:40 мм. Время на выполнение одной вязки: около 0.7 сек. Тип проволоки: ММ-0.8 мм,MAX RB-215, RB-395, RB-515. Количество витков в узле: 2 или 3. Количество узлов на одну катушку: 130-160 узлов...', '<ul>\r\n<li><span style="font-size:14px;">легкий, компактный инструмент,</span></li>\r\n<li><span style="font-size:14px;">более емкий Li-Ion аккумулятор,</span></li>\r\n<li><span style="font-size:14px;">бесщеточный электродвигатель,</span></li>\r\n<li><span style="font-size:14px;">интеллектуальный инструмент со встроенным чипом.</span></li></ul>', '<h1><span style="font-size:16px;"><strong>Вязальный пистолет REVTOOL RDL40</strong></span></h1>\r\n<p><span style="font-size:14px;">Самый мощный аккумулятор в своем классе. Окупаемость 1.5-2 недели. Надежная электроника, проверенная временем механика. Лучший инструмент для вязки арматуры цена-качество.<br />\r\nПрименяется для автоматизации самого неэффективного этапа в монолитном строительстве. Комплект поставки включает кейс, две батареи, зарядное устройство, четыре рулона проволоки, плоскогубцы, ключ, инструкция на &nbsp;русском языке. Применяется на заводах ЖБИ, при строительстве дорог, мостов, монолитном домостроении,монтаже теплых полов и ограждений из колючей проволоки.&nbsp;</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Максимальный общий диаметр арматур:40 мм<br />\r\nГабариты: 280 х 100 х 290 мм<br />\r\nМасса с аккумулятором: 2,25 кг<br />\r\nВремя на выполнение одной вязки: около 0.7 секунды<br />\r\nТип проволоки: ММ-0.8 мм,MAX RB-215, RB-395, RB-515<br />\r\nКоличество витков в узле: 2 или 3<br />\r\nКоличество узлов на одну катушку: 130-160 узлов<br />\r\nУзлов на одной зарядке аккумулятора: Более 1400 узлов<br />\r\nПроволоки в одной катушке: 100 метров<br />\r\nТип аккумулятора в комплекте: Li-ion<br />\r\nНапряжение: 14.4 V<br />\r\nЕмкость аккумулятора в комплекте: 3000 мАч<br />\r\nВремя на зарядку аккумулятора: 70 мин</span></p>');
INSERT INTO `Message2004` (`Message_ID`, `User_ID`, `Subdivision_ID`, `Sub_Class_ID`, `Priority`, `Keyword`, `ncTitle`, `ncKeywords`, `ncDescription`, `Checked`, `IP`, `UserAgent`, `Parent_Message_ID`, `Created`, `LastUpdated`, `LastUser_ID`, `LastIP`, `LastUserAgent`, `Name`, `Price`, `OldPrice`, `Pictures`, `ShortDescription`, `Advantages`, `Description`) VALUES
(138, 1, 27, 76, 1, 'lta-3', 'Лебедка ЛТА-3 по выгодной цене', 'лебедка, лебедка ручная, купить лебедку, лебедка цена, лебедка рычажная, тяговая лебедка', 'Подробнее ознакомиться с характеристиками лебедки ЛТА-3, узнать цену можно здесь.', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-02 12:58:05', '2014-07-02 09:05:06', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ЛТА-3', 165000, NULL, '', 'Максимальное тяговое усилие: 3 т. Диаметр турачки (барабана) в месте намотки троса: 155 мм. Максимальная скорость тяжения: 9,5 м/мин.  Приводное устройство: Бензиновый двигатель мощностью 5,5 л.с....', '<ul>\r\n<li><span style="font-size:14px;">имеет правое и левое вращение и две скорости тяжения,</span></li>\r\n<li><span style="font-size:14px;">с бензиновым приводом и горизонтальным тяговым фрикционным барабаном.</span></li></ul>', '<h1><span style="font-size:16px;"><strong>Лебедка тяговая автономная ЛТА-3</strong></span></h1>\r\n<p><span style="font-size:14px;">Оснащена тремя рычагами управления:направления вращения(вперед\\назад), скорости вращения(низкая\\высокая) и &nbsp;рычагом расцепителем, который служит для кратковременного разъединения двигателя от механизма редуктора и вновь его плавного соединения. Механизм сцепления предназначен для передачи крутящего момента двигателя на вал редуктора лебедки.&nbsp;<br />\r\nС помощью данной лебедки осуществляется перенос груза, протяжка кабеля и т.д. Также лебедка применяется не только в быту, но и в таких отраслях, как строительная, автомобильная и т.п.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Максимальное тяговое усилие: 3 т<br />\r\n1-я скорость натяжения: &nbsp;5 м/мин., &nbsp;тяга 3 т.<br />\r\n2-я скорость натяжения: 9 м/мин., тяга 1.8 т.<br />\r\nРеверс: 4 м/мин. (на реверсе груз не поднимать!)&nbsp;<br />\r\nДиаметр турачки (барабана) в месте намотки троса: 155 мм<br />\r\nРазмеры: 800х500х450<br />\r\nМасса: 82 кг&nbsp;<br />\r\nПриводное устройство: Бензиновый двигатель мощностью 5,5 л.с.</span></p>\r\n<p><span style="font-size:14px;"><strong>Характеристика приводного устройства:&nbsp;</strong><br />\r\nДвигатель Honda GX 160: 4-тактный бензиновый двигатель с верхним расположением клапана цилиндра(OHV), горизонтальным валом и воздушным охлаждением; цилиндр расположен под углом 25В&deg;<br />\r\nДвигатель, объем, см3: 163<br />\r\nМаксимальная мощность: 4.0 кВт (5.5 л.с.) / 3 600 об/мин<br />\r\nМаксимальный крутящий момент: 10.8 Нм / 1.1 кг/м / 2 500 об/мин<br />\r\nУдельный расход топлива: 313 г/кВт.ч - 230 г/л.с.ч<br />\r\nГабаритные размеры, мм: 312 x 362 x 335<br />\r\nСухая масса, кг: 15</span></p>\r\n<p><span style="font-size:14px;"><strong>Комплектация лебедки:</strong><br />\r\nБензиновый двигатель<br />\r\nРама<br />\r\nПриводные ремни</span></p>\r\n<p><span style="font-size:14px;"><strong>Расчет перемещения груза лебедкой:</strong><br />\r\nУсилие необходимое для перемещения груза = W x sin&alpha; + K x W x cos&alpha;<br />\r\nГде W - масса груза<br />\r\n&nbsp; &nbsp; &alpha; &nbsp;- угол наклона плоскости.<br />\r\n&nbsp; &nbsp; К - коэффициент трения.&nbsp;<br />\r\nПри перемещении груза по воде и протяжке кабеля по роликам К=0,2-0,3.<br />\r\nПри перемещении груза по бетонной поверхности К=0,5-0,7&nbsp;</span></p>'),
(139, 1, 27, 76, 2, 'lta-5', 'Лебедка ЛТА-5 (до 5 тонн) по выгодной цене', 'купить лебедку, лебедка цена, лебедка рычажная, тяговая лебедка', 'Купить и заказать лебедку ЛТА-5 можно у нас в Екатеринбурге. Ознакомьтесь  с подробной информацией: характеристики,, цена и др.', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-02 14:17:19', '2014-07-03 03:21:59', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ЛТА-5', 220000, NULL, '', 'Максимальное тяговое усилие: 3 т. Максимальная скорость тяжения: 9,5 м/мин. Приводное устройство: Бензиновый двигатель мощностью 5,5 л.с...', '<ul>\r\n<li><span style="font-size:14px;">имеет правое и левое вращение и две скорости тяжения,</span></li>\r\n<li><span style="font-size:14px;">с бензиновым приводом и горизонтальным тяговым фрикционным барабаном.</span></li></ul>', '<h1><span style="font-size:16px;"><strong>Лебедка тяговая автономная ЛТА-5</strong></span></h1>\r\n<p><span style="font-size:14px;">Лебедка тяговая автономная с бензиновым двигателем. Оснащена тремя рычагами управления:направления вращения(вперед\\назад), скорости вращения(низкая\\высокая) и &nbsp;рычагом расцепителем, который служит для кратковременного разъединения двигателя от механизма редуктора и вновь его плавного соединения. Механизм сцепления предназначен для передачи крутящего момента двигателя на вал редуктора лебедки.&nbsp;<br />\r\nС помощью данной лебедки осуществляется перенос груза, протяжка кабеля и т.д. Также лебедка применяется не только в быту, но и в таких отраслях, как строительная, автомобильная и т.п.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Максимальное тяговое усилие: 3 т<br />\r\n1-я скорость натяжения: &nbsp;5 м/мин., &nbsp;тяга 3 т.<br />\r\n2-я скорость натяжения: 9 м/мин., тяга 1.8 т.<br />\r\nРеверс: 4 м/мин. (на реверсе груз не поднимать!)&nbsp;<br />\r\nДиаметр турачки (барабана) в месте намотки троса: 155 мм<br />\r\nРазмеры: 800х500х450<br />\r\nМасса: 82 кг .&nbsp;</span><span style="font-size: 14px; line-height: 1.6em;">Приводное устройство: Бензиновый двигатель мощностью 5,5 л.с.</span></p>\r\n<p><span style="font-size:14px;"><strong>Характеристика приводного устройства:&nbsp;</strong><br />\r\nДвигатель Honda GX 160: 4-тактный бензиновый двигатель с верхним расположением клапана цилиндра(OHV), горизонтальным валом и воздушным охлаждением; цилиндр расположен под углом 25В&deg;<br />\r\nДвигатель, объем, см3: 163<br />\r\nМаксимальная мощность: 4.0 кВт (5.5 л.с.) / 3 600 об/мин<br />\r\nМаксимальный крутящий момент: 10.8 Нм / 1.1 кг/м / 2 500 об/мин<br />\r\nУдельный расход топлива: 313 г/кВт.ч - 230 г/л.с.ч<br />\r\nГабаритные размеры, мм: 312 x 362 x 335<br />\r\nСухая масса, кг: 15</span></p>\r\n<p><span style="font-size:14px;"><strong>Комплектация лебедки:</strong><br />\r\nБензиновый двигатель<br />\r\nРама<br />\r\nПриводные ремни</span></p>\r\n<p><span style="font-size:14px;"><strong>Расчет перемещения груза лебедкой:</strong><br />\r\nУсилие необходимое для перемещения груза = W x sin&alpha; + K x W x cos&alpha;<br />\r\nГде W - масса груза<br />\r\n&nbsp; &nbsp; &alpha; &nbsp;- угол наклона плоскости.<br />\r\n&nbsp; &nbsp; К - коэффициент трения.&nbsp;<br />\r\nПри перемещении груза по воде и протяжке кабеля по роликам К=0,2-0,3.<br />\r\nПри перемещении груза по бетонной поверхности К=0,5-0,7&nbsp;</span></p>'),
(140, 1, 27, 76, 3, 'lta-8', 'Лебедка ЛТА-8 за 235000 руб.', 'лебедка, лебедка ручная, купить лебедку, лебедка цена', 'Посмотреть характеристики лебедки ЛТА-8 можно здесь. Выгодные цены.', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-03 08:09:18', '2014-07-03 04:14:07', 1, '5.141.89.44', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ЛТА-8', 235000, NULL, '', 'Максимальное тяговое усилие: 8 т. Диаметр барабана в месте намотки троса: 160 мм...', '<ul>\r\n<li><span style="font-size:14px;">имеет правое и левое вращение и две скорости тяжения,</span></li>\r\n<li><span style="font-size:14px;">с бензиновым приводом и горизонтальным тяговым фрикционным барабаном.</span></li></ul>\r\n<p>&nbsp;</p>', '<h1><strong><span style="font-size:16px;">Лебедка тяговая автономная ЛТА-5</span></strong></h1>\r\n<p><span style="font-size:14px;">Лебедка тяговая автономная с бензиновым двигателем. Оснащена тремя рычагами управления:направления вращения(вперед\\назад), скорости вращения(низкая\\высокая) и &nbsp;рычагом расцепителем, который служит для кратковременного разъединения двигателя от механизма редуктора и вновь его плавного соединения. Механизм сцепления предназначен для передачи крутящего момента двигателя на вал редуктора лебедки.&nbsp;<br />\r\nС помощью данной лебедки осуществляется перенос груза, протяжка кабеля и т.д. Также лебедка применяется не только в быту, но и в таких отраслях, как строительная, автомобильная и т.п.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Максимальное тяговое усилие: 8 т<br />\r\n1-я скорость натяжения: &nbsp;3 м/мин., &nbsp;тяга 8 Т.<br />\r\n2-я скорость натяжения: 5 м/мин., тяга 3 т.<br />\r\nРеверс: 3 м/мин. (на реверсе груз не поднимать!)&nbsp;<br />\r\nДиаметр барабана в месте намотки троса: 160 мм<br />\r\nРазмеры: 800х500х450</span></p>\r\n<p><span style="font-size:14px;"><strong>Характеристика приводного устройства:</strong>&nbsp;<br />\r\nДвигатель Honda GX 390: 4-тактный бензиновый двигатель с верхним расположением клапана цилиндра(OHV), горизонтальным валом и воздушным охлаждением; цилиндр расположен под углом 25&deg;<br />\r\nДвигатель, объем, см3: 389 см3<br />\r\nМаксимальная мощность: 9.6 кВт (13 л.с.) / 3 600 об/мин<br />\r\nМаксимальный крутящий момент: 26.5 Нм / 2.7 кг/м / 2 500 об/мин<br />\r\nУдельный расход топлива: 313 г/кВт.ч - 230 г/л.с.ч<br />\r\nГабаритные размеры, мм: 405 x 450 x 443 мм<br />\r\nСухая масс, кг: 31<br />\r\nГабаритные размеры, мм: 515 x 490 x 530<br />\r\nСухая масс, кг: 45</span></p>\r\n<p><span style="font-size:14px;"><strong>Комплектация лебедки</strong>:<br />\r\nЛебёдка<br />\r\nБензиновый двигатель<br />\r\nРама<br />\r\nПриводные ремни<br />\r\nНатяжной винт</span></p>\r\n<p><span style="font-size:14px;"><strong>Расчет перемещения груза лебедкой:</strong><br />\r\nУсилие необходимое для перемещения груза = W x sin&alpha; + K x W x cos&alpha;<br />\r\nГде W - масса груза<br />\r\n&nbsp; &nbsp; &alpha; - угол наклона плоскости.<br />\r\n&nbsp; &nbsp; К - коэффициент трения.&nbsp;<br />\r\nПри перемещении груза по воде и протяжке кабеля по роликам К=0,2-0,3.<br />\r\nПри перемещении груза по бетонной п</span>оверхности К=0,5-0,7</p>'),
