(142, 1, 31, 58, 4, 'BS-83', 'Пила торцевая  за 8500 руб.', 'пилы циркулярные, пила дисковая, дисковые пилы, торцовочная пила', 'Торцовочная пила по выгодной цене. Информация о цене, характеристиках здесь.', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-03 09:42:23', '2014-07-03 06:20:29', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'BS-83', 8500, NULL, '', 'Диск: Φ255мм. Посадочное отверстие: 25,4мм. Скорость: 6000об/мин. Мощность: 1800W. Питание:220V 50Hz...', '<ul>\r\n<li><span style="font-size:14px;">прозрачный защитный щиток для лучшей видимости лезвия и линии распила;</span></li>\r\n<li><span style="font-size:14px;">негабаритная ручка для лучшей подгонки, дополнительного комфорта и удобства эксплуатации;</span></li>\r\n<li><span style="font-size:14px;">с помощью дисковой пилы можно сделать ровный распил тонкой фанеры, бруса, досок, ДСП, ОСП;</span></li>\r\n<li><span style="font-size:14px;">оборудован мешком-пылесборником для сохранения чистоты на рабочем месте.</span></li></ul>', '<h1><span style="font-size:16px;"><strong>Пила торцевая BS-83</strong></span></h1>\r\n<p><span style="font-size:14px;">Инновационная система с &nbsp;прямым приводом и коробкой передач, защитная система разработана для повышения вертикальной режущей способности.</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Диск: &Phi;255мм<br />\r\nПосадочное отверстие: 25,4мм<br />\r\nСкорость: 6000об/мин.<br />\r\nМощность: 1800W<br />\r\nПитание:220V 50Hz<br />\r\nГлубина пропила (90⁰) 100х110мм<br />\r\nГлубина пропила (45⁰) 100х85мм<br />\r\nКласс защиты 1 (вилка с заземлением)<br />\r\nВес: 7 кг</span></p>'),
(143, 1, 31, 58, 5, 'MSWL-82', 'Пила с лазерным указателем MSWL-82 за 6850 руб.', 'пила, пилы, циркулярная пила, пилы циркулярные, пила дисковая, дисковые пилы', 'Купить пилу с лазерным указателем можно в Екатеринбурге. Ознакомьтесь с характеристиками и другими нашими товарами.', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-03 10:09:19', '2014-07-03 06:18:32', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'MSWL-82', 6850, NULL, '', 'Диск: Φ205мм. Посадочное отверстие: 20/25,4мм. Скорость: 6000об/мин. Мощность: 1200W...', '<ul>\r\n<li><span style="font-size:14px;">компактный и легкий инструмент, что очень удобно при переноске;</span></li>\r\n<li><span style="font-size:14px;">встроенный лазер;</span></li>\r\n<li><span style="font-size:14px;">эргономичная D-образная рукоятка, позволяет лучше удерживать инструмент, а также придает комфортные условия труда.</span></li></ul>\r\n<p>&nbsp;</p>', '<h1><span style="font-size:16px;"><strong>Пила торцевая MSWL-82 с лазерным указателем</strong></span></h1>\r\n<p><span style="font-size:14px;">Компактный дизайн со стальной раздвижной системой дополнительно повышает жесткость для получения более ровных разрезов</span></p>\r\n<p><strong><span style="font-size:14px;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Диск: &Phi;205мм<br />\r\nПосадочное отверстие: 20/25,4мм<br />\r\nСкорость: 6000об/мин.<br />\r\nМощность: 1200W<br />\r\nПитание:220V 50Hz<br />\r\nГлубина пропила (90⁰) 45х115мм<br />\r\nГлубина пропила (45⁰) 45х95мм<br />\r\nКласс защиты 1 (вилка с заземлением)<br />\r\nВес: 5.5 кг</span></p>'),
(145, 1, 31, 58, 7, 'CSWPH-87', 'Пила дисковая электрическая за 6000 руб.', 'пила дисковая, дисковые пилы, торцовочная пила, торцовочные пилы, пила цена, электрическая пила', 'Открыть  характеристики пилы. Продажа пил в Екатеринбурге.', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-03 11:14:55', '2014-07-03 07:19:24', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'CSWPH-87', 6000, NULL, '', 'Диаметр диска : 255 мм. Диаметр посадочного отверстия: 25.4 мм. Скорость холостого хода: 4200 об/мин. Номинальная мощность: 2260 W...', '<ul>\r\n<li><span style="font-size:14px;">дополнительная рукоятка для удобства работы;</span></li>\r\n<li><span style="font-size:14px;">жесткая конструкция;</span></li>\r\n<li><span style="font-size:14px;">обрезиненные ручки;</span></li>\r\n<li><span style="font-size:14px;">компактный размер, легкий вес обеспечивают легкую работу;</span></li>\r\n<li><span style="font-size:14px;">мощный двигатель обеспечивает высокую производительность;</span></li>\r\n<li><span style="font-size:14px;">защита &nbsp;и шпиндель установлены в прочный литой алюминиевый корпус;</span></li>\r\n<li><span style="font-size:14px;">блокировка шпинделя для легкой замены пилы;</span></li>\r\n<li><span style="font-size:14px;">дизайн подходит для левшей.</span></li></ul>', '<h1><strong><span style="font-size:16px;">Пила дисковая (циркулярная) ручная CSWPH 87</span></strong></h1>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nГлубина пропила ( 90 градусов) 94 мм<br />\r\nГлубина пропила ( 45 градусов ) 74 мм<br />\r\nДиаметр диска : 255 мм<br />\r\nДиаметр посадочного отверстия: 25.4мм<br />\r\nСкорость холостого хода: 4200 об/мин<br />\r\nНоминальная мощность: 2260 W<br />\r\nНоминальное напряжение : 220 вольт<br />\r\nНоминальная частота: 50 Гц<br />\r\n<strong>Информация об упаковке:</strong><br />\r\nРазмер коробки: 60 * 40.5 * 47см<br />\r\nВес 8 кг&nbsp;</span></p>'),
(146, 1, 31, 58, 8, 'csah-883-a', '', '', '', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-03 11:23:50', '2014-07-03 07:26:02', 1, '94.51.110.114', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'CSAH 883A', 4500, NULL, '', 'Диск: Φ235мм. Посадочное отверстие: 25,4 мм. Скорость: 4300 об/мин. Мощность: 1250W...', '<ul>\r\n<li><span style="font-size:14px;">дополнительная рукоятка для удобства работы и комфорта работы;</span></li>\r\n<li><span style="font-size:14px;">компактный размер, легкий вес обеспечивают легкую работу;</span></li>\r\n<li><span style="font-size:14px;">мощный двигатель обеспечивает высокую производительность;</span></li>\r\n<li><span style="font-size:14px;">защита &nbsp;и шпиндель установлены в прочный литой алюминиевый корпус;</span></li>\r\n<li><span style="font-size:14px;">благодаря блокировке режущего диска с помощью шпинделя можно с легкостью произвести его замену;</span></li>\r\n<li><span style="font-size:14px;">дизайн подходит, как для людей владеющих лучше правой рукой, так и для людей владеющих - левой.</span></li></ul>', '<h1><span style="font-size:16px;"><strong>Пила циркулярная дисковая ручная CSAH 883A</strong></span></h1>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nДиск: &Phi;235мм<br />\r\nПосадочное отверстие: 25,4мм<br />\r\nСкорость: 4300об/мин.<br />\r\nМощность: 1250W<br />\r\nПитание:220V 50Hz<br />\r\nГлубина пропила (90⁰) 84х224мм<br />\r\nГлубина пропила (45⁰) 65х223мм<br />\r\nКласс защиты 1 (вилка с заземлением)</span></p>'),
(172, 1, 52, 82, 5, 'st5', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:42:48', '2014-07-10 04:42:48', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST5', 2900, NULL, '', 'Температура использования от -30°C до +50°С. Вес 1,46 кг. Размер UNISIZE. Разрывная нагрузка не менее 15 кН...', '', '<p><span style="font-size:14px;">Рекомендуется для страховки при проведении высотных работ в строительстве, на монтажных горизонтах, искусственных сооружениях, строительных площадках, на линиях электропередач, при проведении кровельных работ и пр. Верхние и нижние лямки имеют различные цвета (красно-черный), что помогает правильно одевать привязь. Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Плечевые и ножные лямки регулируются самофиксирующимися пряжками. Широкий эргономичный кушак для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Идентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.<br />\r\nТехнические характеристики:<br />\r\nТемпература использования от -30&deg;C до +50&deg;С.<br />\r\nВес 1,46 кг<br />\r\nРазмер UNISIZE<br />\r\nРазрывная нагрузка не менее 15 кН<br />\r\nГОСТ Р ЕН 361-2008, ГОСТ Р ЕН 358-2008</span></p>'),
(171, 1, 52, 82, 4, 'st3n', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:42:11', '2014-07-10 04:42:18', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST3N (Nomex)', 14460, NULL, '', 'Размеры: универсальный. Вес: 1,06кг. Температура карбонизации +45°C. Рабочая температура использования от от -30°C до +50°С. ГОСТ Р ЕН 361-2008. Производитель: Safe-Tec Польша...', '', '<p><span style="font-size:14px;">Для защиты от возгорания привязь выполнена из материала NOMEX. Страховочная привязь ST3N имеет две точки крепления для присоединения к системе защиты от падения с высоты. Благодаря самофиксирующимся пряжкам, страховочная привязь ST3N легко регулируется под размер пользователя.</span></p>\r\n<p><span style="font-size:14px;"><strong>Характеристики страховочной привязи ST3N:</strong><br />\r\nРазмеры: универсальный.<br />\r\nВес: 1,06кг.<br />\r\nТемпература карбонизации +45&deg;C.<br />\r\nРабочая температура использования от от -30&deg;C до +50&deg;С.<br />\r\nГОСТ Р ЕН 361-2008.<br />\r\nПроизводитель: Safe-Tec Польша</span></p>'),
(170, 1, 52, 82, 3, 'st3', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:41:31', '2014-07-10 04:41:50', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST3', 1750, NULL, '', 'Масса: 1,00 кг. Размер: универсальный. Разрывная нагрузка: не менее 15 кН. ГОСТ Р ЕН 358-2008. ГОСТ Р ЕН 361-2008. ГОСТ Р ЕН 813-2008. Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">ГОСТ Р ЕН 361-2008<br />\r\nРекомендуется для страховки при проведении высотных работ в строительстве и различных отраслях промышленности: искусственных сооружениях, строительных площадках, монтажных горизонтах, при проведении кровельных работ и пр. Верхние и нижние лямки имеют различные цвета (красно-черный), что помогает правильно одевать привязь. Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Плечевые и ножные лямки регулируются самофиксирующимися пряжками. Позиционирование с применением боковых точек возможно при использовании пояса SB1. Идентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования от -30&deg;C до +50&deg;С.<br />\r\nВес 1,08 кг<br />\r\nРазмер UNISIZE<br />\r\nРазрывная нагрузка не менее 15 кН</span></p>'),
(164, 1, 51, 81, 2, 'stl010', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:09:59', '2014-07-09 07:17:06', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство SAFE-BLOCK STL010', 4900, NULL, '', 'Диаметр анкерной линии 12 мм. Вес 2,8 кг. Длина анкерной линии 20 м...', '', ''),
(163, 1, 51, 81, 1, 'stl002', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:09:10', '2014-07-14 03:57:54', 1, '5.141.91.208', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Гибкая анкерная линия STOPLINE (длина 20м) STL002', 3990, NULL, '', 'Диаметр анкерной линии 12 мм. Вес 2,8 кг. Длина анкерной линии 20 м...', '<ul>\r\n<li><span style="font-size:14px;">для работы на вертикальных, наклонных или горизонтальных плоскостях (крыши, платформы),</span></li>\r\n<li><span style="font-size:14px;">работает в автоматическом режиме.</span></li></ul>', '<p><span style="font-size:14px;">Используется для работы на вертикальных, наклонных или горизонтальных плоскостях (крыши, платформы). В комплект входит: - полиамидный трос, с одной стороны закончен петлёй с коушем, а с другой стороны закончен хвостовой заплёткой; - захват, жёстко устанавливаемый на рабочем тросе (без возможности снятия его с троса); - микроамортизатор стопорного устройства (захвата); - карабин микроамортизатора. Устройство работает в автоматическом режиме.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nДиаметр анкерной линии 12 мм.<br />\r\nВес 2,8 кг<br />\r\nДлина анкерной линии 20 м<br />\r\nГОСТ Р ЕН 353-2-2007</span></p>'),
(169, 1, 52, 82, 2, 'st2', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:41:00', '2014-07-10 04:41:25', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST2', 2900, NULL, '', 'Масса: 1,35 кг. Размер: универсальный. Разрывная нагрузка: не менее 15 кН. ГОСТ Р ЕН 358-2008. ГОСТ Р ЕН 361-2008. ГОСТ Р ЕН 813-2008. Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">ГОСТ Р ЕН 361-2008, ГОСТ Р ЕН 358-2008<br />\r\nРекомендуется для страховки при проведении высотных работ в строительстве, на монтажных горизонтах, искусственных сооружениях, строительных площадках, на линиях электропередач, при проведении кровельных работ, спуске/подъеме, работ в замкнутых пространствах. Верхние и нижние лямки имеют различные цвета (красно-черный), что помогает правильно одевать привязь. Точка крепления на спине для присоединения к системе защиты от падения. Плечевые и ножные лямки регулируются самофиксирующимися пряжками. Пояс имеет широкий эргономичный кушак для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Идентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования от -30&deg;C до +50&deg;С.<br />\r\nВес 1,45 кг<br />\r\nРазмер UNISIZE<br />\r\nРазрывная нагрузка не менее 15 кН</span></p>'),
