(167, 1, 51, 81, 5, 'stl350', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:38:00', '2014-07-09 07:18:36', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Захват SKC STL350', 3980, NULL, '', 'Диаметр анкерной линии 8 мм. Материал захвата нержавеющая сталь. Вес 0,37 кг...', '', ''),
(168, 1, 52, 82, 1, 'st1', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:40:25', '2014-07-10 04:40:53', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST1', 1550, NULL, '', 'Температура использования: от -30°C до +50°С. Вес: 0,90 кг. Размер: Безразмерная. Разрывная нагрузка: не менее 15 кН. ГОСТ Р ЕН 361-2008. Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">Верхние и нижние лямки имеют различные цвета (красно-черный), что помогает правильно одевать привязь.<br />\r\nТочка крепления на спине для присоединения к системе защиты от падения.<br />\r\nПлечевые и ножные лямки регулируются самофиксирующимися пряжками.&nbsp;<br />\r\nПозиционирование с применением боковых точек возможно при использовании пояса SB1.<br />\r\nИдентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики.</strong><br />\r\nТемпература использования: от -30&deg;C до +50&deg;С.<br />\r\nВес: 0,90 кг<br />\r\nРазмер: Безразмерная&nbsp;<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nГОСТ Р ЕН 361-2008<br />\r\nПроизводитель: Safe-Tec</span></p>'),
(155, 1, 50, 80, 1, 'gripstop-225', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:01:57', '2014-07-10 04:19:08', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство с амортизатором и ПА лентой GRIPSTOP 2,25', 3800, 0, '', 'Длина ленты с амортизатором: 2,5 м. Тип карабина: SZA060. Материал ленты: Полиамид. Ширина ленты: 50 мм. Вес: 1,37 кг...', '<ul>\r\n<li><span style="font-size:14px;">для работ на небольшой высоте - замена традиционного страховочного стропа длиной 2 м,</span></li>\r\n<li><span style="font-size:14px;">устройство с автоматическим возвратом ленты,</span></li>\r\n<li><span style="font-size:14px;">встроенный амортизирующий элемент, действующий по принципу ремня безопасности в автомобиле, снижает нагрузку на тело человека в момент падения,</span></li>\r\n<li><span style="font-size:14px;">уменьшение требований к высоте свободного падения благодаря быстро срабатывающему тормозному механизму (при длине стропа 2,5 м &mdash; всего 3,5 м!).</span></li></ul>', '<p>ГОСТ Р ЕН 360-2008</p>\r\n<p><span style="font-size:14px;">Блокирующее устройство с автоматическим возвратом ленты, общая длина которой 2,50 м, ширина 50 мм. Встроенный амортизирующий элемент, действующий по принципу ремня безопасности в автомобиле, снижает нагрузку на тело человека в момент падения. Уменьшение требований к высоте свободного падения благодаря быстро срабатывающему тормозному механизму (при длине стропа 2,5 м &mdash; всего 3,5 м!).<br />\r\nДлина ленты с амортизатором: 2,5 м<br />\r\nТип карабина: SZA060<br />\r\nМатериал ленты: Полиамид<br />\r\nШирина ленты: 50 мм<br />\r\nВес: 1,37 кг&nbsp;</span></p>');
