(156, 1, 50, 80, 2, 'griplight-6', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:02:17', '2014-07-09 06:45:21', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство c ПА лентой GRIPLIGHT 6', 11680, 0, '', 'Длина троса: 6 м. Тип карабина: SZA061. Материал ленты: Kevlar, PA. Вес: 1,7 кг...', '', '<p><span style="font-size:14px;">Блокирующее устройство с втяжным тросом в корпусе из композитного противоударного пластика. Используется для страховки от падения при высотных работах в тяжелых условиях. Карабин имеет индикатор падения. Тормозной механизм моментально срабатывает при резком изменении скорости вытягивания троса. Путь торможения не превышает 0,5 м.<br />\r\nДлина троса: 6 м<br />\r\nТип карабина: SZA061<br />\r\nМатериал ленты: Kevlar, PA<br />\r\nВес: 1,7 кг</span></p>'),
(157, 1, 50, 80, 3, 'gripstop-6', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:02:34', '2014-07-09 06:47:20', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство со стальным тросом GRIPSTOP 6', 18100, 0, '', 'Длина троса: 6 м. Тип карабина: SZA061. Материал троса: Гальванизированная сталь. Диаметр троса: 4 мм. Вес: 5,5 кг...', '', '<p><span style="font-size: 14px;">ГОСТ Р ЕН 360-2008</span><br style="font-size: 14px;" />\r\n<span style="font-size: 14px;">Блокирующее устройство с втяжным тросом из стали в корпусе из композитного противоударного пластика. Используется для страховки от падения при высотных работах в тяжелых условиях, на открытом воздухе, в замкнутых пространствах: люках, цистернах, колодцах, а также при сварочных работах, работах с агрессивными веществами. Тормозной механизм моментально срабатывает при резком изменении скорости вытягивания троса. Путь торможения не превышает 0,5 м.</span><br style="font-size: 14px;" />\r\n<span style="font-size: 14px;">Длина троса: 6 м</span><br style="font-size: 14px;" />\r\n<span style="font-size: 14px;">Тип карабина: SZA061</span><br style="font-size: 14px;" />\r\n<span style="font-size: 14px;">Материал троса: Гальванизированная сталь</span><br style="font-size: 14px;" />\r\n<span style="font-size: 14px;">Диаметр троса: 4 мм</span><br style="font-size: 14px;" />\r\n<span style="font-size: 14px;">Вес: 5,5 кг&nbsp;</span></p>'),
(158, 1, 50, 80, 4, 'gripstop-10', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:02:50', '2014-07-09 06:48:56', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство со стальным тросом GRIPSTOP 10', 18100, 0, '', 'Длина троса: 10 м. Тип карабина: SZA061. Материал троса: Гальванизированная сталь. Диаметр троса: 4 мм. Вес: 5,7 кг', '', '<p><span style="font-size:14px;">ГОСТ Р ЕН 360-2008<br />\r\nБлокирующее устройство с втяжным тросом из стали в корпусе из композитного противоударного пластика. Используется для страховки от падения при высотных работах в тяжелых условиях, на открытом воздухе, в замкнутых пространствах: люках, цистернах, колодцах, а также при сварочных работах, работах с агрессивными веществами. Тормозной механизм моментально срабатывает при резком изменении скорости вытягивания троса. Путь торможения не превышает 0,5 м.<br />\r\nДлина троса: 10 м<br />\r\nТип карабина: SZA061<br />\r\nМатериал троса: Гальванизированная сталь<br />\r\nДиаметр троса: 4 мм<br />\r\nВес: 5,7 кг</span></p>'),
(159, 1, 50, 80, 5, 'gripstop-15', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:03:11', '2014-07-09 06:51:46', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство со стальным тросом GRIPSTOP 15', 18950, 0, '', 'Длина троса: 15 м. Тип карабина: SZA061.  Материал троса: Гальванизированная сталь. Диаметр троса: 4 мм. Вес: 6,5 кг...', '', '<p><span style="font-size:14px;">ГОСТ Р ЕН 360-2008<br />\r\nБлокирующее устройство с втяжным тросом из стали в корпусе из композитного противоударного пластика. Используется для страховки от падения при высотных работах в тяжелых условиях, на открытом воздухе, в замкнутых пространствах: люках, цистернах, колодцах, а также при сварочных работах, работах с агрессивными веществами. Тормозной механизм моментально срабатывает при резком изменении скорости вытягивания троса. Путь торможения не превышает 0,5 м.<br />\r\nДлина троса: 15 м<br />\r\nТип карабина: SZA061<br />\r\nМатериал троса: Гальванизированная сталь<br />\r\nДиаметр троса: 4 мм<br />\r\nВес: 6,5 кг&nbsp;</span></p>'),
(160, 1, 50, 80, 6, 'skyver-15', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:03:36', '2014-07-09 06:53:26', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство со стальным тросом SKYVER 15', 21700, 0, '', 'Длина троса 15 м. Тип карабина AZ002ASI. Материал троса Гальванизированная сталь. Диаметр троса 4 мм. Вес 5,1 кг...', '', '<p><span style="font-size:14px;">ГОСТ Р ЕН 360-2008<br />\r\nСредство защиты втягивающего типа с функцией самоблокировки и автоматическим средством натяжения и возврата втягивающего троса. Устройство размещено в ударопрочном пластиковом корпусе, имеет удобную ручку для переноски. Трос выполнен из нержавеющей стали. Функция амортизации предусмотрена конструкцией устройства. Используется для страховки от падения при высотных работах в тяжелых условиях, на открытом воздухе, в замкнутых пространствах: люках, цистернах, колодцах, а также при сварочных работах, работах с агрессивными веществами.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nДлина троса 11 м<br />\r\nТип карабина AZ002ASI<br />\r\nМатериал троса нержавеющая сталь<br />\r\nВес 5,1 кг</span></p>'),
(161, 1, 50, 80, 7, 'gripstop-25', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:03:57', '2014-07-09 06:55:11', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство со стальным тросом GRIPSTOP 25', 38400, 0, '', 'Длина троса: 25 м. Тип карабина: SZA061. Материал троса: Гальванизированная сталь. Диаметр троса: 4 мм. Вес: 8,3 кг...', '', '<p><span style="font-size:14px;">ГОСТ Р ЕН 360-2008<br />\r\nБлокирующее устройство с втяжным тросом из стали в корпусе из композитного противоударного пластика. Используется для страховки от падения при высотных работах в тяжелых условиях, на открытом воздухе, в замкнутых пространствах: люках, цистернах, колодцах, а также при сварочных работах, работах с агрессивными веществами. Тормозной механизм моментально срабатывает при резком изменении скорости вытягивания троса. Путь торможения не превышает 0,5 м.<br />\r\nДлина троса: 25 м<br />\r\nТип карабина: SZA061<br />\r\nМатериал троса: Гальванизированная сталь<br />\r\nДиаметр троса: 4 мм<br />\r\nВес: 8,3 кг</span></p>'),
(162, 1, 50, 80, 8, 'gripstop-30', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:04:11', '2014-07-09 06:57:00', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Блокирующее устройство со стальным тросом GRIPSTOP 30', 40650, 0, '', 'Длина троса: 28 м. Тип карабина: SZA061. Материал троса: Гальванизированная сталь. Диаметр троса: 4 мм. Вес: 8,7 кг...', '', '<p><span style="font-size:14px;">ГОСТ Р ЕН 360-2008<br />\r\nБлокирующее устройство с втяжным тросом из стали в корпусе из композитного противоударного пластика. Используется для страховки от падения при высотных работах в тяжелых условиях, на открытом воздухе, в замкнутых пространствах: люках, цистернах, колодцах, а также при сварочных работах, работах с агрессивными веществами. Тормозной механизм моментально срабатывает при резком изменении скорости вытягивания троса. Путь торможения не превышает 0,5 м.<br />\r\nДлина троса: 28 м<br />\r\nТип карабина: SZA061<br />\r\nМатериал троса: Гальванизированная сталь<br />\r\nДиаметр троса: 4 мм<br />\r\nВес: 8,7 кг</span></p>'),
(173, 1, 52, 82, 6, 'st5n', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:44:11', '2014-07-10 04:43:09', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST5N (Nomex)', 14950, NULL, '', 'Температура использования от -30°C до +50°С. Вес 1,54 кг. Размер UNISIZE. Разрывная нагрузка не менее 15 кН...', '', '<p><span style="font-size:14px;">Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Плечевые и ножные лямки регулируются самофиксирующимися пряжками. Широкий эргономичный кушак для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Привязь ST5N выполнена с применением огнеупорного материала NOMEX. Температура карбонизации: + 475&deg;С.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования от -30&deg;C до +50&deg;С.<br />\r\nВес 1,54 кг<br />\r\nРазмер UNISIZE<br />\r\nРазрывная нагрузка не менее 15 кН<br />\r\nГОСТ Р ЕН 361-2008, ГОСТ Р ЕН 358-2008</span></p>'),
(174, 1, 52, 82, 7, 'ST4', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:46:15', '2014-07-10 04:43:30', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST4', 2200, NULL, '', 'Масса: 1,15 кг. Размер: универсальный. Разрывная нагрузка: не менее 15 кН. ГОСТ Р ЕН 361-2008. ГОСТ Р ЕН 358-2008. ГОСТ Р ЕН 813-2008. Производитель: Safe-Tec Польша...', '', '<p><span style="font-size:14px;">Отличительные характеристики: имеет две точки крепления &ndash; на груди и на спине. Используется с устройством LFT001. Просто надевается: верхняя и нижняя части системы выполнены в разных цветах. Благодаря небольшому весу и мягким лентам система очень комфортна. Наличие 4 самофиксирующихся пряжек позволяет быстро подогнать систему под свой размер. Грудная точка крепления представляет собой два стальных полукольца, задняя &ndash; стальное полукольцо.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nМасса: 1,15 кг.<br />\r\nРазмер: универсальный.<br />\r\nРазрывная нагрузка: не менее 15 кН.<br />\r\nГОСТ Р ЕН 361-2008<br />\r\nГОСТ Р ЕН 358-2008<br />\r\nГОСТ Р ЕН 813-2008<br />\r\nПроизводитель: Safe-Tec Польша</span></p>'),
(175, 1, 52, 82, 8, 'st6', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:46:46', '2014-07-10 04:45:12', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная ST6', 3700, NULL, '', 'Температура использования от -30°C до +50°С. Вес 1,54 кг. Размер UNISIZE. Разрывная нагрузка не менее 15 кН...', '', '<p><span style="font-size:14px;">Рекомендуется для страховки при проведении высотных работ в строительстве, на монтажных горизонтах, искусственных сооружениях, строительных площадках, на линиях электропередач, при проведении кровельных работ, спуске/подъеме, работ в замкнутых пространствах. Верхние и нижние лямки имеют различные цвета (красно-черный), что помогает правильно одевать привязь. Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Плечевые и ножные лямки регулируются самофиксирующимися пряжками. Ножные лямки имеют подкладку из дышащего пеноматериала, обеспечивающего максимальный комфорт при работе. Широкий эргономичный кушак для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Идентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования от -30&deg;C до +50&deg;С.<br />\r\nВес 1,54 кг<br />\r\nРазмер UNISIZE<br />\r\nРазрывная нагрузка не менее 15 кН<br />\r\nГОСТ Р ЕН 361-2008, ГОСТ Р ЕН 358-2008</span></p>'),
(176, 1, 52, 82, 9, 'mauntage', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:47:44', '2014-07-10 04:45:44', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная MAUNTAGE', 5450, NULL, '', 'Температура использования: от -30°C до +50°С. Вес: 1,88кг . Размер: UNISIZE . Разрывная нагрузка: не менее 15 кН . Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">Верхние и нижние лямки имеют различные цвета (красно-черный), что помогает правильно одевать привязь. Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Плечевые и ножные лямки регулируются самофиксирующимися пряжками. Привязь снабжена разгрузочными петлями и кольцами. Верхние лямки выполнены из эластичной ленты. Пояс и ножные лямки снабжены автоматическими застежками CLICK.&nbsp;<br />\r\nШирокий эргономичный кушак для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Пояс имеет широкий эргономичный износостойкий кушак для комфортной работы. Пояс может вращаться вокруг своей оси независимо от кушака, что создает дополнительную степень свободы при работе в подпоре.&nbsp;<br />\r\nИдентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg;C до +50&deg;С.&nbsp;<br />\r\nВес: 1,88кг&nbsp;<br />\r\nРазмер: UNISIZE&nbsp;<br />\r\nРазрывная нагрузка: не менее 15 кН&nbsp;<br />\r\nПроизводитель: Safe-Tec&nbsp;</span></p>'),
(177, 1, 52, 82, 10, 'mauntage-isol', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:53:36', '2014-07-10 04:47:06', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная MAUNTAGE ISOL', 9825, NULL, '', 'Температура использования: от -30°C до +50°С. Вес: 1,90 кг. Размер: UNISIZE. Разрывная нагрузка: не менее 15 кН. Производитель: Safe-Tec...', '', '<p>Верхние и нижние лямки имеют различные цвета (красно-черный), что помогает правильно одевать привязь. Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Плечевые и ножные лямки регулируются самофиксирующимися пряжками. Привязь снабжена разгрузочными петлями и кольцами.<br />\r\nВерхние лямки выполнены из эластичной ленты. Пояс и ножные лямки снабжены автоматическими застежками CLICK.<br />\r\n<span style="font-size:14px;">Широкий эргономичный кушак для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Пояс имеет широкий эргономичный износостойкий кушак для комфортной работы.<br />\r\nПояс может вращаться вокруг своей оси независимо от кушака, что создает дополнительную степень свободы при работе в подпоре. Идентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg;C до +50&deg;С.<br />\r\nВес: 1,90кг<br />\r\nРазмер: UNISIZE<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nПроизводитель: Safe-Tec</span></p>'),
(178, 1, 52, 82, 11, 'canyon', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:54:34', '2014-07-10 04:47:31', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная CANYON', 8700, NULL, '', 'Температура использования: от -30° С до +50° С. Вес: 1,72 кг. Размер: UNISIZE. Разрывная нагрузка: не менее 15 кН. Производитель: Safe-Tec Пояс...', '', '<p><span style="font-size:14px;">Широкий, эргономичный кушак для комфортной поддержки. Плечевые лямки имеют подкладку из пеноматериала и широко раздвинуты, чтобы не натирать шею.<br />\r\nНожные лямки имеют подкладку из дышащего пеноматериала, обеспечивающего максимальный комфорт при зависании. &nbsp;Брюшная точка прикрепления равномерно распределяет нагрузку между поясом и ножными лямками, когда пользователь работает без опоры под ногами. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) слегка выгнуты для удобного присоединения карабинов.&nbsp;<br />\r\nСпинная и грудная точки прикрепления предназначены для присоединения к системе защиты от падения. На поясе предусмотрены три разгрузочные петли в защитной оболочке. Верхние лямки выполнены из эластичного материала и снабжены самофиксирующимися пряжками.<br />\r\nПояс и ножные лямки снабжены автоматическими застежками CLICK.<br />\r\nИдентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg; С до +50&deg; С.<br />\r\nВес: 1,72 кг<br />\r\nРазмер: UNISIZE<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nПроизводитель: Safe-Tec Пояс&nbsp;</span></p>'),
(179, 1, 52, 82, 12, 'xt11', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:55:42', '2014-07-10 04:47:51', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная привязь XT11', 6100, NULL, '', 'Температура использования: от -30° С до +50° С. Вес: 1,66 кг. Размер: UNISIZE. Разрывная нагрузка: не менее 15 кН. Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">Широкий, эргономичный кушак для комфортной поддержки. Ножные лямки имеют подкладку из дышащего пеноматериала, обеспечивающего максимальный комфорт при зависании. Брюшная точка прикрепления равномерно распределяет нагрузку между поясом и ножными лямками, когда пользователь работает без опоры под ногами. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) слегка выгнуты для удобного присоединения карабинов.<br />\r\nСпинная и грудная точки прикрепления предназначены для присоединения к системе защиты от падения. На поясе предусмотрены три разгрузочные петли в защитной оболочке. Привязь легко регулируется под размер, благодаря самофиксирующимся &nbsp;пряжкам.<br />\r\nИдентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg; С до +50&deg; С.<br />\r\nВес: 1,66 кг<br />\r\nРазмер: UNISIZE<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nПроизводитель: Safe-Tec&nbsp;</span></p>'),
(180, 1, 52, 82, 13, 'tarbet', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:56:27', '2014-07-10 04:48:23', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная TARBET', 8700, NULL, '', 'Температура использования: от -30° С до +50° С. Вес: 1,88 кг. Размер: UNISIZE. Разрывная нагрузка: не менее 15 кН. Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">Эргономичный, дышащий кушак во всю спину &nbsp;для максимально комфортной поддержки.&nbsp;<br />\r\nНожные лямки имеют подкладку из дышащего пеноматериала, обеспечивающего максимальный комфорт при зависании. &nbsp;Брюшная точка прикрепления равномерно распределяет нагрузку между поясом и ножными лямками, когда пользователь работает без опоры под ногами. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) слегка выгнуты для удобного присоединения карабинов. Спинная и грудная точки прикрепления предназначены для присоединения к системе защиты от падения. На поясе предусмотрены три разгрузочные петли в защитной оболочке.&nbsp;<br />\r\nВерхние лямки выполнены из эластичного материала и снабжены самофиксирующимися пряжками. Пояс и ножные лямки снабжены автоматическими застежками CLICK.<br />\r\nИдентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg; С до +50&deg; С.<br />\r\nВес: 1,88 кг<br />\r\nРазмер: UNISIZE<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nПроизводитель: Safe-Tec</span></p>'),
(181, 1, 52, 82, 14, 'skyver-3', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:57:08', '2014-07-10 04:48:46', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная SKYVER 3', 4325, NULL, '', 'Температура использования: от -30°C до +50°С. Вес: 1,32 кг. Размер: UNISIZE. Разрывная нагрузка: не менее 15 кН. Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">Ножные лямки имеют подкладку из дышащего пеноматериала, обеспечивающего максимальный комфорт при работе.<br />\r\nПояс и ножные лямки укомплектованы автоматическими застежками CLICK. Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Позиционирование с применением боковых точек возможно при &nbsp;использовании пояса SB1. Плечевые лямки имеют подкладку из пеноматериала и широко раздвинуты, чтобы не натирать шею. Встроенный индикатор срыва.<br />\r\nИдентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg;C до +50&deg;С.<br />\r\nВес: 1,32 кг<br />\r\nРазмер: UNISIZE<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nПроизводитель: Safe-Tec&nbsp;</span></p>'),
(182, 1, 52, 82, 15, 'skyver-5', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:57:47', '2014-07-10 04:49:13', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Привязь страховочная SKYVER 5', 5800, NULL, '', 'Температура использования: от -30°C до +50°С. Вес: 1,65 кг. Размер: UNISIZE. Разрывная нагрузка: не менее 15 кН. Производитель: Safe-Tec...', '', '<p><span style="font-size:14px;">Ножные лямки имеют подкладку из дышащего пеноматериала, обеспечивающего максимальный комфорт при работе.<br />\r\nПояс и ножные лямки укомплектованы автоматическими застежками CLICK. Точки крепления (на груди и спине) для присоединения к системе защиты от падения. Плечевые лямки имеют подкладку из пеноматериала и широко раздвинуты, чтобы не натирать шею.<br />\r\nШирокий эргономичный кушак для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Встроенный индикатор срыва.<br />\r\nИдентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg;C до +50&deg;С.<br />\r\nВес: 1,65 кг<br />\r\nРазмер: UNISIZE<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nПроизводитель: Safe-Tec&nbsp;</span></p>'),
(183, 1, 52, 82, 16, 'sb1', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:58:28', '2014-07-09 07:43:23', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Пояс для работы в подпоре SB1', 1025, NULL, '', 'Температура использования от -30° С до +50° С. Вес 0,67 кг. Размер UNISIZE. Разрывная нагрузка не менее 15 кН...', '', '<p><span style="font-size:14px;">Предназначен для фиксации рабочего положения на высоте, предотвращения попадания рабочего в зону с высоким риском падения с высоты. Идеально подходит для комфортной работы в подпоре при проведении монтерских и других видов работ. Широкий эргономичный кушак с ребрами жесткости для комфортной работы. Две боковые точки крепления на поясе для работы в подпоре (при позиционировании) имеют выгнутую форму для удобного присоединения карабинов. Три пластиковых разгрузочных кольца. Идентификационная бирка выполнена в виде книжки и содержит информацию об изделии, пользователе, способе одевания и сроках инспекционного контроля.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования от -30&deg; С до +50&deg; С.<br />\r\nВес 0,67 кг<br />\r\nРазмер UNISIZE<br />\r\nРазрывная нагрузка не менее 15 кН<br />\r\nГОСТ Р ЕН 358-2008</span></p>'),
(184, 1, 52, 82, 17, 'bs10', '', '', '', 1, '5.141.90.193', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-07 09:59:04', '2014-07-09 07:44:30', 1, '188.17.192.62', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Скамейка высотника BS10', 3800, NULL, '', 'Температура использования: от -30° С до +50° С. Вес: 0,99 кг. Размер: UNISIZE. Разрывная нагрузка: не менее 15 кН. Производитель: Safe-Tec ...', '', '<p><span style="font-size:14px;">Специальная конструкция внутренней жесткой части сиденья (двойной лист из алюминиевого сплава с ребрами жесткости) обеспечивает надежность и долговечность конструкции. Три разгрузочных петли в оплетке для снаряжения. При ненадобности использования скамейка с легкостью перемещается за спину.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nТемпература использования: от -30&deg; С до +50&deg; С.<br />\r\nВес: 0,99 кг<br />\r\nРазмер: UNISIZE<br />\r\nРазрывная нагрузка: не менее 15 кН<br />\r\nПроизводитель: Safe-Tec&nbsp;</span></p>'),
(203, 1, 9, 19, 4, 'GSN40D', 'Газовый монтажный пистолет для крепления теплоизоляции к бетону, кирпичу', 'газовый монтажный пистолет, газовый монтажный пистолет цена, газовый монтажный пистолет купить, крепление теплоизоляции, крепление +для теплоизоляции', 'Теперь крепление теплоизоляции стало проще и быстрее в 5 раз! Купить газовый монтажный пистолет для крепления теплоизоляции к кирпичу и бетону можно в Екатеринбурге.', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-10 13:45:15', '2014-07-10 09:55:29', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Toua GSN40D', 24600, NULL, '', 'Для монтажа теплоизоляции к поверхности из бетона и кирпича. Дюбель-грибы от 50 мм до 150 мм. Энергия выстрела	 90 Дж. Диапазон рабочей температуры от -15° до +50° С...', '<ul>\r\n<li><span style="font-size:14px;">Прост в эксплуатации и обслуживании - не требует предварительных навыков,</span></li>\r\n<li><span style="font-size:14px;">индикатор аккумулятора на рукоятке инструмента заранее сообщит о необходимости подзарядки,</span></li>\r\n<li><span style="font-size:14px;">увеличивает скорость монтажа теплоизоляций, так как исключает процесс бурения отверстий в стене.</span></li></ul>', '<h1><span style="font-size:16px;"><strong>Газовый монтажный пистолет для монтажа теплоизоляции Toua GSN40D.</strong></span></h1>\r\n<p><span style="font-size:14px;">Прямой монтаж теплоизоляции к бетону и кирпичу с использованием специализированных дюбель-грибов без сверления и бурения отверстий в стене.&nbsp;Дюбель грибы длиной 50-150 мм мгновенно забиваются в бетон и крепко фиксируют утеплитель на поверхности.</span></p>\r\n<p><strong><span style="font-size: 14px; line-height: 1.6em;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Дюбель-гриб для для теплоизоляции 50-150 мм<br />\r\nТолщина теплоизоляции 50-150 мм<br />\r\nЭнергия выстрела 90 Дж<br />\r\nТип аккумулятора NiCd - 1,2 Ah - 6V DC<br />\r\nЕмкость аккумулятора 4000 выстрелов<br />\r\nЕмкость газового баллона 1000 выстрелов<br />\r\nРазмеры&nbsp;&nbsp; &nbsp; 464 х 384 х 107 мм<br />\r\nВес с аккумулятором 3,5 кг<br />\r\nДиапазон рабочей температуры от -15&deg; до +50&deg; С</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe allowfullscreen="" frameborder="0" height="315" src="//www.youtube-nocookie.com/embed/dZJqVDPfD-A" width="420"></iframe></p>');
INSERT INTO `Message2004` (`Message_ID`, `User_ID`, `Subdivision_ID`, `Sub_Class_ID`, `Priority`, `Keyword`, `ncTitle`, `ncKeywords`, `ncDescription`, `Checked`, `IP`, `UserAgent`, `Parent_Message_ID`, `Created`, `LastUpdated`, `LastUser_ID`, `LastIP`, `LastUserAgent`, `Name`, `Price`, `OldPrice`, `Pictures`, `ShortDescription`, `Advantages`, `Description`) VALUES
(185, 1, 27, 76, 5, 'lta-1', 'Лебедка тяговая автономная всего за 86000 руб.', 'купить лебедку, лебедка цена, лебедка рычажная, тяговая лебедка', 'Продажа лебедок в Екатеринбурге. Тяга до 1 т.   Широкий ассортимент. Ознакомьтесь с характеристиками.', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-10 09:22:11', '2014-07-10 07:50:44', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ЛТА-1', 86000, NULL, '', 'Максимальное тяговое усилие: 1 т. Диаметр турачки (барабана) в месте намотки троса: 155 мм. Объем двигателя 163 см3. Максимальная мощность 4.0 кВт (5.5 л.с.) / 3 600 об/мин...', '<p><span style="font-size:14px;">имеет правое и левое вращение и две скорости тяжения,<br />\r\nс бензиновым приводом и горизонтальным тяговым фрикционным барабаном.</span></p>', '<h1><span style="font-size:16px;"><strong>Лебедка тяговая автономная ЛТА-1</strong></span></h1>\r\n<p><span style="font-size:14px;">Оснащена тремя рычагами управления:направления вращения(вперед\\назад), скорости вращения(низкая\\высокая) и &nbsp;рычагом расцепителем, который служит для кратковременного разъединения двигателя от механизма редуктора и вновь его плавного соединения. Механизм сцепления предназначен для передачи крутящего момента двигателя на вал редуктора лебедки.&nbsp;<br />\r\nС помощью данной лебедки осуществляется перенос груза, протяжка кабеля и т.д. Также лебедка применяется не только в быту, но и в таких отраслях, как строительная, автомобильная и т.п.</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong><br />\r\nМаксимальное тяговое усилие: 1 т<br />\r\n1-я скорость натяжения: &nbsp;10 м/мин., &nbsp;тяга 0,8 т.<br />\r\n2-я скорость натяжения: 15 м/мин., тяга 0,6 т.<br />\r\nРеверс: 12 м/мин. (на реверсе груз не поднимать!)&nbsp;<br />\r\nДиаметр турачки (барабана) в месте намотки троса: 155 мм<br />\r\nРазмеры: 800х500х450<br />\r\nМасса: 39 кг</span></p>\r\n<p><span style="font-size:14px;"><strong>Характеристика приводного устройства:&nbsp;</strong><br />\r\nДвигатель Honda GX 160: 4-тактный бензиновый двигатель с верхним расположением клапана цилиндра(OHV), горизонтальным валом и воздушным охлаждением; цилиндр расположен под углом 25В&deg;<br />\r\nОбъем двигателя: 163 см3<br />\r\nМаксимальная мощность: 4.0 кВт (5.5 л.с.) / 3 600 об/мин<br />\r\nМаксимальный крутящий момент: 10.8 Нм / 1.1 кг/м / 2 500 об/мин<br />\r\nУдельный расход топлива: 313 г/кВт.ч - 230 г/л.с.ч<br />\r\nГабаритные размеры, мм: 312 x 362 x 335<br />\r\nСухая масса 15 кг</span></p>\r\n<p><span style="font-size:14px;"><strong>Комплектация лебедки:</strong><br />\r\nБензиновый двигатель<br />\r\nРама<br />\r\nПриводные ремни</span></p>\r\n<p><span style="font-size:14px;"><strong>Расчет перемещения груза лебедкой:</strong><br />\r\nУсилие необходимое для перемещения груза = W x sin&alpha; + K x W x cos&alpha;<br />\r\nГде W - масса груза<br />\r\n&nbsp; &nbsp; &alpha; &nbsp;- угол наклона плоскости.<br />\r\n&nbsp; &nbsp; К - коэффициент трения.&nbsp;<br />\r\nПри перемещении груза по воде и протяжке кабеля по роликам К=0,2-0,3.<br />\r\nПри перемещении груза по бетонной поверхности К=0,5-0,7&nbsp;</span></p>'),
