(198, 1, 56, 83, 12, 'rt-5665long', 'Гайковерты в Екатеринбурге', 'гайковерт цена, гайковерт пневматический ударный, гайковерт ручной, пневматический гайковерт цена, ударный гайковерт цена, гайковерт 1 2, пневмо гайковёрт, купить пневматический гайковерт, шуруповерт гайковерт, гайковерт +для грузовиков', 'Гайковерт ручной с длинным валом. данного класса широко применяется в автомобилестроении, судостроении, монтаже железнодорожных рельс и т.п.', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-10 13:16:18', '2014-07-10 09:16:18', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ROTAKE RT-5665 (с длинным валом)', 10400, 0, '', 'Квадратный хвостовик:  1 "; Максимальный диаметр головки для гайки : 1-1/2 "(38 мм); Скорость холостого хода:  5000 оборотов в минуту...', '<ul>\r\n<li><span style="font-size:14px;">Сверхмощный;</span></li>\r\n<li><span style="font-size:14px;">Высокий крутящий момент</span></li></ul>\r\n<p>&nbsp;</p>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пневматический ударный гайковерт ROTAKE RT-5665 (с длинным валом)</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Предназначен для профессионального использования на строительной &nbsp; &nbsp;площадке, производстве, станции технического обслуживания грузовиков и &nbsp;автобусов.&nbsp;Пневмогайковерты применяются при сборке крупных &nbsp;машин, грузовых автомобилей, &nbsp;и в кораблестроении. Позволяет разбирать старые болтовые соединения.</span></p>\r\n<p><strong><span style="font-size: 14px; line-height: 1.6em;">Технические характеристики:</span></strong></p>\r\n<p><span style="font-size:14px;">Тип ударного механизма: Pinless Hammer<br />\r\nКвадратный хвостовик: 1 &quot;&nbsp;<br />\r\nМаксимальный диаметр головки для гайки : 1-1/2 &quot;(38 мм)&nbsp;<br />\r\nСкорость холостого хода: 4000 оборотов в минуту&nbsp;<br />\r\nРасход воздуха: 23 cfm&nbsp;<br />\r\nМаксимальный крутящий момент: 1696 ft-фунтов (2300Nm)&nbsp;<br />\r\nДиаметр воздушного шланга ID.3/8&#39;&#39;-9.5 мм<br />\r\nВес нетто: 13,50 kgs&nbsp;<span style="line-height: 1.6em;">&nbsp;</span></span></p>\r\n<p>&nbsp;</p>'),
(199, 1, 56, 83, 13, 'RT-5880', 'Гайковерт ручной с длинным валом', 'гайковерт +для грузовиков, гайковерт ударный, куплю гайковерт, купить гайковерт, гайковерт цена, гайковерт пневматический ударный, гайковерт 1, гайковерт ручной, пневматический гайковерт цена, ударный гайковерт цена', 'Пневматический гайковерт с длинным валом предназначен для профессионального использования на строительной    площадке, производстве, станции технического обслуживания грузовиков и  автобусов. Позволяет разбирать старые болтовые соединения. Высокий крутящий момент.', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-10 13:16:46', '2014-07-10 09:16:46', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ROTAKE RT-5880 (с длинным валом)', 14400, 0, '', 'Квадратный хвостовик: 1 ", Максимальный диаметр головки для гайки : 1-3/4 "(45 мм), Скорость холостого хода: 3500 оборотов в минуту...', '<ul>\r\n<li style="font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 11px; line-height: 15px; background-color: rgb(255, 255, 255);"><span style="font-size:14px;">Предназначен для профессионального использования на строительной &nbsp; &nbsp;площадке, производстве, станции технического обслуживания грузовиков и &nbsp;автобусов;</span></li>\r\n<li style="font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 11px; line-height: 15px; background-color: rgb(255, 255, 255);"><span style="font-size:14px;">Позволяет разбирать старые болтовые соединения</span></li>\r\n<li style="font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 11px; line-height: 15px; background-color: rgb(255, 255, 255);"><span style="font-size:14px;">Высокий крутящий момент.</span></li></ul>', '<h1><span style="font-size:14px;"><strong><span style="background-color:#FF8C00;">Пневматический ударный гайковерт ROTAKE RT-5880 (с длинным валом)</span></strong></span></h1>\r\n<h1><span style="font-size:14px;">Гайковерт ручной с длинным валом&nbsp;данного класса широко применяется в автомобилестроении, судостроении, монтаже железнодорожных рельс и т.п.</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong></span></p>\r\n<p><span style="font-size:14px;">Тип ударного механизма: Pinless Hammer<br />\r\nКвадратный хвостовик: 1 &quot;&nbsp;<br />\r\nМаксимальный диаметр головки для гайки : 1-3/4 &quot;(45 мм)&nbsp;<br />\r\nСкорость холостого хода: 3500 оборотов в минуту&nbsp;<br />\r\nРасход воздуха: 23 cfm&nbsp;<br />\r\nМаксимальный крутящий момент: 3540 ft-фунтов (3800Nm)&nbsp;<br />\r\nДиаметр воздушного шланга ID.3/8&#39;&#39;-9.5 мм<br />\r\nВес нетто: 17,33 kgs</span></p>'),
(201, 1, 56, 83, 15, 'RT-5990', 'Пневмогайковерты  от 3500 руб.', 'гайковерт ударный, куплю гайковерт, купить гайковерт, гайковерт цена, гайковерт пневматический ударный, гайковерт 1, гайковерт ручной, пневматический гайковерт цена, ударный гайковерт цена', 'Пневматический ударный гайковерт ROTAKE RT-5990 (с длинным валом). Очень прочный корпус, Эргономичные и удобные ручки, Высокий крутящий момент.', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-07-10 13:17:25', '2014-07-10 09:17:25', 1, '94.51.110.39', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'ROTAKE RT-5990 (с длинным валом)', 15700, 0, '', 'Тип ударного механизма: Pinless Hammer; Квадратный хвостовик: 1 "; Максимальный диаметр головки для гайки : 2 "(50мм); Скорость холостого хода: 3000 оборотов в минуту...', '<ul>\r\n<li><span style="font-size:14px;">Очень прочный корпус,&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Эргономичные и удобные ручки,&nbsp;</span></li>\r\n<li><span style="font-size:14px;">Высокий крутящий момент.</span></li></ul>', '<h1><span style="font-size:16px;"><strong><span style="background-color:#FF8C00;">Пневматический ударный гайковерт ROTAKE RT-5990 (с длинным валом)</span></strong></span></h1>\r\n<p><span style="font-size:14px;">Гайковерт предназначен для профессионального использования на строительной площадке, производстве, станции технического обслуживания грузовиков и автобусов. идеально подходят для тяжелых работ по техническому обслуживанию, в гаражах грузовых автомобилей, тяжелой строительной техники, сельскохозяйственной техники и т.д., могут быть использованы для сборки и разборки резьбовых соединений</span></p>\r\n<p><span style="font-size:14px;"><strong>Технические характеристики:</strong></span></p>\r\n<p><span style="font-size:14px;">Тип ударного механизма: Pinless Hammer<br />\r\nКвадратный хвостовик: 1 &quot;&nbsp;<br />\r\nМаксимальный диаметр головки для гайки : 2 &quot;(50мм)&nbsp;<br />\r\nСкорость холостого хода: 3000 оборотов в минуту&nbsp;<br />\r\nРасход воздуха: 23 cfm&nbsp;<br />\r\nМаксимальный крутящий момент: 3540 ft-фунтов (4800Nm)&nbsp;<br />\r\nДиаметр воздушного шланга ID.3/8&#39;&#39;-9.5 мм<br />\r\nВес нетто: 19.57 kgs</span></p>');
