(1, 1, 14, 10, 1, '', '', '', '', 0, '83.149.38.60', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_9_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36', 0, '2014-05-29 12:54:47', '2014-07-07 07:27:21', 1, '5.141.91.149', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Евгений', '<p style="margin: 0px 0px 1em; color: rgb(0, 0, 0); font-family: Arial, ''Geneva CY'', sans-serif; line-height: normal;">Купил газовый монтажный пистолет мм-40Б, по стоимости в разы дешевле аналогов. Про расходники я вобще молчу 1,4 руб. за выстрел почти даром. Вобщем кто еще не решил берите не прогодаете.</p>', 'otzyv.jpg:image/jpeg:2013:14/10/otzyv.jpg'),
(2, 1, 14, 10, 2, '', '', '', '', 0, '5.141.91.100', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 0, '2014-06-18 14:44:25', '2014-07-07 07:27:19', 0, NULL, NULL, 'Александр', '<p>Занимаюсь укладкой проводки на стройке, взял себе газовый пистолет, скорость на высоте. На стройке все в шоке особенно когда сказал про цену). Советую !!!</p>', '');
