(6, 'Яндекс: Карты', 'yandexmaps', '', 'Яндекс', 0, '<script src=''http://api-maps.yandex.ru/1.1/index.xml?key=".$api_key."'' type=''text/javascript''></script>\r\n<style type=''text/css''>\r\n   #".$div_name." td{ padding: 0 }\r\n   #".$div_name." table{ width: auto }\r\n</style>\r\n<div id=''".$div_name."'' style=''width: ".$f_width."px; height: ".$f_height."px; color:black;''>просмотр карты недоступен</div>\r\n\r\n<script type=''text/javascript''>\r\n    YMaps.jQuery(function () {\r\n        var map = new YMaps.Map(YMaps.jQuery(''#".$div_name."'')[0]);\r\n        map.setCenter(new YMaps.GeoPoint(". $f_center ."), ".$f_scale.");\r\n        map.setType(YMaps.MapType.". $map_type .");\r\n\r\n        ".($f_enableDblClickZoom!=''1'' ? "map.disableDblClickZoom();" : "")."\r\n        ".($f_enableScrollZoom==''1'' ? "map.enableScrollZoom();" : "")."\r\n        ".($f_enableHotKeys==''1'' ? "map.enableHotKeys();" : "")."\r\n        ".($f_enableMiniMap==''1'' ? "map.addControl(new YMaps.MiniMap());" : "")."\r\n        map.addControl(new YMaps.ToolBar([".($f_enableMove==''1'' ? "new YMaps.ToolBar.MoveButton()," : "") . ($f_enableMagnifier==''1'' ? "new YMaps.ToolBar.MagnifierButton()," : "") . ($f_enableRuler==''1'' ? "new YMaps.ToolBar.RulerButton()" : "")."]));\r\n        ".($f_enableZoomBar==''1'' ? "map.addControl(new YMaps.Zoom());" : "")."\r\n        ".($f_enableZoomBar==''2'' ? "map.addControl(new YMaps.SmallZoom());" : "")."\r\n        ".($f_enableMapType==''1'' ? "map.addControl(new YMaps.TypeControl([YMaps.MapType.MAP,YMaps.MapType.SATELLITE,YMaps.MapType.HYBRID],[0,1,2]));" : "")."\r\n\r\n        var s = new YMaps.Style();\r\n        s.lineStyle = new YMaps.LineStyle();\r\n        s.lineStyle.strokeWidth = ''3'';\r\n        YMaps.Styles.add(''netcat#NormalLine'', s);\r\n\r\n        ".$placemarks."\r\n        ".$polyline."\r\n    })</script>\r\n', '$api_key = $f_api_key1 . opt($f_api_key2, "~".$f_api_key2) . opt($f_api_key3, "~".$f_api_key3) .\r\n           opt($f_api_key4, "~".$f_api_key4) . opt($f_api_key5, "~".$f_api_key5);\r\n$div_name = ($f_div_name ? $f_div_name : "YMapsID");\r\n$map_type = ($f_map_type ? $f_map_type : "MAP");\r\n\r\nif ($f_placemarks) {\r\n  $placemarks_arr = explode("n", $f_placemarks);\r\n  $i = 0;\r\n  foreach ($placemarks_arr as $mark)\r\n    if ($mark!="") {\r\n      $mark = str_replace("r", "", $mark);\r\n      $mark_arr = explode(";", $mark);\r\n      $placemarks .= "var placemark".$i." = new YMaps.Placemark(new YMaps.GeoPoint(".$mark_arr[0]."));n";\r\n      if ($mark_arr[1] != "") {\r\n        $placemarks .= "placemark".$i.".name = ''".$mark_arr[1]."'';\r\n        placemark".$i.".setIconContent(''".$mark_arr[1]."'');";\r\n      }\r\n      if ($mark_arr[2] != "")\r\n        $placemarks .= "placemark".$i.".description = ''".$mark_arr[2]."'';n";\r\n      if ($mark_arr[3] != "")\r\n        $placemarks .= "placemark".$i.".setOptions({style: ''".$mark_arr[3]."''});n";\r\n      $placemarks .= "map.addOverlay(placemark".$i.");n";\r\n      $i++;\r\n    }\r\n}\r\n\r\nif ($f_polyline) {\r\n$f_poly_arr = explode("n", $f_polyline);\r\n$i = 0;\r\nforeach ($f_poly_arr as $poly)\r\n  if ($poly) {\r\n  $polyline .= "pl".$i." = new YMaps.Polyline([";\r\n  $polyline_arr = explode(";", $poly);\r\n  foreach ($polyline_arr as $mark)\r\n    if ($mark!="")\r\n      $polyline .= "new YMaps.GeoPoint(".$mark."),";\r\n  $polyline .= "]);n pl".$i.".setStyle(''netcat#NormalLine'');n map.addOverlay(pl".$i.");n";\r\n  $i++;\r\n  }\r\n}\r\n', '', '', 1, 1, '2014-06-15 12:51:04', '2014-06-15 08:51:27', 0, 0, 1, '/6/', '', '', 0),
